INSERT INTO `table_about` (`id`, `ten`, `tenkhongdau`, `mota`, `noidung`, `photo`, `thumb`, `stt`, `hienthi`, `ngaytao`, `ngaysua`, `title`, `description`, `keywords`, `type`, `tenen`, `motaen`, `noidungen`) VALUES
(1, 's', 'as', 'Sn giao dch TMT CarOntrade.com kt ni ngi mua v ngi bn li vi nhau, mang n cho ngi dng nhng thng v giao dch thnh cng. Vi khu hiu n gin ho s la chn ca bn, Sn giao dch TMT CarOntrade.com mang n cho ngi dng nhng tri nghim tm kim, giao dch xe hi mt cch hiu qu, an ton v nhanh gn.', '<p style="text-align: center;"></p>\r\n\r\n<p style="text-align: center;"><span style="font-family:times new roman,times,serif;"><strong><span style="font-size: 22px;"><span style="font-size:24px;">Gii thiu</span></span></strong></span></p>\r\n\r\n<p style="text-align: center;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-family:times new roman,times,serif;"><span style="font-size:16px;">Cng ty TNHH CARONTRADE cung cp dch v thng mi trc tuyn mua bn xe hi, ng thi cung cp dch v qung co cho nhng sn phm dch v lin quan n lnh vc xe hi, mang n cho ngi dng mt th trng mua bn xe hi trc tuyn a dng.</span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-family:times new roman,times,serif;"><span style="font-size:16px;">Sn giao dch TMT CarOntrade.com kt ni ngi mua v ngi bn li vi nhau, mang n cho ngi dng nhng thng v giao dch thnh cng. Vi khu hiu n gin ho s la chn ca bn, Sn giao dch TMT CarOntrade.com mang n cho ngi dng nhng tri nghim tm kim, giao dch xe hi mt cch hiu qu, an ton v nhanh gn.</span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p dir="ltr" style="line-height: 1.38; margin-top: 0pt; margin-bottom: 0pt; text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;"><span id="docs-internal-guid-8e0bf68e-7fff-5745-54ee-bbca949c2628"><span background-color:="" color:="" font-variant-east-asian:="" font-variant-numeric:="" new="" times="" vertical-align:="" white-space:="">t tiu ch n gin ha s la chn ca bn ln hng u, CarOntrade khng ngng ci thin tm kim nhng gii php nhm gip vic mua bn xe trn Sn nhanh chng, d dng hn. CarOntrade s hu giao din theo phong cch ti gin vi cc b lc trc quan, chi tit, quy cch ng tin nhanh gn</span><span color:="" font-variant-east-asian:="" font-variant-numeric:="" new="" times="" vertical-align:="" white-space:="">.</span></span></span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p dir="ltr" style="line-height: 1.38; margin-top: 0pt; margin-bottom: 0pt; text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;"><span id="docs-internal-guid-8e0bf68e-7fff-5745-54ee-bbca949c2628"><span color:="" font-variant-east-asian:="" font-variant-numeric:="" new="" times="" vertical-align:="" white-space:="">Vi nhiu nhng u im ni bt trn giao din, </span><span background-color:="" color:="" font-variant-east-asian:="" font-variant-numeric:="" new="" times="" vertical-align:="" white-space:="">iu ny gip cho nhng khch hng khng rnh cng ngh hay ln u bun bn online cng u c th thao tc v s dng d dng vi nhiu tiu ch nh: ng k nhanh chng, theo di bi ng d dng, thao tc ng tin n gin, tin tc cp nht thng xuyn v mi nht. </span></span><span font-size:="" new="" style="background-color: transparent;" times="" white-space:="">ng thi, khi c s c hoc c nhng vn  hay thay i v bt c ni dung g lin quan n xe cng s c thng bo cho ngi dng trong thi gian ngn nht. </span></span></span></p>\r\n\r\n<div></div>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p align="center"><span style="font-family:times new roman,times,serif;"><span style="font-size:24px;"><strong>Tm nhn, s mnh v gi tr ct li</strong></span></span></p>\r\n\r\n<p align="center"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-family:times new roman,times,serif;"><span style="font-size:16px;"><strong>Tm nhn</strong></span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-family:times new roman,times,serif;"><span style="font-size:16px;">Vi kht vng c th ph sng th trng giao dch xe hi trc tuyn trong nc v chm n c th trng quc t, CarOntrade tch cc phn u v u tranh  xy dng nn mt thng hiu hng u Vit Nam. Mong mun pht trin doanh nghip da trn s nh gi ca ngi dng v chng ti.</span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-family:times new roman,times,serif;"><span style="font-size:16px;">CarOntrade khng ngng ci thin cht lng dch v, mang n cho ngi dng nhng tri nghim d dng trong vic s dng cc tnh nng trn Sn, tm kim sn phm xe theo nhu cu mt cch nhanh chng, rt ngn thi gian bn c xe ca ngi bn.</span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-family:times new roman,times,serif;"><span style="font-size:16px;"><strong>S mnh</strong></span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: center;"><span style="font-family:times new roman,times,serif;"><span style="font-size:16px;">Gip n gin ho cuc sng cho tt c mi ngi</span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-family:times new roman,times,serif;"><span style="font-size:16px;"><strong>Gi tr ct li</strong></span></span></p>\r\n\r\n<p style="text-align: center;"><span style="font-family:times new roman,times,serif;"><span style="font-size:16px;">Uy tn  An ton  Nhanh chng  Tn tm</span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-family:times new roman,times,serif;"><span style="font-size:16px;"><strong>Uy tn</strong></span></span></p>\r\n\r\n<p style="text-align: justify;"><span style="font-family:times new roman,times,serif;"><span style="font-size:16px;"></span></span></p>\r\n\r\n<p style="text-align: justify;"><span style="font-family:times new roman,times,serif;"><span style="font-size:16px;">CarOntrade t ch tn ln hng u, chng ti gy dng thng hiu vi mc tiu lun lun lng nghe nhng sai xt t pha khch hng v ci thin trit  nhm bo v danh d ca doanh nghip, to nim tin  khch hng c th ng hnh cng chng ti v lu di.</span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-family:times new roman,times,serif;"><span style="font-size:16px;"><strong>An ton</strong></span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-family:times new roman,times,serif;"><span style="font-size:16px;">Kim duyt ni dung cht ch, bo mt thng tin khch hng tuyt i, CarOntrade xem s an ton ca khch hng nh chnh s an ton ca doanh nghip, bo v khch hng l trch nhim v ngha v ca chng ti.</span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-family:times new roman,times,serif;"><span style="font-size:16px;"><strong>Nhanh chng</strong></span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-family:times new roman,times,serif;"><span style="font-size:16px;">CarOntrade pht trin v cung cp dch v a dng vi cc thao tc n gin, gip cho khch hng khi s dng s nhanh chng tm c sn phm xe hi m mnh mong mun, theo di tin ng sn phm xe hi mt cch d dng.</span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-family:times new roman,times,serif;"><span style="font-size:16px;"><strong>Tn tm</strong></span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-family:times new roman,times,serif;"><span style="font-size:16px;">CarOntrade gii p mi thc mc t pha khch hng mi lc mi ni, lun ng hnh v xem khch hng l s sng cn ca doanh nghip.</span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: center;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;"><em style="box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; font-size: 16px; vertical-align: baseline; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; font-family: &quot;times new roman&quot;, times, serif; text-align: center;">Chn thnh cm n bn  s dng dch v ca CarOntrade!</em></span></span></p>\r\n\r\n<p align="center"></p>\r\n', 'dv1-0941.png', '', 1, 1, 1432957701, 1537054878, 'V Chng Ti', 'Xe hi gi tt, ng tin min ph, mua bn xe ngay c khi bn ang  nh ti CarOntrade Vit Nam. Gii php COT gip bn mua bn xe hiu qu.', 'Gii php COT, CarOntrade Vit Nam, CarOntrade.com, xe hi gi r, xe mi gi tt, xe mi gi r, xe c gi r, xe c gi tt, mua bn xe hi c gi r,  t c gi r,  t mi gi tt.', 'about', '', '<p>zzzzzzzzzzzzzzzzcccc</p>\r\n', '<p>ok men</p>\r\n'),
(18, '', '', '', '<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: center;"><span style="font-family:times new roman,times,serif;"><strong><span style="font-size:24px;">Chnh sch bo mt</span></strong></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-family:times new roman,times,serif;"><span style="font-size:16px;">Chnh sch bo mt cho bn bit chng ti s dng thng tin c nhn ca bn ti Sn giao dch TMT CarOntrade.com ny nh th no. Xin vui lng c chnh sch bo mt trc khi s dng trang web hoc gi bt k thng tin c nhn no.</span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-family:times new roman,times,serif;"><span style="font-size:16px;">Khi s dng trang web, bn ang chp nhn nhng iu c m t trong chnh sch bo mt. Nhng iu ny c th thay i, nhng bt k thay i no cng u sc ng ln v thay i s ch p dng cho cc hot ng v thng tin trn c s tnh tin, ch khng phi hi t. Bn nn xem li chnh sch bo mt bt c khi no bn truy cp trang web  m bo rng mnh hiu cc thng tin c nhn m bn cung cp s c s dng nh th no. Chnh sch ca chng ti l gi kn thng tin c nhn nhn c t trang web hon ton b mt v ch dng cho mc ch ni b. Chng ti s khng chia s thng tin c nhn ca bn vi bt k bn no khc. Hy yn tm rng chng ti tn trng s ring t ca bn v x l d liu c nhn ca bn vi s cn trng ti a.</span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-family:times new roman,times,serif;"><span style="font-size:16px;"><strong>Mc ch v phm vi thu thp</strong></span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-family:times new roman,times,serif;"><span style="font-size:16px;">Vic thu thp d liu ch yu trn Sn giao dch TMT CarOntrade.com bao gm: h v tn, a ch email, s in thoi, tn ng nhp, mt khu ng nhp, a ch khch hng. y l cc thng tin m CarOntrade cn khch hng cung cp bt buc khi ng k s dng dch v v chng ti s dng  lin h xc nhn khi khch hng ng k s dng dch v trn CarOntrade, m bo quyn li cho khch hng, da trn quy nh ti khoan 3 iu 36 Nghi inh 52/2013/N-CP ngay 16/5/2013. Khi ng k thnh vin ca CarOntrade, ng ngha vi vic khch hng t nguyn cung cp thng tin c nhn ca mnh cho chng ti.</span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-family:times new roman,times,serif;"><span style="font-size:16px;">Cc khch hng s t chu trch nhim v bo mt v lu gi mi hot ng s dng dch v di tn ng k, mt khu v hp th in t ca mnh. Ngoi ra, khch hng c trch nhim thng bo kp thi cho Sn TMT CarOntrade.com v nhng hnh vi s dng tri php, lm dng, vi phm bo mt, lu gi tn ng k v mt khu ca bn th ba  c bin php gii quyt ph hp.</span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-family:times new roman,times,serif;"><span style="font-size:16px;"><strong>Phm v s dng thng tin</strong></span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-family:times new roman,times,serif;"><span style="font-size:16px;">Sn giao dch TMT CarOntrade.com s dng thng tin khch hng cung cp :</span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-family:times new roman,times,serif;"><span style="font-size:16px;">- Cung cp cc dch v n khch hng.</span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-family:times new roman,times,serif;"><span style="font-size:16px;">- Gi cc thng bo v cc hot ng trao i thng tin gia khch hng v CarOntrade.</span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-family:times new roman,times,serif;"><span style="font-size:16px;">- Ngn nga cc hot ng ph hy ti khon ngi dng ca khch hng hoc cc hot ng gi mo khch hng.</span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-family:times new roman,times,serif;"><span style="font-size:16px;">- Lin lc v gii quyt vi khch hng trong nhng trng hp c bit.</span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-family:times new roman,times,serif;"><span style="font-size:16px;">- Khng s dng thng tin c nhn ca khch hng ngoi mc ch xc nhn v lin h c lin quan n giao dch ti CarOntrade.</span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-family:times new roman,times,serif;"><span style="font-size:16px;">Chng ti c trch nhim hp tc cung cp thng tin c nhn khch hng khi c yu cu t c quan nh nc c thm quyn.</span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-family:times new roman,times,serif;"><span style="font-size:16px;"><strong>Thi gian lu tr thng tin</strong></span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-family:times new roman,times,serif;"><span style="font-size:16px;">D liu c nhn ca khch hng s c lu tr cho n khi c yu cu hy b hoc t khch hng ng nhp v thc hin vic hy b. Cn li trong mi trng hp thng tin c nhn khch hng s c bo mt trn my ch ca CarOntrade.</span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-family:times new roman,times,serif;"><span style="font-size:16px;"><strong>a ch ca n v thu thp, qun l thng tin v h tr khch hng</strong></span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<ul>\r\n	<li style="text-align: justify;"><span style="font-family:times new roman,times,serif;"><span style="font-size:16px;"><strong>CNG TY TNHH CARONTRADE</strong></span></span></li>\r\n	<li style="text-align: justify;"><span style="font-family:times new roman,times,serif;"><span style="font-size:16px;"><strong>a ch lin h: 190/92a Xm t, Phng 10, Qun 11, Thnh Ph H Ch Minh, Vit Nam</strong></span></span></li>\r\n	<li style="text-align: justify;"><span style="font-family:times new roman,times,serif;"><span style="font-size:16px;"><strong>VPGD: 190/92a Xm t, Phng 10, Qun 11, Thnh Ph H Ch Minh, Vit Nam</strong></span></span></li>\r\n	<li style="text-align: justify;"><span style="font-family:times new roman,times,serif;"><span style="font-size:16px;"><strong>Hotline: 0126 4428 166</strong></span></span></li>\r\n	<li style="text-align: justify;"><span style="font-family:times new roman,times,serif;"><span style="font-size:16px;"><strong>a ch email: </strong><a href="mailto:bophankinhdoanh@carontrade.com">bophankinhdoanh@carontrade.com</a>  <a href="mailto:hotrokhachhang@carontrade.com">hotrokhachhang@carontrade.com</a>. </span></span></li>\r\n</ul>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-family:times new roman,times,serif;"><span style="font-size:16px;"><strong>Phng tin v cng c  khch hng tip cn v chnh sa d liu ca mnh</strong></span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-family:times new roman,times,serif;"><span style="font-size:16px;">Khch hng c quyn t kim tra, cp nht, iu chnh thng tin c nhn ca mnh bng cch ng nhp vo ti khon v chnh sa thng tin c nhn hoc yu cu CarOntrade thc hin vic ny.</span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-family:times new roman,times,serif;"><span style="font-size:16px;">Khch hng c quyn gi khiu ni v vic l thng tin cc nhn cho bn th ba n a ch email <a href="mailto:bophankinhdoanh@carontrade.com">bophankinhdoanh@carontrade.com</a>  <a href="mailto:hotrokhachhang@carontrade.com">hotrokhachhang@carontrade.com</a>. Khi tip nhn nhng phn hi ny, chng ti s xc nhn li thng tin, phi c trch nhim tr li l do v hng dn khch hng khi phc v bo mt li thng tin.</span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-family:times new roman,times,serif;"><span style="font-size:16px;"><strong>Cam kt bo mt thng tin c nhn khch hng</strong></span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-family:times new roman,times,serif;"><span style="font-size:16px;">Thng tin c nhn ca khch hng s c chng ti cam kt bo mt tuyt i theo chnh sch bo v thng tin c nhn ca CarOntrade, da trn iu 68 n iu 73, Mc 1 Bo v thng tin c nhn trong TMT (Chng V) quy nh ti Ngh nh 52/2013/N-CP.</span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-family:times new roman,times,serif;"><span style="font-size:16px;">CarOntrade cam kt khng s dng, khng chuyn giao, cung cp hay tit l cho bn th ba no v thng tin c nhn ca khch hng khi khng c s cho php hoc ng  t khch hng, tr nhng trng hp php lut c quy nh khc.</span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-family:times new roman,times,serif;"><span style="font-size:16px;">Trong trng hp my ch lu tr thng tin b hacker tn cng dn n mt mt d liu c nhn khch hng, CarOntrade s c trch nhim thng bo v vic cho c quan chc nng iu tra x l kp th v thng bo cho khch hng c bit.</span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: center;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;"><em style="box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; font-size: 16px; vertical-align: baseline; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; font-family: &quot;times new roman&quot;, times, serif; text-align: center;">Chn thnh cm n bn  s dng dch v ca CarOntrade!</em></span></span></p>\r\n', '', '', 1, 1, 1529125154, 1537054941, 'CarOntrade - Chnh Sch Bo Mt', 'Nhiu loi xe hi mi,  qua s dng ang c rao bn vi gi tt nht ti CarOntrade.com, gii php COT gip bn mua bn xe hiu qu.', 'Gii php COT, CarOntrade Vit Nam, CarOntrade.com, xe hi gi r, xe mi gi tt, xe mi gi r, xe c gi r, xe c gi tt, mua bn xe hi c gi r,  t c gi r,  t mi gi tt.', 'baomat', '', '', ''),
