(14, '', '', '', '<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align:center"><img alt="" height="375" src="http://carontrade.com/upload/images/mecanic2.jpg" width="500" /></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;">Tnh nng nh gi xe s gip bn bit c gi tr chic xe ca bn hin ti l bao nhiu. Cc ch s do bn CarOntrade cung cp ch mang tnh cht tham kho, chng ti  ngh bn khng nn qu ph thuc vo cc ch s ny.</span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n', '', '', 1, 0, 1527907736, 1534223803, '', '', '', 'dinhgiaxe', '', '', ''),
(15, '', '', '', '<p></p>\r\n\r\n<p style="text-align: center;"><strong><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;">Bn mun bit tnh trng xe ca mnh nh th no? </span></span></strong></p>\r\n\r\n<p style="text-align: center;"></p>\r\n\r\n<p style="text-align: center;"><strong><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;">Tham kho bn di nh!</span></span></strong></p>\r\n\r\n<p></p>\r\n\r\n<p></p>\r\n\r\n<div contenteditable="false" style="line-height: 0; text-align: center;" tabindex="-1">\r\n<p data-widget="image"><img alt="" height="401" src="http://carontrade.com/upload/images/pexels-photo-1266019.jpeg" width="600" /></p>\r\n<span admin="" carontrade.com="" ckeditor="" http:="" images="" plugins="" style="left: 0px; background: url(" top:="" widget=""><img alt="" height="15" src="data:image/gif;base64,R0lGODlhAQABAPABAP///wAAACH5BAEKAAAALAAAAAABAAEAAAICRAEAOw%3D%3D" title="Click and drag to move" width="15" /></span></div>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;"><span new="" times=""><strong>QUY INH CP <a href="http://carontrade.com/dinh-gia-xe.html" target="_blank">NH GIA</a>:</strong></span></span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<ul>\r\n	<li style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;"><span new="" times=""><a href="http://www.giaxeotohonda.com.vn/"><strong>INH GIA CP  1</strong></a><strong>:</strong>Xe c gi gin bao dng nghim tuc, ni tht, ngoai tht, vo xe con ep, gian gm, h thng giam soc, thc tay lai, lc lanh, h thng inECU, may moc hoat ng n inh, con  mc  trn 80% n 90% hoc cao hn, c th chng minh vic bo dng nghim tc thng qua s theo doi bao dng thi se ap dung INH GIA CP  1.</span></span></span></li>\r\n</ul>\r\n\r\n<p style="text-align: justify;"><span style="font-s