U, may moc hoat ng khng n inh, con  mc  t 30% n di 40% so vi xe mi 100% ban u, khng chng minh c vic bo dng nghim tc thi se ap dung INH GIA CP  4.</span></span></span></li>\r\n</ul>\r\n\r\n<p style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;"><span new="" times=""></span></span></span></p>\r\n\r\n<ul>\r\n	<li style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;"><span new="" times=""><a href="http://www.giaxeotohonda.com.vn/"><strong>INH GIA CP  5 :</strong></a>Xe i khng c gi gin va khng bao dng, ni tht, ngoai tht, vo xe kho co th s dung c, gian gm, h thng giam soc, thc tay lai, lc lanh, h thng inECU, may moc khng cn kh nng hot ng, con  mc  t di 5% n di 30% so vi xe mi 100% ban u thi se ap dung INH GIA CP  5.</span></span></span></li>\r\n</ul>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;"><span new="" times=""><strong>* Lu , chc nng nh gi gi tr ca xe hi s khng c hiu lc i vi nhng xe c tnh trng xe  cp  5.</strong></span></span></span></p>\r\n\r\n<p style="margin-left: 18pt; text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;"><span new="" times=""><strong>CHI PHI KHNG C TINH KHI NH GI XE C</strong></span></span></span></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;"><span new="" times="">- Gia tri thng hiu</span></span></span></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;"><span new="" times="">- Chi ph  xe, gn thm ph kin</span></span></span></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;"><span new="" times="">- Chi phi bao him, bao dng, sa cha</span></span></span></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;"><span new="" times="">- Chi phi ng kim va l phi cp mi bin s xe</span></span></span></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;"><span new="" times="">- Chi phi c hi, trt gia ng tin theo thi gian</span></span></span></p>\r\n\r\n<div></div>\r\n', '', '', 1, 0, 1527908625, 1537031604, '', '', '', 'motacapdo', '', '', '');
