(16, '', '', '', '<p style="text-align: center;"></p>\r\n\r\n<p style="text-align: center;"><span style="font-family:times new roman,times,serif;"><strong><span style="font-size:24px;">CarOntrade lun t s uy tn v an ton ca ngi bn ln hng u</span></strong></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-family:times new roman,times,serif;"><span style="font-size:16px;"> ngi bn c c nhng thao tc n gin v d dng nht trong qu trnh s dng dch v ca Sn, di y l cc mo gip ngi bn c th rt ngn thi gian bn v c c mt thng v giao dch an ton:</span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;"><strong>A. Mo bn xe hiu qu</strong></span></span></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;"><strong>B. Mo chp hnh thu ht ngi mua</strong></span></span></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;"><strong>C. Lm th no  c mt tin ng cht lng</strong></span></span></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;"><strong>D. S an ton trong qu trnh mua bn</strong></span></span></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;"><strong>E. Nhng trng hp tin ng b t chi</strong></span></span></p>\r\n\r\n<p style="text-align: center;"><span style="font-size:20px;"><span style="font-family:times new roman,times,serif;"><strong>A. Mo bn xe hiu qu</strong></span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;">Vi mong mun gip cho ngi bn c c mt tin ng bn xe thuyt phc, c th bn c xe mt cch hiu qu v nhanh nht. CarOntrade xin bt m mt vi mo nh c th gip cc bn phn no thu ht c s ch  ca ngi mua v tng kh bn c xe ca mnh.</span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;"><strong>1. Bo dng, kim tra xe</strong></span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;">Bc bo dng v kim tra tnh trng xe nh k trc khi ng bn (thay nht, kim tra phanh, ci thin my mc, thay cc b phn b h, n, iu ho,) l mt iu quan trng khng th thiu nu bn mun xe mnh c c hi bn c nhanh. Ngoi ra, hy khc phc cc vt xc trn thn xe nu c th  chic xe ca bn nhn tht lng ly cho d n  qua s dng. Tnh trng xe khng tt l nguyn nhn chnh dn n vic gi bn m bn a ra b ngi mua mc c, d l chi tit nh nht.</span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;"><strong new="" times="">2. V sinh ni tht xe</strong></span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;">Tht khng tt khi ngi mua ngi vo xe ca bn m ngi thy mi hi, thy bi bn hay nhng vt nc ng li trong xe. Hy dn dp, v sinh sch s cc ni tht bn trong xe ca bn, s dng nc hoa hay kh mi  bn trong xe c mt bu khng kh d chu. Hy li cun ngi mua bng mt khng gian thoi mi khi c ngi li bn trong xe ca bn.</span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;"><strong>3. Ra xe</strong></span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;">Bn hy chc chn rng xe ca mnh nhn tht bng by, hay ra xe sch s trc khi mang xe ca bn n vi ngi mua. Bi v xe cng sch, cng bng th nhn s cng mi, cng li ko ngi mua phi chn chic xe ca bn.</span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;"><strong>4. V sinh ng c di mui xe</strong></span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;">Hy b ra t thi gian  v sinh ng c di mui xe bi v tnh trng ca ng c ca mui xe cng phn nh r rt n tnh trng tng th chic xe ca bn. ng c di mui xe cng bi bn, xung cp th s khin cho ngi mua mc c v gi c ngay, hay thm ch l t chi mua chic xe ca bn. V bn xin lu  rng, v sinh ng c di mui xe phi ng cch nu khng s nh hng khng tt n cc my mc bn trong.</span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;"><strong>5. nh bng lp xe</strong></span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;">Bn ng qun v sinh bnh xe, lp xe trc khi bn cho ngi mua nh. Tnh trng ca lp xe c bit nh hng n s quyt nh ca ngi mua, hy nh bng lp xe bng cc bnh xt lp xe thng dng  cho lp xe bn nhn tht en tuyn, bng by nh. CarOntrade m bo vi bn rng ngi mua s b hp dn bi s lng ly ca lp xe bn.</span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;"><strong>6. Giy t xe</strong></span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;">iu quan trng khng th thiu  chnh l chun b y  cc giy t xe, s bo hnh xe v cc giy t lin quan m ngi mua c th i hi t bn nhm kim tra  trong sch ca xe bn trc khi quyt nh mua n.</span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;"><strong>7. Hnh nh tht, trung thc v r nt</strong></span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;">Hy chp hnh nh tht r nt, sc cnh, v chi tit nhm gip cho ngi mua c th nh gi tng th chic xe ca bn. u t k lng cho nh i din v n l tm hnh p vo mt ngi mua v gy s ch  u tin.</span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;"><strong>8. Ni dung tin ng chi tit, hp dn</strong></span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;"> c ni dung tht hp dn th bn hy ng mt cch tht chi tit, ng vi c im k thut ca xe. Nu ra c nhng c tnh ni bt ca xe bn m c th thu ht ngi mua (tit kim xng, ng c mnh, mui trn,)</span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;">Trnh s dng nhng t so rng: Bnh d phng cha dc dng qua, xe chy hp vi ph n.</span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;">ng qun nu r hnh thc thanh ton.</span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;">Bn c th tham kho thm v<a href="http://carontrade.com/quy-dinh-dang-tin.html" target="_blank"><strong>Quy nh v ni dung tin ng, gi c</strong></a>trong quy nh ca CarOntrade.</span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;"><strong>9. Gi bn hp l</strong></span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;">Hy chc chn rng gi m bn a ra hp l, khng ph gi. Gi chnh l yu t quyt nh ngi mua c chn chic xe ca bn hay khng.</span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;">Chnh v vy,  c c mt mc gi hp l, bn nn tham kho gi th trng trn CarOntrade hoc cc din n chi xe hi.</span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;">Ngoi ra,  n gin ho v vic bn phi ct cng i tm hiu gi c th trng, hy s dng tnh nng<a href="http://carontrade.com/dinh-gia-xe.html" target="_blank"><strong>nh gi xe</strong></a>ca CarOntrade da trn th trng xe hi  gip cho bn c c mt mc gi bn tht hp l.</span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;"><strong>10. S dng tnh nng Tin u tin t CarOntrade</strong></span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;"> c th tng c  tip cn gia bn v ngi mua trong hng nghn tin ng trn Sn, bn c th tham kho thm tnh nng<a href="http://carontrade.com/tro-giup-nguoi-dung/tinh-nang-tin-uu-tien-la-gi.html" target="_blank"><b>Tin u tin</b></a>nhm tng c hi bn c xe ca bn trong thi gian ngn nht, rt ngn c thi gian tip cn c khch hng tim nng.</span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: center;"><span style="font-size:20px;"><strong><span style="font-family:times new roman,times,serif;">B. Mo chp hnh thu ht ngi mua</span></strong></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;"><span new="" times="">V mun ngi mua c th tham kho nhng tm hnh ng bn xe cht lng nht, CarOntrade  gii hn s lng hnh c php ng ti l 20 tm mt bi ng. Tuy vy, CarOntrade cng mun bt m mt mo nh  ngi bn c th ng ti nhng tm hnh m t xe tht thu ht ngi mua.</span></span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;"><span new="" times="">Sau y l nhng v tr ca xe m ngi bn nn chp  hp dn ngi mua hn:</span></span></span></p>\r\n\r\n<p style="text-align: center;"></p>\r\n\r\n<div contenteditable="false" style="line-height: 0; text-align: center;" tabindex="-1">\r\n<p data-widget="image"><img alt="" height="367" src="http://carontrade.com/upload/images/7(2).png" width="600" /></p>\r\n<span admin="" carontrade.com="" ckeditor="" http:="" images="" plugins="" style="background: url(" widget=""><img alt="" height="15" src="data:image/gif;base64,R0lGODlhAQABAPABAP///wAAACH5BAEKAAAALAAAAAABAAEAAAICRAEAOw%3D%3D" title="Click and drag to move" width="15" /></span></div>\r\n\r\n<p style="text-align: center;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;"><span new="" times=""><strong>Hnh 1: Mt trc ca xe</strong></span></span></span></p>\r\n\r\n<p style="text-align: center;"></p>\r\n\r\n<div contenteditable="false" style="line-height: 0; t