px;"><span style="font-family:times new roman,times,serif;"><strong><span new="" times="">1. Hnh nh r nt, trung thc, y </span></strong></span></span></p>\r\n\r\n<p></p>\r\n\r\n<p><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;"><span new="" times="">S dng nhiu hnh nh m t chi tit tng b phn xe s gip bn d dng tng c s tin tng, tit kim thi gian xem hng v thu ht ngi mua.</span></span></span></p>\r\n\r\n<p></p>\r\n\r\n<p><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;"><span new="" times="">Hnh nh phi trung thc, r rng, khng c c email, a ch website khc, logo hoc s in thoi.</span></span></span></p>\r\n\r\n<p></p>\r\n\r\n<p><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;"><span new="" times="">Hy chp s bo hnh xe, cc giy t lin quan  c th tng thm  tin cy cho tin ng bn ca bn.</span></span></span></p>\r\n\r\n<p></p>\r\n\r\n<p><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;"><strong><span new="" times="">2. Ni dung ng bn chuyn nghip</span></strong></span></span></p>\r\n\r\n<p></p>\r\n\r\n<p><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;"><span new="" times="">Cho d bn khng phi l cc nh i l bn chuyn, ng qun vit mt ni dung ng bn tht chuyn nghip  ngi mua c th cm thy an tm khi giao dch vi bn.</span></span></span></p>\r\n\r\n<p></p>\r\n\r\n<p><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;"><span new="" times="">Hy thu ht v hp dn ngi mua bng cch lit k tt c cc tnh nng tin ch t chic xe ca bn. V d: tnh nng tin ch nh n ban m cm bin t ng, tnh nng gii tr nh Bluetooth, m thanh</span></span></span></p>\r\n\r\n<p></p>\r\n\r\n<p><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;"><strong><span new="" times="">3. Tiu  c th</span></strong></span></span></p>\r\n\r\n<p><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;"><span new="" times=""></span></span></span></p>\r\n\r\n<p><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;"><span new="" times="">Mt tiu  c th l tiu  c th m t tm gn c im chic xe ca bn  c th thu ht c nhng ngi ang c nhu cu mua dng xe ca bn.</span></span></span></p>\r\n\r\n<p></p>\r\n\r\n<p><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;"><span new="" times="">Tiu  phi th hin ng vi c im xe c ng bn. Di y l tiu  mu theo quy nh trn CarOntrade:</span></span></span></p>\r\n\r\n<p></p>\r\n\r\n<p><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;"><span new="" times=""> - Mu:<strong>Nm sn xut xe + tn hng xe + tn dng xe (nu c) + tn phin bn xe (nu c) + loi hp s</strong></span></span></span></p>\r\n\r\n<p></p>\r\n\r\n<p><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;"><span new="" times=""> - V d: 2015 BMW 650i F12 LCI S t ng</span></span></span></p>\r\n\r\n<p><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;"><span new="" times=""></span></span></span></p>\r\n\r\n<p><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;"><span new="" times="">       2017 Lexus NX NX300 F Sport S t ng</span></span></span></p>\r\n\r\n<p><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;"><span new="" times=""></span></span></span></p>\r\n\r\n<p><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;"><span new="" times="">       2012 Mazda 3 Series 2 S Sn V S T ng</span></span></span></p>\r\n\r\n<p></p>\r\n\r\n<p><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;"><strong><span new="" times="">4. Gi tt</span></strong></span></span></p>\r\n\r\n<p></p>\r\n\r\n<p><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;"><span new="" times="">Bn c th tham kho gi ca nhng chic xe tng t ang c ng bn trn CarOntrade hoc s dng tnh nng nh gi  c c gi bn ph hp, gip xe bn c nhanh hn.</span></span></span></p>\r\n\r\n<p></p>\r\n\r\n<p><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;"><strong><span new="" times="">5. Thng tin lin h chnh xc, r rng</span></strong></span></span></p>\r\n\r\n<p></p>\r\n\r\n<p><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;"><span new="" times="">Thng tin lin lc (bao gm h v tn, tn cng ty, s in thoi, a ch email v a ch bn mun giao dch) c ng phi chnh xc, r rng  ngi mua c th lin h c vi bn.</span></span></span></p>\r\n\r\n<p></p>\r\n\r\n<p><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;"><strong><span new="" times="">6. Mi tin ch c ng bn mt sn phm</span></strong></span></span></p>\r\n\r\n<p></p>\r\n\r\n<p><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;"><span new="" times="">Nu bn mun ng bn nhiu chic xe cng mt lc, hy ng bn ring bit  gip ngi mua trnh nhm ln trong vic tm kim xe.</span></span></span></p>\r\n\r\n<p></p>\r\n\r\n<p><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;"><span new="" times="">V ng qun rng tnh nng <strong>Tin u tin</strong> s gip tin ng ca bn c ni bt hn cc tin ng khc nh. Tham kho thm<strong>Tin u tin</strong>l g<a href="http://carontrade.com/tro-giup-nguoi-dung/tinh-nang-tin-uu-tien-la-gi.html" target="_blank"><strong>ti y</strong></a>.</span></span></span></p>\r\n\r\n<p></p>\r\n\r\n<p style="text-align: center;"><span style="font-family:times new roman,times,serif;"><span style="font-size:20px;"><strong>D. S an ton trong qu trnh mua bn</strong></span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;"><span new="" times="">CarOntrade lun t s an ton ca ngi dng ln hng u, a ra nhng gii php mua bn an ton  bo v ngi dng chnh l trch nhim v ngha v ca chng ti.</span></span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;"><span new="" times="">Quy trnh kim duyt tin ng cht ch t i ng kim duyt vin chuyn nghip.</span></span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;"><span new="" times="">Pht trin tnh nng cho php ngi dng nh gi tin ng ca ngi bn, to iu kin cho ngi dng phi hp cng CarOntrade loi b nhng trng hp mang tnh cht la o.</span></span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;"><span new="" times=""><strong>H tr</strong>v<strong>phn hi</strong>ngi dng<strong>nhanh chng</strong>thng qua hotline<strong>0126 4428 166</strong>hoc a ch email<strong>hotrokhachhang@carontrade.com</strong>.</span></span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;"><span new="" times=""><strong>1. V s an ton ca Ngi mua</strong></span></span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;"><span new="" times="">- Khng nn chuyn tin trc khi nhn xe. Gp nhau trc tip  mua bn.</span></span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;"><span new="" times="">- KIm tra thng tin xe c ng vi tin c ng hay khng.</span></span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;"><span new="" times="">- Test my mc, li th, kim tra k lng ri mi tr tin.</span></span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;"><span new="" times="">- V gi tr mua xe ln, hy lun i cng ngi quen.</span></span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;"><span new="" times="">- Giao dch trc tip  ni quen thuc nh a im gn nh, cng ty hoc cc trung tm bo hnh c th kim tra c sn phm.</span></span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;"><span new="" times="">- Thn trng i vi cc sn phm xe c bn vi gi qu r so vi gi tr ca cc xe khc  cng th trng.</span></span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;"><span new="" times="">- Yu cu ngi bn phi cung cp y  cc giy t php l  chng minh s hu xe hoc h tr cho qu trnh giao dch gia hai bn. Trc khi gp ngi bn hy hi h c nhng giy sau y hay khng th mi cn nhc v vic gp mt giao dch: c-vt xe, chng minh nhn dn, bng li xe, s bo hnh xe, bin lai mua xe (nu c).</span></span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;"><span new="" times="">- ng qun bo qun ti sn c nhn trong khi tham gia giao dch.</span></span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;"><strong><span new="" times="">Nhng trng hp ngi mua cn  cao cnh gic:</span></strong></span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;"><span new="" times="">- Xe khng c bn bi ch s hu xe m c nh bn th ba bn gip.</span></span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;"><span new="" times="">- Giy t php l khng r rng, thiu st.</span></span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;"><span new="" times=""><strong>2. V s an ton ca Ngi bn</strong></span></span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;"><span new="" times="">- Nn gp nhau trc tip  mua bn.</span></span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;"><span new="" times="">- V gi tr mua xe ln, hy lun i cng ngi quen.</span></span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;"><span new="" times="">-  trnh nhng trng hp pht sinh mu thun sau khi bn, bn nn trao i chi tit, k lng cc iu khon khi giao dch v yu cu ngi mua kim tra sn phm xe hi cn thn trc khi ng  mua.</span></span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;"><span new="" times="">- Mi chi ph y tin u c thanh ton trc tuyn qua Sn giao dch TMT CarOntrade.com do chnh bn chi tr, hy thn trng nu c ai  lin h vi bn  thu ph di danh ngha CarOntrade. Hy thng bo ngay cho chng ti  c h tr kp thi.</span></span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;"><span new="" times="">- Khi ngi mua xin li th, hy chc chn rng bn cng c mt bn trong xe.</span></span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;"><span new="" times="">- Hy bo qun xe v ti sn c nhn ca bn cn thn trong qu trnh giao dch.</span></span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;"><span new="" times="">- Khng giao xe khi cha c g m bo t ngi mua, v d: giy t tu thn, tin t cc.</span></span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;"><strong><span new="" times="">Nhng trng hp ngi bn cn  cao cnh gic:</span></strong></span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;"><span new="" times="">- Ngi mua lm gi giy chyn khon, khin cho bn khng nhn c tin.</span></span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;"><span new="" times="">- Ngi mua xin li th v khng c  nh tr li xe cho bn sau khi dng.</span></span></span></p>\r\n\r\n<div></div>\r\n\r\n<p style="text-align: center;"><span style="font-family:times new roman,times,serif;"><span style="font-size:20px;"><strong>E. Nhng trng hp tin ng b t chi</strong></span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;">Di y l nhng trng hp tin ca bn c th b t chi:</span></span></p>\r\n\r\n<p></p>\r\n\r\n<p><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;"><strong>Trng hp 1: Tin ng b trng lp</strong></span></span></p>\r\n\r\n<p><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;"></span></span></p>\r\n\r\n<p><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;">- Tin ng b xem l trng lp nu bn ng bn mt chic xe trn CarOntrade ging vi chic xe bn  ng bn trc .</span></span></p>\r\n\r\n<p><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;"> </span></span></p>\r\n\r\n<p><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;">- Trong trng hp bn cha bn c xe v mun bn nhanh hn, bn c th s tnh nng<a href="http://carontrade.com/tro-giup-nguoi-dung/tinh-nang-tin-uu-tien-la-gi.html" target="_blank"><strong>Tin u tin</strong></a> tin bn c hin th u tin hn so vi nhng tin khc.</span></span></p>\r\n\r\n<p></p>\r\n\r\n<p><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;"><strong>Trng hp 2: S dng hnh nh ti t trn mng hoc ca ngi khc</strong></span></span></p>\r\n\r\n<p><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;"></span></span></p>\r\n\r\n<p><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;">-Hnh nh khng trung thc, s dng hnh nh t trn mng, hoc copy ca ngi khc u s khin cho tin ng ca bn b CarOntrade t chi.</span></span></p>\r\n\r\n<p><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;"> </span></span></p>\r\n\r\n<p><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;">-Hnh nh ng bn trung thc l hnh phi ng vi chic xe ca bn, c do chnh bn chp. Bn s thu ht ngi mua hn nu hnh nh r nt, chi tit.</span></span></p>\r\n\r\n<p></p>\r\n\r\n<p><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;"><strong>Trng hp 3: Hnh nh ng bn khng m t y  chc nng xe hoc b chnh sa qu nhiu</strong></span></span></p>\r\n\r\n<p></p>\r\n\r\n<p><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;"> - Bn s thu ht ngi mua hn nu hnh nh ng ti m t c ht cc chi tit ca xe: hnh chp trc sau, hai bn xe, ni tht trc sau, cp xe, lp v mm bnh xe, ng c mui xe, </span></span></p>\r\n\r\n<p><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;"></span></span></p>\r\n\r\n<p><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;">- Hnh nh khng r nt, chnh sa qu nhiu lm nh hng n tnh trng tht ca xe th s b t chi.</span></span></p>\r\n\r\n<p></p>\r\n\r\n<p><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;"> - Hnh nh khng c thm ch, a ch website, logo, s in thoi hay bt k thng tin lin quan khc.</span></span></p>\r\n\r\n<p><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;"></span></span></p>\r\n\r\n<p><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;">- Khng s dng hnh nghing, khng ng chiu, hoc c ghp t cc hnh khc.</span></span></p>\r\n\r\n<p></p>\r\n\r\n<p><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;"><strong>Trng hp 4: Ni dung tin ng hi ht, khng  thng tin  m t chic xe</strong></span></span></p>\r\n\r\n<p></p>\r\n\r\n<p><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;"> - Ngi mua s thiu tin tng vo tin bn ca bn nu ni dung tin ng qu t thng tin, khng   cho ngi mua hiu c chic xe ca bn.</span></span></p>\r\n\r\n<p></p>\r\n\r\n<p><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;"> - CarOntrade lun mong mun ngi bn v ngi mua u c li trong qu trnh tm kim v bn xe,  l l do v sao nhng tin ng vi ni dung qu t khng   m t chic xe ca bn s b t chi.</span></span></p>\r\n\r\n<p></p>\r\n\r\n<p><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;"> - Bn hy cho ngi mua thy c xe ca bn c nhng tnh nng g ni bt, v d: thng ABS chng trn, Bluetooth, chc nng ga t ng Cruise Control  tng s thu ht cho ngi mua -hn.</span></span></p>\r\n\r\n<p></p>\r\n\r\n<p><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;"> bit chi tit hn, bn c th tham kho<a href="http://carontrade.com/quy-dinh-dang-tin.html" target="_blank"><strong>Quy nh ng tin</strong></a> trnh tin ng ca mnh b t chi nh.</span></span></p>\r\n\r\n<p></p>\r\n\r\n<p style="text-align: center;"><span style="font-family:times new roman,times,serif;"><span style="font-size:16px;"><em>Chn thnh cm n bn  s dng dch v ca CarOntrade!</em></span></span></p>\r\n\r\n<p style="text-align: center;"></p>\r\n', '', '', 1, 1, 1527914735, 1537054106, 'CarOntrade lun t s uy tn v an ton ca ngi bn ln hng u', 'Tm v mua bn xe hi  qua s dng, xe hi mi nhanh chng v n gin ti CarOntrade Vit Nam. Gii php COT gip bn mua bn xe hi hiu qu.', 'Gii php COT, CarOntrade Vit Nam, CarOntrade.com, xe hi gi r, xe mi gi tt, xe mi gi r, xe c gi r, xe c gi tt, mua bn xe hi c gi r,  t c gi r,  t mi gi tt.', 'tro-giup-nguoi-ban', '', '', '');
