(17, '', '', '', '<p style="text-align: center;"><span style="font-family:arial,helvetica,sans-serif;">-</span></p>\r\n\r\n<p style="text-align: center;"><span style="font-family:times new roman,times,serif;"><span style="font-size:24px;"><strong>Quy nh ng tin</strong></span></span></p>\r\n\r\n<p style="text-align: center;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-family:times new roman,times,serif;"><span style="font-size:16px;">Nhm nng cao uy tn cng nh s thun li trong qu trnh thng lng v giao dch gia ngi mua v ngi bn, CarOntrade xin c a ra quy nh v tin ng bn cho c nhn/i l nhm trnh b t chi khi ng tin, ng thi kim duyt  tin cy ca ngi bn, rt ngn thi gian kim duyt tin ng.</span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-family:times new roman,times,serif;"><span style="font-size:16px;"><strong>CarOntrade s khng can thip vo qu trnh thng lng v giao dch gia ngi mua v ngi bn</strong>, v vy chng ti khuyn khch mi ngi dnh ra t thi gian  c qua quy nh ng bn  trnh nhng trng hp khng mong mun trong qu trnh giao dch. Mt khi ngi dng ng tin bn c ngha l ngi dng  c v ng  vi quy nh v ng tin ca Sn giao dch TMT CarOntrade.com.Nu ngi dng vi phm qu 3 ln th CarOntrade s kho ti khon 2 tun ng thi g ht tt c cc tin ang c ng hin ti  cnh co, cng nh bo v nhng ngi dng khc.</span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-family:times new roman,times,serif;"><span style="font-size:16px;">Trng hp ngi dng pht hin tin ng vi phm, vui lng gi ng link tin ng qua a ch email:<a href="mailto:hotrokhachhang@carontrade.com" style="font-size: 14px; font-family: arial, helvetica, sans-serif;">hotrokhachhang@carontrade.com</a>.</span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-family:times new roman,times,serif;"><span style="font-size:16px;"><strong>1.</strong><strong>i tng ng tin</strong></span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-family:times new roman,times,serif;"><span style="font-size:16px;"><strong>- C Nhn:</strong> l nhng i tng c php mua bn cng nh giao dch hp php  Vit Nam, khng v mc ch kinh doanh.</span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-family:times new roman,times,serif;"><span style="font-size:16px;"><strong>- i l:</strong> l nhng i tng c nhn hoc tp th vi mc ch kinh doanh, c php mua bn cng nh giao dch hp php  Vit Nam.</span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-family:times new roman,times,serif;"><span style="font-size:16px;"><strong>2. Quy nh v tin ng</strong></span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-family:times new roman,times,serif;"><span style="font-size:16px;"><strong>a. Thng tin lin h</strong></span></span></p>\r\n\r\n<p style="text-align: justify;"><span style="font-family:times new roman,times,serif;"><span style="font-size:16px;"></span></span></p>\r\n\r\n<p style="text-align: justify;"><span style="font-family:times new roman,times,serif;"><span style="font-size:16px;"><strong>- H v tn:</strong> Ngi ng k vui lng s dng tn tht ca mnh  vic mua bn c thun li hn. Trng hp ngi ng tin khng s dng tn tht v b ngi mua bo co, chng ti s email nhc nh.</span></span></p>\r\n\r\n<p style="text-align: justify;"><span style="font-family:times new roman,times,serif;"><span style="font-size:16px;"></span></span></p>\r\n\r\n<p style="text-align: justify;"><span style="font-family:times new roman,times,serif;"><span style="font-size:16px;"><strong>- Email:</strong> a ch email phi hp l v s dng thng xuyn. Mi lin lc vi ngi dng phn ln s thc hin qua email.</span></span></p>\r\n\r\n<p style="text-align: justify;"><span style="font-family:times new roman,times,serif;"><span style="font-size:16px;"></span></span></p>\r\n\r\n<p style="text-align: justify;"><span style="font-family:times new roman,times,serif;"><span style="font-size:16px;"><strong>- S in thoi:</strong> S in thoi phi hp l v c s dng thng xuyn. Ngi mua s lin lc vi bn qua s in thoi.</span></span></p>\r\n\r\n<p style="text-align: justify;"><span style="font-family:times new roman,times,serif;"><span style="font-size:16px;"></span></span></p>\r\n\r\n<p style="text-align: justify;"><span style="font-family:times new roman,times,serif;"><span style="font-size:16px;"><strong>- a ch:</strong> Tn ng, Qun/Huyn, thnh ph ni bn ang sng (v d: Hai B Trng, Qun 1, TP.HCM)</span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-family:times new roman,times,serif;"><span style="font-size:16px;"><strong>b. Tn tiu  tin ng</strong></span></span></p>\r\n\r\n<p style="text-align: justify;"><span style="font-family:times new roman,times,serif;"><span style="font-size:16px;"><strong></strong></span></span></p>\r\n\r\n<p style="text-align: justify;"><span style="font-family:times new roman,times,serif;"><span style="font-size:16px;">Tn tiu  cn phi th hin chi tit ng vi sn phm xe hi c ng bn.  ngi mua c th d dng tm kim tin ng, tng c hi bn c xe ca ngi bn, CarOntrade  ngh ngi ng tin phi ghi tn tiu  da theo mu di y:</span></span></p>\r\n\r\n<p style="margin-left: 54pt; text-align: justify;"></p>\r\n\r\n<p style="margin-left: 54pt; text-align: justify;"><span style="font-family:times new roman,times,serif;"><span style="font-size:16px;">Mu: <strong>Nm sn xut xe + tn hng xe + tn dng xe (nu c) + tn phin bn xe (nu c) + loi hp s</strong></span></span></p>\r\n\r\n<p style="margin-left: 54pt; text-align: justify;"></p>\r\n\r\n<p style="margin-left: 54pt; text-align: justify;"><span style="font-family:times new roman,times,serif;"><span style="font-size:16px;">V d: 2015 BMW 650i F12 LCI S t ng</span></span></p>\r\n\r\n<p style="margi