 style="font-family:times new roman,times,serif;"><span style="font-size:16px;">- B chnh sa qu nhiu, khng thy r c tnh trng sn phm xe hi.</span></span></p>\r\n\r\n<p style="text-align: justify;"><span style="font-family:times new roman,times,serif;"><span style="font-size:16px;"></span></span></p>\r\n\r\n<p style="text-align: justify;"><span style="font-family:times new roman,times,serif;"><span style="font-size:16px;">- Hnh khng ng tiu chun ca CarOntrade, v d: hnh m, nghing, khng ng chiu, hnh ghp hoc thm k hiu.</span></span></p>\r\n\r\n<p style="text-align: justify;"><span style="font-family:times new roman,times,serif;"><span style="font-size:16px;"></span></span></p>\r\n\r\n<p style="text-align: justify;"><span style="font-family:times new roman,times,serif;"><span style="font-size:16px;">- Hnh c logo cng ty, dng ch hoc s in thoi km theo nhm mc ch qung co cng ty.</span></span></p>\r\n\r\n<p style="text-align: justify;"><span style="font-family:times new roman,times,serif;"><span style="font-size:16px;"></span></span></p>\r\n\r\n<p style="text-align: justify;"><span style="font-family:times new roman,times,serif;"><span style="font-size:16px;">- Hnh thiu vn minh, v d: hnh ngi mu bikini,</span></span></p>\r\n\r\n<p style="text-align: justify;"><span style="font-family:times new roman,times,serif;"><span style="font-size:16px;"></span></span></p>\r\n\r\n<p style="text-align: justify;"><span style="font-family:times new roman,times,serif;"><span style="font-size:16px;">- Hnh b li khng c hin th.</span></span></p>\r\n\r\n<p style="text-align: justify;"><span style="font-family:times new roman,times,serif;"><span style="font-size:16px;"><strong></strong></span></span></p>\r\n\r\n<p style="text-align: justify;"><span style="font-family:times new roman,times,serif;"><span style="font-size:16px;"><strong>CarOntrade khuyn khch ngi ng tin nn ng hnh nh c chp theo ch dn di y:</strong></span></span></p>\r\n\r\n<p style="text-align: justify;"><span style="font-family:times new roman,times,serif;"><span style="font-size:16px;"></span></span></p>\r\n\r\n<p style="text-align: justify;"><span style="font-family:times new roman,times,serif;"><span style="font-size:16px;">- Pha trc v pha sau xe.</span></span></p>\r\n\r\n<p style="text-align: justify;"><span style="font-family:times new roman,times,serif;"><span style="font-size:16px;"></span></span></p>\r\n\r\n<p style="text-align: justify;"><span style="font-family:times new roman,times,serif;"><span style="font-size:16px;">- Hai bn hng xe.</span></span></p>\r\n\r\n<p style="text-align: justify;"><span style="font-family:times new roman,times,serif;"><span style="font-size:16px;"></span></span></p>\r\n\r\n<p style="text-align: justify;"><span style="font-family:times new roman,times,serif;"><span style="font-size:16px;">- Hnh bnh xe bao gm lp xe v mm xe.</span></span></p>\r\n\r\n<p style="text-align: justify;"><span style="font-family:times new roman,times,serif;"><span style="font-size:16px;"></span></span></p>\r\n\r\n<p style="text-align: justify;"><span style="font-family:times new roman,times,serif;"><span style="font-size:16px;">- Ni tht xe.</span></span></p>\r\n\r\n<p style="text-align: justify;"><span style="font-family:times new roman,times,serif;"><span style="font-size:16px;"></span></span></p>\r\n\r\n<p style="text-align: justify;"><span style="font-family:times new roman,times,serif;"><span style="font-size:16px;">- Hp s ca xe th hin r rng s kilomet  i c t trc n nay, s kilomet c chp trong hnh v c ghi trong ni dung tin ng ch c chch lch nhiu nht l 10%.</span></span></p>\r\n\r\n<p style="text-align: justify;"><span style="font-family:times new roman,times,serif;"><span style="font-size:16px;"></span></span></p>\r\n\r\n<p style="text-align: justify;"><span style="font-family:times new roman,times,serif;"><span style="font-size:16px;"><strong>d. Ni dung tin ng</strong></span></span></p>\r\n\r\n<p style="text-align: justify;"><span style="font-family:times new roman,times,serif;"><span style="font-size:16px;"></span></span></p>\r\n\r\n<p style="text-align: justify;"><span style="font-family:times new roman,times,serif;"><span style="font-size:16px;">- Ni dung cn c: Miu t tn xe, hng xe, xut x, mu sc, tnh trng s dng, s km  i, nm ng k, hp s, loi nhin liu, giy t xe,</span></span></p>\r\n\r\n<p style="text-align: justify;"><span style="font-family:times new roman,times,serif;"><span style="font-size:16px;"></span></span></p>\r\n\r\n<p style="text-align: justify;"><span style="font-family:times new roman,times,serif;"><span style="font-size:16px;">- Ni dung ng ch lin quan n vic bn sn phm xe hi, ngoi ra khng c ng vi mc ch khc.</span></span></p>\r\n\r\n<p style="text-align: justify;"><span style="font-family:times new roman,times,serif;"><span style="font-size:16px;"></span></span></p>\r\n\r\n<p style="text-align: justify;"><span style="font-family:times new roman,times,serif;"><span style="font-size:16px;">- Ni dung ng khng c c nhng thng tin mang tnh cht qung co nh s in thoi, logo hay website ca cng ty khc.</span></span></p>\r\n\r\n<p style="text-align: justify;"><span style="font-family:times new roman,times,serif;"><span style="font-size:16px;"></span></span></p>\r\n\r\n<p style="text-align: justify;"><span style="font-family:times new roman,times,serif;"><span style="font-size:16px;">- Ni dung ng khng c c nhng t ng v vn ho, v d: nhng t chi th. Khng c c nhng t ng mua bn thiu chuyn nghip nh: "<em>cn bn", "thanh l", "siu r", "siu hot", "rt p", "bn gp", "tt nht", "hng u", "r nht"</em>, hoc nhng t c  ngha tng t.</span></span></p>\r\n\r\n<p style="text-align: justify;"><span style="font-family:times new roman,times,serif;"><span style="font-size:16px;"></span></span></p>\r\n\r\n<p style="text-align: justify;"><span style="font-family:times new roman,times,serif;"><span style="font-size:16px;">- Cc tin ng c ni dung, hnh nh mang tnh xc phm lin quan n tn gio, cc nhm sc tc, c nhn hoc ngi ni ting b cm.</span></span></p>\r\n\r\n<p style="text-align: justify;"><span style="font-family:times new roman,times,serif;"><span style="font-size:16px;"></span></span></p>\r\n\r\n<p style="text-align: justify;"><span style="font-family:times new roman,times,serif;"><span style="font-size:16px;">- Mt bi ng tin ch ng mt sn phm xe duy nht, nu ngi bn c mong mun bn nhiu sn phm xe, vui lng ng tng bi ring bit. Nhng tin ng trng lp s b t chi.</span></span></p>\r\n\r\n<p style="text-align: justify;"><span style="font-family:times new roman,times,serif;"><span style="font-size:16px;"></span></span></p>\r\n\r\n<p style="text-align: justify;"><span style="font-family:times new roman,times,serif;"><span style="font-size:16px;">- Theo iu 8 mc 11 ca Lut Qung co, khng c s dng cc t ng<em>nht, duy nht, tt nht, s mt</em>hoc t ng c  ngha tng t trong ni dung tin ng (nu s dng phi c ti liu chng minh).</span></span></p>\r\n\r\n<p style="text-align: justify;"><span style="font-family:times new roman,times,serif;"><span style="font-size:16px;"></span></span></p>\r\n\r\n<p style="text-align: justify;"><span style="font-family:times new roman,times,serif;"><span style="font-size:16px;"><strong>e. Gi c</strong></span></span></p>\r\n\r\n<p style="text-align: justify;"><span style="font-family:times new roman,times,serif;"><span style="font-size:16px;"><strong></strong></span></span></p>\r\n\r\n<p style="text-align: justify;"><span style="font-family:times new roman,times,serif;"><span style="font-size:16px;">- Ngi bn cn phi a ra c gi bn hp l, gi phi ng so vi th trng xe hi Vit Nam, khng c bn ph gi.</span></span></p>\r\n\r\n<p style="text-align: justify;"><span style="font-family:times new roman,times,serif;"><span style="font-size:16px;"></span></span></p>\r\n\r\n<p style="text-align: justify;"><span style="font-family:times new roman,times,serif;"><span style="font-size:16px;">- Gi bn phi c nim yt bng gi Vit Nam ng (VN), cc tin ng gi ngoi t s khng c chp thun.</span></span></p>\r\n\r\n<p style="text-align: justify;"><span style="font-family:times new roman,times,serif;"