(132, 0, 29, 102, 156, 28, '<p><span font-size:="" helvetica="" style="font-family: ">S sng tr ng trong chic hp kim loi - chnh  ngha   to nn ngn ng thit k KODO "Linh hn ca s chuyn ng" ca Mazda3</span><br font-size:="" helvetica="" style="box-sizing: border-box; font-family: " />\r\n<span font-size:="" helvetica="" style="font-family: ">Ni tht hin i, sang trng, tinh t, trau chut, t m v ng nht n tng chi tit nh mang li cm gic t tin v thoi mi cho hnh khch</span><br font-size:="" helvetica="" style="box-sizing: border-box; font-family: " />\r\n<span font-size:="" helvetica="" style="font-family: ">Ngoi tht l s phi hp mn mng, hi ha cc ng nt, chi tit thn xe, p, sn v m crom mang li mt thit k lch lm, tr trung, cn i m li v cng mnh m, nghch ngm, th thao v y quyn r</span><br font-size:="" helvetica="" style="box-sizing: border-box; font-family: " />\r\n<span font-size:="" helvetica="" style="font-family: ">- ng c xng SkyActiv mnh m, tit kim nhin liu, hp s t ng 6 cp</span><br font-size:="" helvetica="" style="box-sizing: border-box; font-family: " />\r\n<span font-size:="" helvetica="" style="font-family: ">- t ph trong ch to khung gm, cch m vt tri cho Mazda3 cm gic li hon ho</span><br font-size:="" helvetica="" style="box-sizing: border-box; font-family: " />\r\n<span font-size:="" helvetica="" style="font-family: ">- H thng dng, khi ng ng c thng minh i-Stop, Ch  li th thao</span><br font-size:="" helvetica="" style="box-sizing: border-box; font-family: " />\r\n<span font-size:="" helvetica="" style="font-family: ">- H thng kim sot gia tc GVC</span><br font-size:="" helvetica="" style="box-sizing: border-box; font-family: " />\r\n<span font-size:="" helvetica="" style="font-family: ">- La zng c hp kim nhm, h thng phanh a trc/sau, tr lc li in,..</span><br font-size:="" helvetica="" style="box-sizing: border-box; font-family: " />\r\n<span font-size:="" helvetica="" style="font-family: ">- Cam li, Mn hnh cm ng, Start/Stop, Ni tht da cao cp, Ch  li th thao,..</span><br font-size:="" helvetica="" style="box-sizing: border-box; font-family: " />\r\n<span font-size:="" helvetica="" style="font-family: ">- iu ha t ng, Mazda Connect, 6 loa,..</span><br font-size:="" helvetica="" style="box-sizing: border-box; font-family: " />\r\n<span font-size:="" helvetica="" style="font-family: ">- Gt ma t ng, n pha t ng, Gng chiu hu chng chi t ng,..</span><br font-size:="" helvetica="" style="box-sizing: border-box; font-family: " />\r\n<span font-size:="" helvetica="" style="font-family: ">- Ca nc, Phanh tay in t,..</span><br font-size:="" helvetica="" style="box-sizing: border-box; font-family: " />\r\n<span font-size:="" helvetica="" style="font-family: ">- Gng chnh in, gp in, knh ca chnh in, kha ca t ng, kha in thng minh Smart Key,..</span><br font-size:="" helvetica="" style="box-sizing: border-box; font-family: " />\r\n<span font-size:="" helvetica="" style="font-family: ">- Ngoi ra Mazda3 c trang b hng lot cng ngh iu khin tin tin, h thng tin ch thng minh, h thng h tr v trang thit b an ton cao cp hng u phn khc nh h thng nh H thng Chng b cng phanh ABS, Phn phi lc phanh in t EBD, H tr lc phanh khn cp BA, Cn bng in t DSC, Kim sot lc ko chng trt TCS, H tr khi hnh ngang dc HLA, Cnh bo phanh khn cp ESS, Ga t ng Cruise Control,.. khin cho Mazda3 tr thnh s la chn khng th b qua trong phn khc xe con hng C</span><br font-size:="" helvetica="" style="box-sizing: border-box; font-family: " />\r\n<span font-size:="" helvetica="" style="font-family: "> Khuyn mi c bit: Film cch nhit Llumar chnh hng USA bo hnh 5 nm, Thm tri sn Mazda, B cu h xe hi cao cp, Cnh lt gi th thao, p b bc chn chng xc, p cp chng xc, Lt cp nha do, Gi bo hnh m rng 2 nm v 50.000km,..</span><br font-size:="" helvetica="" style="box-sizing: border-box; font-family: " />\r\n<span font-size:="" helvetica="" style="font-family: "> a dng phin bn, p ng mi nhu cu s dng v kh nng ti chnh, a dng mu sc</span><br font-size:="" helvetica="" style="box-sizing: border-box; font-family: " />\r\n<span font-size:="" 