(110, 0, 1, 'VinFast chnh thc cng b thit k ngoi tht ca 2 mu xe hi sp ra mt ti Paris Motor Show 2018', 'vinfast-chinh-thuc-cong-bo-thiet-ke-ngoai-that-cua-2-mau-xe-hoi-sap-ra-mat-tai-paris-motor-show-2018', 'Mi y, VinFast  mt hng xe ti Vit Nam thuc tp on Vingroup  chnh thc cng b cc hnh nh v thit k ngoi tht ca hai mu xe hi dng Sedan v SUV sp c ra mt ti trin lm Paris Motor Show 2018 vi tiu ch trong thit k: Vit Nam - Phong cch - An ton - Sng to - Tin phong.\r\n\r\n', '<p style="color: rgb(34, 34, 34); font-family: Arial, Verdana, sans-serif; font-size: 12px;"></p>\r\n\r\n<p style="color: rgb(34, 34, 34); font-family: Arial, Verdana, sans-serif; font-size: 12px;">Mi y, VinFast  mt hng xe ti Vit Nam thuc tp on Vingroup  chnh thc cng b cc hnh nh v thit k ngoi tht ca hai mu xe hi dng Sedan v SUV sp c ra mt ti trin lm Paris Motor Show 2018 vi tiu ch trong thit k: Vit Nam - Phong cch - An ton - Sng to - Tin phong.</p>\r\n\r\n<p style="color: rgb(34, 34, 34); font-family: Arial, Verdana, sans-serif; font-size: 12px;"></p>\r\n\r\n<p style="color:rgb(34, 34, 34); font-family:Arial, Verdana, sans-serif; font-size:12px; text-align:center"><img alt="VinFast chnh thc cng b thit k ngoi tht ca 2 mu xe hi sp ra mt ti Paris Motor Show 2018" src="http://carontrade.com/upload/images/vinfast-gioi-thieu-2-mau-xe-hoi-moi-1(1).jpg" /></p>\r\n\r\n<p style="color: rgb(34, 34, 34); font-family: Arial, Verdana, sans-serif; font-size: 12px;"></p>\r\n\r\n<p style="color: rgb(34, 34, 34); font-family: Arial, Verdana, sans-serif; font-size: 12px;">on video trailer v 2 mu xe mi m VinFast cng b th  mang n mt dng ngn ng thit k ng cp tm th gii do Pininfarina - i ng sng to danh ting n t Italia  thc hin thnh cng 2 mu xe ny vi tiu ch Vit Nam - Phong cch - An ton - Sng to - Tin phong m hng xe VinFast mong mun hng n. </p>\r\n\r\n<p style="color: rgb(34, 34, 34); font-family: Arial, Verdana, sans-serif; font-size: 12px;"></p>\r\n\r\n<p style="color:rgb(34, 34, 34); font-family:Arial, Verdana, sans-serif; font-size:12px; text-align:center"><img alt="VinFast chnh thc cng b thit k ngoi tht ca 2 mu xe hi sp ra mt ti Paris Motor Show 2018" src="http://carontrade.com/upload/images/vinfast-gioi-thieu-2-mau-xe-hoi-moi-2.jpg" /></p>\r\n\r\n<p style="color: rgb(34, 34, 34); font-family: Arial, Verdana, sans-serif; font-size: 12px;"></p>\r\n\r\n<p style="color: rgb(34, 34, 34); font-family: Arial, Verdana, sans-serif; font-size: 12px;">Tham d trin lm Paris Motor Show, VinFast mong mun c m rng phm vi trng cu  kin ca ngi tiu dng trn mt chic xe mu tht c gii thiu, trc khi hng ny bt u m bn chnh thc ti th trng Vit Nam t thng 9/2019.</p>\r\n\r\n<p style="color: rgb(34, 34, 34); font-family: Arial, Verdana, sans-serif; font-size: 12px;"></p>\r\n\r\n<p style="color:rgb(34, 34, 34); font-family:Arial, Verdana, sans-serif; font-size:12px; text-align:center"><img alt="VinFast chnh thc cng b thit k ngoi tht ca 2 mu xe hi sp ra mt ti Paris Motor Show 2018" src="http://carontrade.com/upload/images/vinfast-gioi-thieu-2-mau-xe-hoi-moi-3.jpg" /></p>\r\n\r\n<p style="color: rgb(34, 34, 34); font-family: Arial, Verdana, sans-serif; font-size: 12px;"></p>\r\n\r\n<p style="color: rgb(34, 34, 34); font-family: Arial, Verdana, sans-serif; font-size: 12px;">Hnh nh r nt s cho thy thit k ca 2 mu xe hi dng Sedan v SUV rt n tng. Trang b li tn nhit a gic dng ch V  trung tm, n LED nh v ban ngy to nn ch F cch iu, i din n cho m tit th hai ca VinFast.</p>\r\n\r\n<p style="color: rgb(34, 34, 34); font-family: Arial, Verdana, sans-serif; font-size: 12px;"></p>\r\n\r\n<p style="color:rgb(34, 34, 34); font-family:Arial, Verdana, sans-serif; font-size:12px; text-align:center"><img alt="VinFast chnh thc cng b thit k ngoi tht ca 2 mu xe hi sp ra mt ti Paris Motor Show 2018" src="http://carontrade.com/upload/images/vinfast-gioi-thieu-2-mau-xe-hoi-moi-4.jpg" /></p>\r\n\r\n<p style="color: rgb(34, 34, 34); font-family: Arial, Verdana, sans-serif; font-size: 12px;"></p>\r\n\r\n<p style="color: rgb(34, 34, 34); font-family: Arial, Verdana, sans-serif; font-size: 12px;">Theo ngun tin uy tn, chic SUV s ng hng cng vi BMW X5, trong khi mu sedan s ng hng vi BMW 5-Series.</p>\r\n\r\n<p style="color: rgb(34, 34, 34); font-family: Arial, Verdana, sans-serif; font-size: 12px;"></p>\r\n\r\n<p style="color:rgb(34, 34, 34); font-family:Arial, Verdana, sans-serif; font-size:12px; text-align:center"><img alt="VinFast chnh thc cng b thit k ngoi tht ca 2 mu xe hi sp ra mt ti Paris Motor Show 2018" src="http://carontrade.com/upload/images/vinfast-gioi-thieu-2-mau-xe-hoi-moi-5.jpg" /></p>\r\n\r\n<p style="color: rgb(34, 34, 34); font-family: Arial, Verdana, sans-serif; font-size: 12px;"></p>\r\n\r\n<p style="color: rgb(34, 34, 34); font-family: Arial, Verdana, sans-serif; font-size: 12px;">V ng hng vi dng xe sang, s rt kh  ngi dng Vit mong ch 2 mu xe ny c gi bn r. Nhng nu i li, khi thnh cng, Vinfast s chng minh chnh ngi Vit hon ton c th lm c nhng mu xe cao cp.</p>\r\n\r\n<p style="color: rgb(34, 34, 34); font-family: Arial, Verdana, sans-serif; font-size: 12px;"></p>\r\n\r\n<p style="color: rgb(34, 34, 34); font-family: Arial, Verdana, sans-serif; font-size: 12px;">D cha phi l bn chnh thc, nhng trc  Vinfast  v tnh  l hnh nh v mt phn ni tht trong khoang li ca 1 trong 2 chic xe. Bn c th thy ni tht s c thit k theo phong cch ca dng xe sang. Tch hp v-lng 3 chu, trang b cc nt iu khin nhanh, cm ng h in t, cn s BMW v mn hnh gii tr trung tm LCD kch thc ln.</p>\r\n\r\n<p style="color: rgb(34, 34, 34); font-family: Arial, Verdana, sans-serif; font-size: 12px;"></p>\r\n\r\n<p style="color:rgb(34, 34, 34); font-family:Arial, Verdana, sans-serif; font-size:12px; text-align:center"><img alt="VinFast chnh thc cng b thit k ngoi tht ca 2 mu xe hi sp ra mt ti Paris Motor Show 2018" src="http://carontrade.com/upload/images/vinfast-gioi-thieu-2-mau-xe-hoi-moi-6.jpg" /></p>\r\n\r\n<p style="color: rgb(34, 34, 34); font-family: Arial, Verdana, sans-serif; font-size: 12px;"></p>\r\n\r\n<p style="color: rgb(34, 34, 34); font-family: Arial, Verdana, sans-serif; font-size: 12px;">C hai mu xe m VinFast cng b u c pht trin da trn cc t l kch thc l tng nht ca nn cng nghip xe hi quc t. T cc nn tng cu trc kinh in, th cc nh thit k ca VinFast v Pininfarina  xy dng thnh nhng chic xe chy n nh, s hu chiu di c s ln, kt cu xe thanh thot v thc s khi gi cm hng n cho ngi dng.</p>\r\n\r\n<p style="color: rgb(34, 34, 34); font-family: Arial, Verdana, sans-serif; font-size: 12px;"></p>\r\n\r\n<p style="color:rgb(34, 34, 34); font-family:Arial, Verdana, sans-serif; font-size:12px; text-align:center"><img alt="VinFast chnh thc cng b thit k ngoi tht ca 2 mu xe hi sp ra mt ti Paris Motor Show 2018" src="http://carontrade.com/upload/images/vinfast-gioi-thieu-2-mau-xe-hoi-moi-7.jpg" /></p>\r\n\r\n<p style="color: rgb(34, 34, 34); font-family: Arial, Verdana, sans-serif; font-size: 12px;"></p>\r\n\r\n<p style="color: rgb(34, 34, 34); font-family: Arial, Verdana, sans-serif; font-size: 12px;">Trong , vi np capo c kch thc di, cabin sau mang phong cch c in v cc ng g chy dc theo chiu ngang ca xe. Qua , to nn tnh i xng tinh t v thanh lch mang n v p kiu hnh, sang trng cho mu xe Sedan. Ngc li, vi dng SUV li s hu capo chc chn, mnh m cng vi cc ng g thn v li lm mang ti phong cch th thao khe khon, qua  n cha mt ngun nng lng v hn v sn sng ch bt ph.</p>\r\n\r\n<p style="color: rgb(34, 34, 34); font-family: Arial, Verdana, sans-serif; font-size: 12px;"></p>\r\n\r\n<p style="color:rgb(34, 34, 34); font-family:Arial, Verdana, sans-serif; font-size:12px; text-align:center"><img alt="VinFast chnh thc cng b thit k ngoi tht ca 2 mu xe hi sp ra mt ti Paris Motor Show 2018" src="http://carontrade.com/upload/images/vinfast-gioi-thieu-2-mau-xe-hoi-moi-8.jpg" /></p>\r\n\r\n<p style="color: rgb(34, 34, 34); font-family: Arial, Verdana, sans-serif; font-size: 12px;"></p>\r\n\r\n<p style="color: rgb(34, 34, 34); font-family: Arial, Verdana, sans-serif; font-size: 12px;">Tri vi thng l trn th gii, ngay t u th VinFast  cho php khch hng v ngi dng cng tham gia vo qu trnh chn mu xe. Mu Sedan v SUV c cng b mi y chnh l kt qu ca cuc bnh chn hn 62.000 ngi tiu dng vo 20 bn phc tho do 4 nh thit k hng u th gii tham gia thc hin. VinFast c thit k v ngi Vit, do ngi Vit s dng, nn vic la chn nn d xut pht im t bn s tho ca Ital Design v cng c pht trin v hon thin bi Pininfarina - nhng mu xe VinFast ban u vn xng ng l mt sn phm quc dn ca Vit Nam, 2 mu xe cha ng nim t ho v k vng rt ln ca ngi Vit.</p>\r\n\r\n<p style="color: rgb(34, 34, 34); font-family: Arial, Verdana, sans-serif; font-size: 12px;"></p>\r\n\r\n<p style="color:rgb(34, 34, 34); font-family:Arial, Verdana, sans-serif; font-size:12px; text-align:center"><img alt="VinFast chnh thc cng b thit k ngoi tht ca 2 mu xe hi sp ra mt ti Paris Motor Show 2018" src="http://carontrade.com/upload/images/vinfast-gioi-thieu-2-mau-xe-hoi-moi-9.jpg" /></p>\r\n\r\n<p style="color: rgb(34, 34, 34); font-family: Arial, Verdana, sans-serif; font-size: 12px;"></p>\r\n\r\n<p style="color: rgb(34, 34, 34); font-family: Arial, Verdana, sans-serif; font-size: 12px;">Vi vic ra mt hai mu xe hi dng Sedan v SUV ti Paris Motor Show 2018, VinFast s tr thnh l mt nh sn xut  t Vit Nam u tin tham d vo Top 5 trin lm  t quc t ln nht. iu ny khng nh s t tin, t duy khc bit v tm nhn vn ra bin ln ca mt thng hiu Vit y tr trung nng ng v trn y nng lng tin v pha trc.</p>\r\n\r\n<p style="color: rgb(34, 34, 34); font-family: Arial, Verdana, sans-serif; font-size: 12px;"></p>\r\n', 'vinfast-gioi-thieu-2-mau-xe-hoi-moi-1-8598.jpg', 'vinfast-gioi-thieu-2-mau-xe-hoi-moi-15283_170x114.jpg', 1, 1, 1536907466, 1536924799, 'VinFast chnh thc cng b thit k ngoi tht ca 2 mu xe hi sp ra mt ti Paris Motor Show 2018', 'vinfast gii thiu 2 mu xe hi mi', 'Mi y, VinFast  mt hng xe ti Vit Nam thuc tp on Vingroup  chnh thc cng b cc hnh nh v thit k ngoi tht ca hai mu xe hi dng Sedan v SUV sp c ra mt ti trin lm Paris M', '', '', '', 'video', 0, 0, 0, '', '', 'https://www.youtube.com/watch?v=3bbfezcoe90'),
(109, 0, 1, 'Chia s nhng mo gip hnh khch v ti x trn xe hi chng say xe hiu qu m cn khng dng thuc', 'chia-se-nhung-meo-giup-hanh-khach-va-tai-xe-tren-xe-hoi-chong-say-xe-hieu-qua-ma-can-khong-dung-thuoc', 'Di y l nhng mo gip hnh khch v ti x trn xe hi chng say xe hiu qu m cn khng dng thuc gip cho nhng chuyn i chi xa thoi mi v th v hn.\r\n', '<div style="text-align:justify; font-size:14px; line-height:25px;">\r\n<p><br />\r\nSay xe  y l mt k ph hng mi chuyn i ca bn v l ni c mng khng ch ca hnh khch m cn l cc cnh ti x. Khi b say xe, ngi dng s c cm gic kh chu v nh hng ln n kh nng cm li ca ti x v gy s khng thoi mi khi i xa ca hnh khch.</p>\r\n\r\n<p></p>\r\n\r\n<p>Di y l nhng mo gip hnh khch v ti x trn xe hi chng say xe hiu qu m cn khng dng thuc gip cho nhng chuyn i chi xa thoi mi v th v hn.<br />\r\n</p>\r\n\r\n<h2 style="line-height:30px"><strong>1. Chn ngi  nhng hng gh pha trc</strong><br />\r\n</h2>\r\n\r\n<p>Khi bn ngi  nhng hng gh pha di gn ui xe th bn d dng cm nhn r c s rung lc khi xe i trn nhng b mt g gh.<br />\r\n</p>\r\n\r\n<p style="text-align:center"><img alt="Chia s nhng mo gip hnh khch v ti x trn xe hi chng say xe hiu qu m cn khng dng thuc" src="http://carontrade.com/upload/images/cach-hieu-qua-chong-say-xe-1.jpg" /></p>\r\n\r\n<p><br />\r\nV vy, bn s nhanh c cm gic bun nn v chong vng hn. Tuy nhin, khi ln xe, bn nn chn ngi  nhng gh pha trc th hin tng cm gic bsay xe s nh bt do t c s chuyn ng v cc va chm r rng.<br />\r\n</p>\r\n\r\n<p style="text-align:center"><img alt="Chia s nhng mo gip hnh khch v ti x trn xe hi chng say xe hiu qu m cn khng dng thuc" src="http://carontrade.com/upload/images/cach-hieu-qua-chong-say-xe-2.jpg" /></p>\r\n\r\n<h2 style="line-height:30px"><br />\r\n<strong>2. Khng s dng nc c ga</strong><br />\r\n</h2>\r\n\r\n<p>Mt s loi  ung c ga s khin cho d dy b kch thch v gy cho bn nhanh bun nn di s rung lc ca xe khi xe di chuyn.<br />\r\n</p>\r\n\r\n<p style="text-align:center"><img alt="Chia s nhng mo gip hnh khch v ti x trn xe hi chng say xe hiu qu m cn khng dng thuc" src="http://carontrade.com/upload/images/cach-hieu-qua-chong-say-xe-3.jpg" /></p>\r\n\r\n<p><br />\r\nDo ,  trnh s dng loi  ung lm d dy b nh hng khi ngi trn xe th bn nn trnh cc  ung c gas.<br />\r\n</p>\r\n\r\n<h2 style="line-height:30px"><strong>3. Ng  gic trc ngy khi hnh</strong><br />\r\n</h2>\r\n\r\n<p>Thng thng, cc hnh khch khng ng  gic, v vy iu ny nh hng nghim trng n sc khe do thiu ng v lo lng, khin cho bn rt d b say xe hoc nn nao..  trnh hin tng b say xe, bn nn ng  gic trc ngy khi hnh.<br />\r\n</p>\r\n\r\n<p style="text-align:center"><img alt="Chia s nhng mo gip hnh khch v ti x trn xe hi chng say xe hiu qu m cn khng dng thuc" src="http://carontrade.com/upload/images/cach-hieu-qua-chong-say-xe-4.jpg" /></p>\r\n\r\n<h2 style="line-height:30px"><br />\r\n<strong>4. Trnh n qu no</strong><br />\r\n</h2>\r\n\r\n<p>Trc khi khi hnh, bn hy c gng khng nn n qu no, hoc khng nn ung cc  ung c cn. Tuy nhin, bn nn trnh nhn i khi ln xe. Ngoi ra, bn nn trnh  cc thc phm nng mi khi mang ln trn xe nh mc, su ring... v chng s rt d gy ra cm gic bun nn hn.<br />\r\n</p>\r\n\r\n<p style="text-align:center"><img alt="Chia s nhng mo gip hnh khch v ti x trn xe hi chng say xe hiu qu m cn khng dng thuc" src="http://carontrade.com/upload/images/cach-hieu-qua-chong-say-xe-5.jpg" /></p>\r\n\r\n<h2 style="line-height:30px"><br />\r\n<strong>5. V qut gip chng say xe hiu qu</strong><br />\r\n</h2>\r\n\r\n<p>Mt cch khc s chng say xe rt hiu qu,  chnh l v qut. V tinh du c trong v qut khi kt hp vi hng thm d chu s gip cho bn  hn trong vic chng say xe. Qu qut bc v, bn gp i v li v t  hai l mi.<br />\r\n</p>\r\n\r\n<p style="text-align:center"><img alt="Chia s nhng mo gip hnh khch v ti x trn xe hi chng say xe hiu qu m cn khng dng thuc" src="http://carontrade.com/upload/images/cach-hieu-qua-chong-say-xe-6.jpg" /></p>\r\n\r\n<p><br />\r\nNhng tinh du trn v qut km thm mi hng s gip cho h thn kinh c an thn nh, qua  chng co tht d dy v rut. Chnh v vy khi bn i xe hy nh mang theo mt qu qut nh. Trong trng hp bn khng c qut, th bn c th thay th bng cam hoc chanh cng c  nh!<br />\r\n</p>\r\n\r\n<h2 style="line-height:30px"><strong>6. eo khu trang</strong><br />\r\n</h2>\r\n\r\n<p>Nu bn eo khu trang khi ngi trn xe hi s gip bn trnh c cc loi mi khi thuc l, mi nc hoa v cng nh cc cht to mi kh chu trn xe. Chnh v vy, bn s khng b nh hng v trnh c cm gic say xe.<br />\r\n</p>\r\n\r\n<p style="text-align:center"><img alt="Chia s nhng mo gip hnh khch v ti x trn xe hi chng say xe hiu qu m cn khng dng thuc" src="http://carontrade.com/upload/images/cach-hieu-qua-chong-say-xe-8.jpg" /></p>\r\n\r\n<h2 style="line-height:30px"><br />\r\n<strong>7. Nhm mt trong giy lt</strong><br />\r\n</h2>\r\n\r\n<p>Khi bn c triu chng bun nn th bn hy ngay lp tc nhm mt li v ngi thng lng so vi gh trong giy lt. iu ny s gip ct cc cn kh chu m bn ang trong qu trnh gp phi.<br />\r\n</p>\r\n\r\n<p style="text-align:center"><img alt="Chia s nhng mo gip hnh khch v ti x trn xe hi chng say xe hiu qu m cn khng dng thuc" src="http://carontrade.com/upload/images/cach-hieu-qua-chong-say-xe-9.jpg" /></p>\r\n\r\n<p><br />\r\nQua , bn cng cn phi ch  rng, nu mt qu kh hoc mt mi cng c th gp phn lm cho tnh trng say xe tr nn nghim trng hn. V vy, bn ng  mt ca bn phi lm vic qu mt mi khi bn ngi trn xe hoc bn nn s dng thuc nh mt trc khi ln xe  mt bt kh, mi.<br />\r\n</p>\r\n\r\n<h2 style="line-height:30px"><strong>8. Tr chuyn vi mi ngi xung quanh</strong><br />\r\n</h2>\r\n\r\n<p>Nu c bn b ang i cng chuyn i, th nhng cu chuyn khi tr chuyn vi nhng ngi xung quanh s gip bn qun i cm gic l bn ang ngi trn xe. Bn c th mang theo mt vi mn  n vt bn thch, hoc mt chic my nghe nhc, ht mt mnh hoc mt th chi vi mn  chi tr tu  bn lm th vui tiu khin trn xe, iu ny s gip bn qun i cm gic say xe.<br />\r\n</p>\r\n\r\n<p style="text-align:center"><img alt="Chia s nhng mo gip hnh khch v ti x trn xe hi chng say xe hiu qu m cn khng dng thuc" src="http://carontrade.com/upload/images/cach-hieu-qua-chong-say-xe-10.jpg" /></p>\r\n\r\n<h2 style="line-height:30px"><br />\r\n<strong>9. Ung nhiu nc</strong><br />\r\n</h2>\r\n\r\n<p>Trc khi i, ban nn ung khong hai ly nc m, v  chnh l liu thuc tt cho nhng ngi ang b say tu xe. V phng php ny s c tc dng gip ko gim cm gic bun nn.<br />\r\n</p>\r\n\r\n<p style="text-align:center"><img alt="Chia s nhng mo gip hnh khch v ti x trn xe hi chng say xe hiu qu m cn khng dng thuc" src="http://carontrade.com/upload/images/cach-hieu-qua-chong-say-xe-11.jpg" /></p>\r\n\r\n<h2 style="line-height:30px"><br />\r\n<strong>10. Ng mt cht nu c th</strong><br />\r\n</h2>\r\n\r\n<p>Mt gic ng ngn trn xe s gip ch cho bn rt nhiu trong vic bn c th chng li cn say.<br />\r\n</p>\r\n\r\n<p style="text-align:center"><img alt="Chia s nhng mo gip hnh khch v ti x trn xe hi chng say xe hiu qu m cn khng dng thuc" src="http://carontrade.com/upload/images/cach-hieu-qua-chong-say-xe-12.jpg" /></p>\r\n</div>\r\n', 'cach-hieu-qua-chong-say-xe-10-3967.jpg', 'cach-hieu-qua-chong-say-xe-109145_170x107.jpg', 1, 1, 1536907091, 1536924091, 'Chia s nhng mo gip hnh khch v ti x trn xe hi chng say xe hiu qu m cn khng dng thu', 'Chia s nhng mo gip hnh khch v ti x trn xe hi chng say xe hiu qu m cn khng dng thuc', 'Di y l nhng mo gip hnh khch v ti x trn xe hi chng say xe hiu qu m cn khng dng thuc gip cho nhng chuyn i chi xa thoi mi v th v hn.\r\n', '', '', '', 'tin-tuc', 0, 0, 0, '', '', ''),
