(33, 0, 1, 'C ch gii quyt khiu ni, tranh chp', 'co-che-giai-quyet-khieu-nai-tranh-chap', 'Thnh vin c quyn gi khiu ni v vic cht lng dch v, vic r r thng tin c nhn cho bn th ba, thng tin thanh ton gy hi cho Thnh vin n Ban Qun Tr ca Sn giao dch TMT CarOntrade.com. Khi tip nhn nhng trng hp khiu ni, CarOntrade s xc nhn li thng tin, trng hp ng nh phn nh ca Thnh vin, tu theo mc  m CarOntrade s c nhng bin php x l ph hp.', '<p></p>\r\n\r\n<p style="text-align: justify;"><span style="font-family:times new roman,times,serif;"><span style="font-size:16px;">Sn giao dch TMT CarOntrade.com c trch nhim tip nhn v x l khiu ni ca Thnh vin lin quan n sn phm dch v hoc bo mt thng tin ti website <a href="http://www.carontrade.com/">www.carontrade.com</a>.</span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-family:times new roman,times,serif;"><span style="font-size:16px;">Thnh vin c quyn gi khiu ni v vic cht lng dch v, vic r r thng tin c nhn cho bn th ba, thng tin thanh ton gy hi cho Thnh vin n Ban Qun Tr ca Sn giao dch TMT CarOntrade.com. Khi tip nhn nhng trng hp khiu ni, CarOntrade s xc nhn li thng tin, trng hp ng nh phn nh ca Thnh vin, tu theo mc  m CarOntrade s c nhng bin php x l ph hp.</span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-family:times new roman,times,serif;"><span style="font-size:16px;">Khch hng gi khiu ni ti a ch:</span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-family:times new roman,times,serif;"><span style="font-size:16px;"><strong>Sn giao dch TMT CarOntrade.com</strong></span></span></p>\r\n\r\n<p style="text-align: justify;"><span style="font-family:times new roman,times,serif;"><span style="font-size:16px;"><strong>CNG TY TNHH CARONTRADE</strong></span></span></p>\r\n\r\n<p style="text-align: justify;"><span style="font-family:times new roman,times,serif;"><span style="font-size:16px;"><strong>- a ch: 190/92a Xm t, Phng 10, Qun 11, Thnh Ph H Ch Minh, Vit Nam.</strong></span></span></p>\r\n\r\n<p style="text-align: justify;"><span style="font-family:times new roman,times,serif;"><span style="font-size:16px;"><strong>- VPGD: 190/92a Xm t, Phng 10, Qun 11, Thnh Ph H Ch Minh, Vit Nam.</strong></span></span></p>\r\n\r\n<p style="text-align: justify;"><span style="font-family:times new roman,times,serif;"><span style="font-size:16px;"><strong>- S in thoi: 0126 4428 166.</strong></span></span></p>\r\n\r\n<p style="text-align: justify;"><span style="font-family:times new roman,times,serif;"><span style="font-size:16px;"><strong>- Email:</strong> <a href="mailto:bophankinhdoanh@carontrade.com">bophankinhdoanh@carontrade.com</a> <strong></strong> <a href="mailto:hotrokhachhang@carontrade.com">hotrokhachhang@carontrade.com</a>.</span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-family:times new roman,times,serif;"><span style="font-size:16px;"><em style="font-size: 14px; font-family: arial, helvetica, sans-serif;">* <strong>Cc bc gii quyt tranh chp, khiu ni</strong></em></span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-family:times new roman,times,serif;"><span style="font-size:16px;"><strong>- Bc 1:</strong> B phn Chm Sc Khch Hng ca Cng ty s tip nhn cc khiu ni ca Thnh vin hoc B phn Kinh doanh s tip nhn cc khiu ni ca cc Nh cung cp/i l. Cc b phn ny ch ng gii quyt nhanh chng v tr li ngay kt qu gii quyt cc khiu ni trn c s cc Chnh sch m Cng ty  cng b.</span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-family:times new roman,times,serif;"><span style="font-size:16px;"><strong>- Bc 2:</strong> Trong trng hp phc tp hoc khng c quy nh ti cc chnh sch m Cng ty  cng b th B phn Chm Sc Khch Hng/B phn Kinh doanh s cam kt thi hn phn hi cho Thnh vin v Nh cung cp/i l khng qu 7 ngy.</span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-family:times new roman,times,serif;"><span style="font-size:16px;"><strong>- Bc 3:</strong> Chuyn kt qu gii quyt khiu ni cho cc b phn c lin quan  thc hin (B phn K ton  Ti chnh) v gi in xc nhn vi Thnh vin v Nh cung cp/i l v kt qu khiu ni  c gii quyt.</span></span></p>\r\n\r\n<p style="margin-left: 18pt; text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-family:times new roman,times,serif;"><span style="font-size:16px;">CarOntrade tn trng v nghim tc thc hin cc quy nh ca php lut v bo v quyn li ca Thnh vin v Nh cung cp/i l. V vy,  ngh cc Thnh vin v Nh cung cp/i l s dng dch v t Sn giao dch TMT CarOntrade.com nn cung cp y , chnh xc, trung thc v chi tit cc thng tin lin quan n dch v. Mi hnh vi la o, gian ln trong kinh doanh u b ln n v phi chu hon ton trch nhim trc php lut.</span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-family:times new roman,times,serif;"><span style="font-size:16px;">CarOntrade s khng can thip vo qu trnh thng lng v giao dch gia ngi mua v ngi bn,  bo m quyn li ca c ngi mua v ngi bn, chng ti khuyn khch mi ngi nn c v tun th quy nh ca Sn giao dch TMT CarOntrade.com. Chnh v vy, mi s tranh chp, khiu ni v qu trnh giao dch gia hai bn ngi mua v ngi bn s khng c CarOntrade gii quyt.</span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-family:times new roman,times,serif;"><span style="font-size:16px;">CarOntrade cng khai c ch gii quyt cc tranh chp pht sinh trong qu trnh hp tc vi cc Nh cung cp/i l. i vi Nh cung cp/i l, khi  k kt hp ng hp tc vi CarOntrade v pht sinh tranh chp hoc khiu ni trong qu trnh lm vic hoc b tn hi li ch hp php, CarOntrade s c trch nhim tip nhn thng tin phn nh. Chu trch nhim gii quyt cc vn  lin quan, tch cc h tr cc Nh cung cp/i l bo v quyn v li ch hp php ca bn thn.</span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-family:times new roman,times,serif;"><span style="font-size:16px;">CarOntrade cng khai c ch v quy trnh gii quyt tranh chp i vi cc bn lin quan l: gii quyt tranh chp theo c ch trao i tha thun thng nht, cc bn lin quan s thc hin theo quy trnh trao i gin tip qua in thoi, xc nhn vn bng email, nu vn cha tha thun c th s gii quyt thng qua gp trc tip  c th ha vn , gii quyt trit  vn  mu thun gia cc bn sao cho c li nht.</span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-family:times new roman,times,serif;"><span style="font-size:16px;">Cc bn bao gm Nh cung cp/i l, Thnh vin v CarOntrade s phi c vai tr trch nhim trong vic tch cc gii quyt vn . i vi Nh cung cp cn c trch nhim cung cp vn bn giy t chng thc thng tin lin quan n s vic ang gy mu thun gia CarOntrade v Nh cung cp/i l. i vi Thnh vin cn c trch nhim cung cp bng chng c th, chng minh vic khiu ni vi Sn giao dch TMT CarOntrade.com l c c s. Khi  c y  giy t, CarOntrade s tin hnh xem xt v nu r, phn tch li thuc v bn no v gii quyt tranh chp, khiu ni mt cch tho ng nht.</span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-family:times new roman,times,serif;"><span style="font-size:16px;">Nu thng qua hnh thc tha thun m vn khng th gii quyt c mu thun pht sinh t vic tranh chp hoc khiu ni, CarOntrade s nh n c quan php lut c thm quyn can thip nhm m bo li ch hp php ca Thnh vin, Nh cung cp/i l, cng nh CarOntrade.</span></span></p>\r\n\r\n<p style="text-align: justify;"><br />\r\n</p>\r\n', '', '', 3, 1, 1530074591, 1535547747, 'C ch gii quyt khiu ni, tranh chp', 'C ch gii quyt khiu ni, tranh chp', 'Thnh vin c quyn gi khiu ni v vic cht lng dch v, vic r r thng tin c nhn cho bn th ba, thng tin thanh ton gy hi cho Thnh vin n Ban Qun Tr ca Sn giao dch TMT CarOntrad', '', '', '', 'ho-tro-khach-hang', 0, 0, 0, '', '', '');
INSERT INTO `table_news` (`id`, `id_item`, `noibat`, `ten`, `tenkhongdau`, `mota`, `noidung`, `photo`, `thumb`, `stt`, `hienthi`, `ngaytao`, `ngaysua`, `title`, `keywords`, `description`, `tenen`, `motaen`, `noidungen`, `type`, `id_danhmuc`, `id_list`, `id_cat`, `tag`, `icon`, `link`) VALUES
(78, 0, 1, 'nh gi chi tit Ford Transit 2018 Limousine  dng xe hng sang v ng cp', 'danh-gia-chi-tiet-ford-transit-2018-limousine-dong-xe-hang-sang-va-dang-cap', 'Bn ang mun tm mt dng xe Limousine hng sang vi nhiu tin nghi xa x  p ng nhu cu chy xe dch v, nhng li khng bit phi chn mu xe no? Th trong bi vit di y CarOntrade xin gii thiu v nh gi chi tit dng xe Ford Transit Limousine phin bn nng cp 2018 vi s tin nghi nhm em n cm gic li thoi mi i vi ti x v th gin ngay trn xe i vi cc hnh khch ngi trn xe.\r\n\r\n', '<div style="text-align:justify; font-size:14px; line-height:25px;">\r\n<p></p>\r\n\r\n<p>Bn ang mun tm mt dng xe Limousine hng sang vi nhiu tin nghi xa x  p ng nhu cu chy xe dch v, nhng li khng bit phi chn mu xe no? Th trong bi vit di y CarOntrade xin gii thiu v nh gi chi tit dng xe Ford Transit Limousine phin bn nng cp 2018 vi s tin nghi nhm em n cm gic li thoi mi i vi ti x v th gin ngay trn xe i vi cc hnh khch ngi trn xe.<br />\r\n</p>\r\n\r\n<p align="center"><img alt="nh gi chi tit Ford Transit 2018 Limousine  dng xe hng sang v ng cp" src="http://carontrade.com/upload/images/danh-gia-Ford-Transit-2018-Limousine-1.jpg" /><br />\r\n</p>\r\n\r\n<p>Chi tit hn, Ford Transit 2018 Limousine c ci tin t xe Ford Transit 16 ch vi s sang trng v ng cp, dng xe hng ti cc i tng ngi dng l doanh nhn thnh t, hoc cc t chc, doanh nghip ln.</p>\r\n\r\n<p></p>\r\n\r\n<h2 style="line-height:18px"><strong>Ngoi tht Ford Transit 2018</strong></h2>\r\n\r\n<h2 style="line-height:18px"><br />\r\n</h2>\r\n\r\n<p>Ford Transit Limousine 2018 s hu kiu dng thit k hon ton mi vi cc ng vn p c thit k t cht liu Composit em n s chc chn trong qu trnh s dng cho cc khch hng. Cc ng vin ca xe thit k lin lc p dc theo cc ng dp ni trn xe mang li phong cch sang trng cho xe.</p>\r\n\r\n<p></p>\r\n\r\n<p>Xe c kch thc tng th ln lt l 5780 x 2000 x 2360 mm, phn u xe c trang b li tn nhit vi 2 l kim loi thp, cm n trc c vut cao, hc gi nh trn xe cng vi cn trc c m rng bn cnh n sng m trn  2 bn.<br />\r\n</p>\r\n\r\n<p align="center"><img alt="nh gi chi tit Ford Transit 2018 Limousine  dng xe hng sang v ng cp" src="http://carontrade.com/upload/images/danh-gia-Ford-Transit-2018-Limousine-2.jpg" /><br />\r\n</p>\r\n\r\n<p>Hng xe c trang b dy knh lin ng cp, chc chn. B lazang dy dn hn cc bn thng, gng chiu hu chnh in v sn mu en, tch hp thm gng cu li gip tm quan st ca ti x c ci thin hn.</p>\r\n\r\n<p></p>\r\n\r\n<p>Cm n hu trn xe c ko di ti gn bc ln xng  ca sau nhn kh p mt. Ngoi ra, n phanh cng c lp cao gip cho xe pha sau tin quan st trong qu trnh di chuyn.</p>\r\n\r\n<p></p>\r\n\r\n<p></p>\r\n\r\n<h2 style="line-height:18px"><strong>Ni tht s hu thit k tinh xo v tin nghi</strong></h2>\r\n\r\n<h2 style="line-height:18px"></h2>\r\n\r\n<p></p>\r\n\r\n<p>Xe s hu khoang ni tht 10 gh ngi vi khong cch va  gip cho khch hng c thm nhiu khng gian ngi hn. Ford Transit Limousine 2018 c thit k ni tht c o v sang trng ng cp vi tone nu hon ton mi.<br />\r\n</p>\r\n\r\n<p align="center"><img alt="nh gi chi tit Ford Transit 2018 Limousine  dng xe hng sang v ng cp" src="http://carontrade.com/upload/images/danh-gia-Ford-Transit-2018-Limousine-3.png" /><br />\r\n</p>\r\n\r\n<p>Trn xe c ci ting cng vi cc mng p trang tr kh p mt, bng by cng hai bn vch xe c p da sang trng, sn xe c trang b cht lng g cao cp v dn n nn trong xe cng em n s hin i cho khng gian bn trong xe.<br />\r\n</p>\r\n\r\n<p align="center"><img alt="nh gi chi tit Ford Transit 2018 Limousine  dng xe hng sang v ng cp" src="http://carontrade.com/upload/images/danh-gia-Ford-Transit-2018-Limousine-4.jpg" /><br />\r\n</p>\r\n\r\n<p>Ca s hng gh trn hng u vi kh nng chnh in, bc da cao cp vi gh li chnh 6 hng em n s thoi mi. V tr gh c th thit k trt ton phn hoc c th lm loi gh  quay ngc thun tin hn trong vic trao i cng vic cng nh gii tr cng gia nh.<br />\r\n</p>\r\n\r\n<p align="center"><img alt="nh gi chi tit Ford Transit 2018 Limousine  dng xe hng sang v ng cp" src="http://carontrade.com/upload/images/danh-gia-Ford-Transit-2018-Limousine-5.png" /><br />\r\n</p>\r\n\r\n<p>Ngoi ra, phn gh ngi trn xe cn c trang b thm bn lm vic thng minh gp gn em n s tin nghi cao nht cho khch hng trn xe, ph hp cho nhng chuyn i di v kt hp cng vi cng vic m bo  vt dng cn thit cho qu trnh lm vic.<br />\r\n</p>\r\n\r\n<p align="center"><img alt="nh gi chi tit Ford Transit 2018 Limousine  dng xe hng sang v ng cp" src="http://carontrade.com/upload/images/danh-gia-Ford-Transit-2018-Limousine-6.jpg" /><br />\r\n</p>\r\n\r\n<p>Xe trang b 4 gh VIP chnh in, ng thi cn kt hp vi massage rung v b  chn di gh nhm em n cho khch hng cm gic ngi thoi mi nht. Hng gh th 3 c kh nng trt in linh hot.<br />\r\n</p>\r\n\r\n<p align="center"><img alt="nh gi chi tit Ford Transit 2018 Limousine  dng xe hng sang v ng cp" src="http://carontrade.com/upload/images/danh-gia-Ford-Transit-2018-Limousine-7.jpg" /></p>\r\n\r\n<p align="center"></p>\r\n\r\n<p align="center"></p>\r\n\r\n<h2 style="line-height:18px"><strong>Tin nghi cao cp</strong></h2>\r\n\r\n<p></p>\r\n\r\n<p>Ford Transit Limousine c trang b h thng gii tr ng cp vi h thng m thanh ni Alpine cao cp, mn hnh LCD 21 inch ti v tr trung tm xe, u DVD Pioneer, thit b pht sng Wifi s dng pin d phng, trang b 2 n c sch c nhn c s dng cng tc ring cng h thng n chiu sng trn xe s dng cng ngh LED, c th ty chnh nhiu cc ch  khc nhau, mang n khng gian c nhn ha cao cho hnh khch.<br />\r\n</p>\r\n\r\n<p align="center"><img alt="nh gi chi tit Ford Transit 2018 Limousine  dng xe hng sang v ng cp" src="http://carontrade.com/upload/images/danh-gia-Ford-Transit-2018-Limousine-8.png" /><br />\r\n</p>\r\n\r\n<p>Xe c trang b iu ha vi 2 dn lnh hot ng tt, gip cho nhit  trong xe  mc va phi em n cm gic d chu nht cho hnh khch ngi trong xe.<br />\r\n</p>\r\n\r\n<p align="center"><img alt="nh gi chi tit Ford Transit 2018 Limousine  dng xe hng sang v ng cp" src="http://carontrade.com/upload/images/danh-gia-Ford-Transit-2018-Limousine-9.png" /><br />\r\n</p>\r\n\r\n<p>Trn xe cn c 5 cng USB,  ngun 220V cng b chuyn i in 500W gip p ng y  nhu cu s dng cc thit b in t, di ng ca hnh khch ngi trn xe.<br />\r\n</p>\r\n\r\n<p align="center"><img alt="nh gi chi tit Ford Transit 2018 Limousine  dng xe hng sang v ng cp" src="http://carontrade.com/upload/images/danh-gia-Ford-Transit-2018-Limousine-10.png" /></p>\r\n\r\n<p align="center"></p>\r\n\r\n<h2 style="line-height:18px"></h2>\r\n\r\n<h2 style="line-height:18px"><strong>ng c v kh nng vn hnh</strong></h2>\r\n\r\n<h2 style="line-height:18px"><br />\r\n</h2>\r\n\r\n<p>Ford Transit Limousine 2018 c trang b ng c ng c Diesel 2.4L TDCi, 4 xy lanh thng hng, trc cam kp, c lm mt bng kh np cho cng sut 138 m lc ti 3500 vng/ pht v momen xon cc i 375 Nm ti 2000 vng/ pht. Xe c 6 cp s linh hot cng tnh nng tr li thy lc em n cm gic li chn tht.</p>\r\n\r\n<p></p>\r\n\r\n<p>Xe c gm xe cao 165mm, h thng treo trc c lp dng l xo xon, ng gim chn thy lc, h thng treo sau phuc nhp l cng ng gim chn thy lc gip cho xe vn hnh n nh trong mi iu kin thnh th, hay trn cao tc.<br />\r\n</p>\r\n\r\n<p align="center"><img alt="nh gi chi tit Ford Transit 2018 Limousine  dng xe hng sang v ng cp" src="http://carontrade.com/upload/images/danh-gia-Ford-Transit-2018-Limousine-11.png" /><br />\r\n</p>\r\n\r\n<p>Xe c kh nng cch m tt, gip cho cc hnh khch khng b nh hng bi ting n. Trang b lp 215/75R16 cng vi vnh c hp kim nhm c ng knh 16 inch em li s chc chn v n nh khi vn hnh.</p>\r\n\r\n<p></p>\r\n\r\n<p></p>\r\n\r\n<h2 style="line-height:18px"><strong>H thng an ton</strong></h2>\r\n\r\n<h2 style="line-height:18px"><br />\r\n</h2>\r\n\r\n<p>Ford Transit Limousine 2018 s hu nhiu cng ngh an ton gip cho vic li xe tr nn an ton hn nh: Camera li gip h tr pht tn hiu qua mn hnh gng chiu hu, t  gip cho ngi li quan st tt hn, li v  xe an ton hn. Phanh a em n cm gic phanh tt, tch hp dy ai an ton, tnh nng kha ca in v kha xe iu khin t xa em n s tin li cho ngi dng.<br />\r\n</p>\r\n\r\n<p align="center"><img alt="nh gi chi tit Ford Transit 2018 Limousine  dng xe hng sang v ng cp" src="http://carontrade.com/upload/images/danh-gia-Ford-Transit-2018-Limousine-12.png" /></p>\r\n\r\n<p></p>\r\n\r\n<p>Ford Transit 2018 Limousine ang c phn phi chnh hng ti Vit Nam vi nhiu mu sc a dng, gip cho khch hng d dng hn trong vic la chn gam mu yu thch ca mnh nh: Trng, Ghi vng, Bc, Ghi nh Thp, en v .</p>\r\n\r\n<p></p>\r\n</div>\r\n', 'danh-gia-ford-transit-2018-limousine-2-1140.jpg', 'danh-gia-ford-transit-2018-limousine-24374_170x80.jpg', 1, 1, 1533781075, 1533786856, 'nh gi chi tit Ford Transit 2018 Limousine  dng xe hng sang v ng cp', 'Ford Transit 2018 Limousine', 'Bn ang mun tm mt dng xe Limousine hng sang vi nhiu tin nghi xa x  p ng nhu cu chy xe dch v, nhng li khng bit phi chn mu xe no? Th trong bi vit di y Carontrade xin gi', '', '', '', 'danh-gia', 0, 0, 0, '', '', '');
INSERT INTO `table_news` (`id`, `id_item`, `noibat`, `ten`, `tenkhongdau`, `mota`, `noidung`, `photo`, `thumb`, `stt`, `hienthi`, `ngaytao`, `ngaysua`, `title`, `keywords`, `description`, `tenen`, `motaen`, `noidungen`, `type`, `id_danhmuc`, `id_list`, `id_cat`, `tag`, `icon`, `link`) VALUES
(32, 0, 1, 'Quy ch hot ng', 'quy-che-hoat-dong', 'Sn giao dch TMT CarOntrade.com cung cp cho ngi dng mt th trng mua bn xe hi trc tuyn c thc hin hot ng v vn hnh bi Cng ty TNHH CARONTRADE, trong  ngi dng s c ng k thnh vin v ng bn sn phm xe hi ca mnh, ngi mua khi xem cc sn phm trn Sn s lin h trc tip n ngi bn v giao dch nu thng lng thnh cng.', '<p style="text-align: center;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;"></span></span></p>\r\n\r\n<p style="text-align: center;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;"><strong>QUY CH HOT NG</strong></span></span></p>\r\n\r\n<p style="text-align: center;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;"><strong>SN GIAO DCH THNG MAI IN T CARONTRADE.COM</strong></span></span></p>\r\n\r\n<p style="text-align: center;"></p>\r\n\r\n<p style="text-align: justify;"><br />\r\n<span style="font-size:16px;"><span style="font-family:times new roman,times,serif;"><strong>I. Nguyn tc chung</strong></span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;">Sn giao dch TMT CarOntrade.com cung cp cho ngi dng mt th trng mua bn xe hi trc tuyn c thc hin hot ng v vn hnh bi Cng ty TNHH CARONTRADE, trong  ngi dng s c ng k thnh vin v ng bn sn phm xe hi ca mnh, ngi mua khi xem cc sn phm trn Sn s lin h trc tip n ngi bn v giao dch nu thng lng thnh cng.</span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;">Thnh vin trn Sn giao dch TMT CarOntrade.com l cc thng nhn, t chc, c nhn c quyn s dng hp php c Sn TMT CarOntrade.com chnh thc cng nhn v c php s dng dch v do Sn cung cp.</span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;">Nguyn tc ny p dng cho cc Thnh vin ng k s dng, ng bn sn phm ln Sn giao dch TMT CarOntrade.com, v ngi dng vi t cch l ngi mua s dng Sn giao dch TMT CarOntrade.com vi mc ch tham kho vo mua sn phm.</span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;">Thng nhn, t chc, c nhn tham gia giao dch ti Sn giao dch TMT CarOntrade.com t do tho thun trn c s tn trng quyn v li ch hp php ca cc bn ngi bn v ngi mua, khng tri vi quy nh ca php lut.</span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;">Ngi bn khi ng bn sn phm ln Sn phi c ngha v cung cp chnh xc v y  thng tin c nhn nhm chng minh s minh bch, hp php ca ngi bn i vi ngi mua. i vi ngi bn l i l, khng thuc cc trng hp b cm kinh doanh theo quy nh ca php lut.</span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;">Hot ng giao dch sn phm gia ngi mua v ngi bn trn Sn giao dch TMT CarOntrade.com phi minh bch, uy tn, r rng, khng chuc li, li dng v gy hi cho ngi mua cng nh ngi bn. Phi m bo quyn li ca ngi tham gia giao dch ti Sn giao dch TMT CarOntrade.com</span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;">Tt c cc ni dung trong Quy ch ny phi tun th theo h thng php lut hin hnh ca Vit Nam. Thnh vin khi tham gia vo Sn giao dch TMT CarOntrade phi t tm hiu trch nhim php l ca mnh i vi lut php hin hnh ca Vit Nam v cam kt thc hin ng nhng ni dung trong Quy ch ca Sn giao dch TMT CarOntrade.com.</span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;"><strong>II. Quy nh chung</strong></span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;"><em>Tn min sn giao dch thng mi in t</em></span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;">Sn giao dch TMT CarOntrade.com do Cng ty TNHH CARONTRADE pht trin vi tn min: <a href="http://www.carontrade.com/">www.carontrade.com</a> (Sau y gi tt l: Sn giao dch TMT CarOntrade.com)</span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;"><em>nh ngha chung</em></span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;"> - Ngi mua: l ngi dng trn Sn giao dch TMT CarOntrade.com c nhu cu tm kim v mua sn phm xe t ngi bn.</span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;"> - Ngi bn: l ngi dng  ng k tr thnh Thnh vin ca Sn giao dch TMT CarOntrade.com v c php s dng dch v ca Sn  ng tin bn sn phm xe hi ca mnh.</span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;"> - Thnh vin: l cc thng nhn, t chc, c nhn c nhu cu bn xe, s dng dch v cng nh tham gia giao dch trn Sn giao dch TMT CarOntrade.com. Thnh vin khi ng k phi cung cp nhng thng tin bt buc do Sn giao dch TMT CarOntrade.com a ra nhm bo m s uy tn, minh bch ca Thnh vin.</span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;">Khi ng k l Thnh vin ca Sn giao dch TMT CarOntrade.com, Thnh vin hiu rng:</span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;"> - Thnh vin c th to mt ti khon c nhn ca mnh  s dng dch v trn Sn giao dch TMT CarOntrade.com.</span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;"> - Thnh vin c th ng tin bn sn phm xe hi ca mnh n cc ngi dng khc.</span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;">Ni dung bn Quy ch ny tun th theo cc quy nh hin hnh ca Vit Nam. Thnh vin khi tham gia vo Sn giao dch TMT CarOntrade.com phi t tm hiu trch nhim php l ca mnh i vi lut php hin hnh ca Vit Nam v cam kt thc hin ng nhng ni dung trong Quy ch ca sn giao dch TMT CarOntrade.com.</span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;"><strong>III.Quy trnh giao dch</strong></span></span><br />\r\n</p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;"><strong>1. Quy trnh dng cho ngi mua hng</strong></span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;">Khi c nhu cu xem hoc mua xe trn CarOntrade, Ngi Mua cn thc hin cc bc sau y:</span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;"> - ng k/ng nhp ti khon thnh vin CarOntrade;</span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;"> - Tm kim, tham kho thng tin cc mu xe ca cc Ngi Bn m Ngi Mua ang quan tm.</span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;"> - Tham kho thng tin gi v chnh sch h tr ca bn bn xe m Ngi Mua ang c nhu cu mua (c th tham kho mu xe tng t ca nhng Ngi Bn khc trn website CarOntrade  a ra quyt nh mua mu xe );</span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;"> - Da trn thng tin tham kho c t cc tin bn xe, Ngi Mua c th lin h vi ngi bn qua thng tin lin h trn thng tin ngi bn  hi thm thng tin v xe hoc tip xc trc tip  kim tra tnh trng xe, li th trc khi quyt nh mua;</span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;"> - Ngi Mua sau khi  hi lng vi chic xe c bn t Ngi Bn th c hai c th t thng lng v mt gi c, hnh thc giao nhn, phng thc thanh ton v cc giy t php l lin quan, CarOntrade s khng can thip vo qu trnh thng lng gia hai bn;</span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;"> -  lin h vi Ngi Bn, Ngi Mua c th gi tin nhn yu cu thng qua mu form c CarOntrade cung cp bn di thng tin ngi bn hoc gi trc tip n s in thoi m Ngi Bn cung cp ti thng tin ngi bn;</span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;"> - Ngi Mua thc mc, khiu ni Ngi Bn (nu c) qua tng i h tr ca CarOntrade</span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;"><strong>2. Quy trnh dnh cho ngi bn hng/ng tin</strong></span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;"> - ng k ti khon thnh vin CarOntrade;</span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;"> - CarOntrade xc nhn v kch hot ti khon;</span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;"> - Sau khi ng nhp, Ngi Bn tin hnh ng ti thng tin bn hng:</span></span></p>\r\n\r\n<p style="margin-left: 54pt; text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;">- Chun b tin bi bng ch v hnh nh;</span></span></p>\r\n\r\n<p style="margin-left: 54pt; text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;">- Cc tin bi cn ng phi c chia thnh 2 phn thng tin xe hi v hnh nh xe hi</span></span></p>\r\n\r\n<p style="margin-left: 54pt; text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;">- Ni dung bng ch khng b gii hnk t cho phn m t sn phm, khng c quy nh v nh dng ch do CarOntrade s t ng iu chnh phng ch cho ng nht.</span></span></p>\r\n\r\n<p style="margin-left: 54pt; text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;">- Cc ni dung bng hnh nh c nh dng theo dng nh jpg, bmp, hoc png. S lng nh ti a cho 1 ln ng tin l 15 nh.</span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;"> - Chn loi tin ng</span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;"> - a ni dung tin ng bn ln Sn giao dch TMT CarOntrade.com;</span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;"> - CarOntrade kim duyt thng tin, ni dung tin ng bn xe ca Ngi Bn trc khi a ln Sn giao dch TMT CarOntrade.com.</span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;"><strong>3. Quy trnh giao nhn vn chuyn</strong></span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;"> Vic giao nhn v vn chuyn xe hi gia Ngi Mua v Ngi Bn l do hai bn t tho thun v quyt nh, CarOntrade khng can thip vo qu trnh giao nhn v vn chuyn gia hai bn.</span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;"><strong>4. Quy trnh xc nhn/hy n hng</strong></span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;"> - Sau khi Ngi Bn nhp ht cc ni dung, hnh nh cn ng ti ln Sn, Ngi Bn c th xc nhn tin ng  tin c tin hnh c chuyn qua b phn kim duyt.</span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;"> - Tin ng uc duyt sau khi  hp l vi quy nh ng tin ca CarOntrade s c hin th ln Sn.</span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;"> - Trng hp Ngi Bn i  khng mun ng tin, c th lu li tin nhp  hon tt sau hoc chn hu  xo b ni dung ng tin.</span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;"> - i vi trng hp Ngi Bn s dng ci tin u tin tnh ph, sau khi thanh ton qua cng thanh ton bng th ngn hng ni a/quc t, ngay khi CarOntrade nhn c ph thanh ton t Ngi Bn th b phn kim duyt s tin hnh duyn tin v cho hin th ln Sn.</span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;"><strong>5. Quy trnh bo hnh/bo tr sn phm</strong></span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;"> - Ngi Bn c trch nhim tip nhn bo hnh xe hi c bn cho Ngi Mua nh trong cam kt giy bo hnh xe (i vi xe mi).</span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;"> - Ngi Mua lun gi giy bo hnh v c quyn n tn ni i l bn xe  bo hnh.</span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;"> - Ngi Mua c quyn khiu ni, khiu kin Ngi Bn trong trng hp Ngi Bn t chi bo hnh bo tr xe hi khi ang cn trong thi hn bo hnh bo tr ghi trn giy bo hnh.</span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;"> - CarOntrade khuyn co Ngi Mua hng cn kim tra cc chnh sch bo hnh, bo tr i vi mu hi c d nh mua. CarOntrade s khng chu trch nhim chnh trong vic bo hnh bt k mu xe no. CarOntrade ch h tr trong kh nng cho php  mu xe ca Ngi Mua c bo hnh theo ch  ca Ngi Bn.</span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;"><strong>iu kin bo hnhi vi hng ha</strong></span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;"> - Cn thi hn bo hnh (da trn tem/phiu bo hnh/hoc thi im kch hot bo hnh in t)</span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;"> - Cn tem/phiu bo hnh</span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;"> - Xe b li k thut</span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;">Cc trng hp c th pht sinh ph bo hnh:</span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;"> - Xe hi ht thi hn bo hnh</span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;"> - Xe hi b b, bin dng, chy, n, m thp trong ng c... do ngi s dng</span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;">Khi c nhu cu bo hnh sn phm, Ngi Mua lin h trc tip vi trung tm bo hnh ca hng ti a phng (nu c). Trng hp Ngi Mua  qu xa trung tm bo hnh hoc c bt tin khc khng th n bo hnh trc tip, c th lin h trc tip vi Ngi Bn  nhn c hng dn bo hnh cn thit.</span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;"><strong>6. Quy trnh gii quyt tranh chp, khiu ni</strong></span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;">Sn giao dch TMT CarOntrade.com c trch nhim tip nhn v x l khiu ni ca Thnh vin lin quan n sn phm dch v hoc bo mt thng tin ti website <a href="http://www.carontrade.com/">www.carontrade.com</a>.</span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;">Thnh vin c quyn gi khiu ni v vic cht lng dch v, vic r r thng tin c nhn cho bn th ba, thng tin thanh ton gy hi cho Thnh vin n Ban Qun Tr ca Sn giao dch TMT CarOntrade.com. Khi tip nhn nhng trng hp khiu ni, CarOntrade s xc nhn li thng tin, trng hp ng nh phn nh ca Thnh vin, tu theo mc  m CarOntrade s c nhng bin php x l ph hp.</span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;">Khch hng gi khiu ni ti a ch:</span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;">Sn giao dch TMT CarOntrade.com</span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;"> - CNG TY TNHH CARONTRADE</span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;"> - a ch: 190/92a Xm t, Phng 10, Qun 11, Thnh Ph H Ch Minh, Vit Nam</span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;"> - VPGD: 190/92a Xm t, Phng 10, Qun 11, Thnh Ph H Ch Minh, Vit Nam</span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;"> - S in thoi: 0126 4428 166</span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;"> - Email:<a href="mailto:bophankinhdoanh@carontrade.com">bophankinhdoanh@carontrade.com</a>  <a href="mailto:hotrokhachhang@carontrade.com">hotrokhachhang@carontrade.com</a>.</span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;">* Cc bc gii quyt tranh chp, khiu ni</span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;"> - <strong>Bc 1:</strong> B phn Chm Sc Khch Hng ca Cng ty s tip nhn cc khiu ni ca Thnh vin hoc B phn Kinh doanh s tip nhn cc khiu ni ca cc Nh cung cp/i l. Cc b phn ny ch ng gii quyt nhanh chng v tr li ngay kt qu gii quyt cc khiu ni trn c s cc Chnh sch m Cng ty  cng b.</span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;"> - <strong>Bc 2:</strong> Trong trng hp phc tp hoc khng c quy nh ti cc chnh sch m Cng ty  cng b th B phn Chm Sc Khch Hng/B phn Kinh doanh s cam kt thi hn phn hi cho Thnh vin v Nh cung cp/i l khng qu 7 ngy.</span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;"> - <strong>Bc 3:</strong> Chuyn kt qu gii quyt khiu ni cho cc b phn c lin quan  thc hin (B phn K ton  Ti chnh) v gi in xc nhn vi Thnh vin v Nh cung cp/i l v kt qu khiu ni  c gii quyt.</span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;">CarOntrade tn trng v nghim tc thc hin cc quy nh ca php lut v bo v quyn li ca Thnh vin v Nh cung cp/i l. V vy,  ngh cc Thnh vin v Nh cung cp/i l s dng dch v t Sn giao dch TMT CarOntrade.com nn cung cp y , chnh xc, trung thc v chi tit cc thng tin lin quan n dch v. Mi hnh vi la o, gian ln trong kinh doanh u b ln n v phi chu hon ton trch nhim trc php lut.</span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;">CarOntrade s khng can thip vo qu trnh thng lng v giao dch gia ngi mua v ngi bn,  bo m quyn li ca c ngi mua v ngi bn, chng ti khuyn khch mi ngi nn c v tun th quy nh ca Sn giao dch TMT CarOntrade.com. Chnh v vy, mi s tranh chp, khiu ni v qu trnh giao dch gia hai bn ngi mua v ngi bn s khng c CarOntrade gii quyt.</span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;">CarOntrade cng khai c ch gii quyt cc tranh chp pht sinh trong qu trnh hp tc vi cc Nh cung cp/i l. i vi Nh cung cp/i l, khi  k kt hp ng hp tc vi CarOntrade v pht sinh tranh chp hoc khiu ni trong qu trnh lm vic hoc b tn hi li ch hp php, CarOntrade s c trch nhim tip nhn thng tin phn nh. Chu trch nhim gii quyt cc vn  lin quan, tch cc h tr cc Nh cung cp/i l bo v quyn v li ch hp php ca bn thn.</span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;">CarOntrade cng khai c ch v quy trnh gii quyt tranh chp i vi cc bn lin quan l: gii quyt tranh chp theo c ch trao i tha thun thng nht, cc bn lin quan s thc hin theo quy trnh trao i gin tip qua in thoi, xc nhn vn bng email, nu vn cha tha thun c th s gii quyt thng qua gp trc tip  c th ha vn , gii quyt trit  vn  mu thun gia cc bn sao cho c li nht.</span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;">Cc bn bao gm Nh cung cp/i l, Thnh vin v CarOntrade s phi c vai tr trch nhim trong vic tch cc gii quyt vn . i vi Nh cung cp cn c trch nhim cung cp vn bn giy t chng thc thng tin lin quan n s vic ang gy mu thun gia CarOntrade v Nh cung cp/i l. i vi Thnh vin cn c trch nhim cung cp bng chng c th, chng minh vic khiu ni vi Sn giao dch TMT CarOntrade.com l c c s. Khi  c y  giy t, CarOntrade s tin hnh xem xt v nu r, phn tch li thuc v bn no v gii quyt tranh chp, khiu ni mt cch tho ng nht.</span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;">0Nu thng qua hnh thc tha thun m vn khng th gii quyt c mu thun pht sinh t vic tranh chp hoc khiu ni, CarOntrade s nh n c quan php lut c thm quyn can thip nhm m bo li ch hp php ca Thnh vin, Nh cung cp/i l, cng nh CarOntrade.</span></span></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;"><strong>IV.Quy trnh thanh ton</strong></span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align:center"><img alt="" height="621" src="http://carontrade.com/upload/images/het.png" width="560" /></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;">Thnh vin khi mua dch v ng tin qung co t Sn TMT CarOntrade.com s tin hnh thanh ton chi ph ca Sn thng qua cng thanh ton trc tuyn VnPay. Thnh vin c th s dng th ngn hng ni a, th Visa/Mastercard  tin hnh thanh ton. Thng tin c yu cu in  xc nhn ngi thanh ton bt buc phi c in y  v chnh xc t thnh vin. Sau khi thanh ton, khi bn cng ty nhn c ph tr t thnh vin, b phn k thut s tin hnh kim duyt v cho hin th tin ng.</span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;"><strong>V.m bo an ton giao dch</strong></span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;">Ban qun l Sn giao dch/website TMT cn cung cp cho Thnh vin cng nh ngi dng nhng thng tin quan trng cn bit trc khi tham gia giao dch thanh ton cho dch v trn Sn, m bo an ton cho Thnh vin v ngi dng.</span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;">Ban qun l Sn giao dch/website TMT a ra c ch/phng n/gii php bo m an ton giao dch. i vi Sn giao dch/website TMT c chc nng thanh ton trc tuyn, Ban qun l Sn phi nu r c ch bo mt thanh ton ca Khch hng, x l khiu ni v n b thit hi trong trng hp thng tin thanh ton ca Khch hng qua website b thay i, xa, hy, sao chp, tit l, di chuyn tri php hoc b chim ot gy thit hi cho Khch hng.</span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;"><strong>VI.Bo v thng tin c nhn khch hng. </strong></span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<ol>\r\n	<li style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;"><strong>Mc ch v phm vi thu thp</strong></span></span></li>\r\n</ol>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;">Vic thu thp d liu ch yu trn Sn giao dch TMT CarOntrade.com bao gm: h v tn, a ch email, s in thoi, tn ng nhp, mt khu ng nhp, a ch ca Khch hng. y l cc thng tin m CarOntrade cn Khch hng cung cp bt buc khi ng k s dng dch v v chng ti s dng  lin h xc nhn khi Khch hng ng k s dng dch v trn Sn TMT CarOntrade.com, m bo quyn li cho Khch hng, da trn quy nh ti khoan 3 iu 36 Nghi inh 52/2013/N-CP ngay 16/5/2013. Khi ng k Thnh vin ca CarOntrade, ng ngha vi vic Khch hng t nguyn cung cp thng tin c nhn ca mnh cho chng ti.</span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;">Cc Khch hng s t chu trch nhim v bo mt v lu gi mi hot ng s dng dch v di tn ng k, mt khu v hp th in t ca mnh. Ngoi ra, Khch hng c trch nhim thng bo kp thi cho Sn TMT CarOntrade.com v nhng hnh vi s dng tri php, lm dng, vi phm bo mt, lu gi tn ng k v mt khu ca bn th ba  c bin php gii quyt ph hp.</span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<ol>\r\n	<li style="text-align: justify;" value="2"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;"><strong>Phm v s dng thng tin</strong></span></span></li>\r\n</ol>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;">Sn TMT CarOntrade.com s dng thng tin Khch hng cung cp :</span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;">- Cung cp cc dch v n Khch hng.</span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;"> - Gi cc thng bo v cc hot ng trao i thng tin gia Khch hng v CarOntrade.</span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;"> - Ngn nga cc hot ng ph hy ti khon Thnh vin ca Khch hng hoc cc hot ng gi mo Khch hng.</span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;"> - Lin lc v gii quyt vi Khch hng trong nhng trng hp c bit.</span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;"> - Khng s dng thng tin c nhn ca Khch hng ngoi mc ch xc nhn v lin h c lin quan n giao dch ti CarOntrade.</span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;"> - Chng ti c trch nhim hp tc cung cp thng tin c nhn Khch hng khi c yu cu t c quan nh nc c thm quyn.</span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<ol>\r\n	<li style="text-align: justify;" value="3"><s