arontrade.com</a>.</span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<ol>\r\n	<li style="text-align: justify;" value="5"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;"><strong>Phng tin v cng c  khch hng tip cn v chnh sa d liu ca mnh</strong></span></span></li>\r\n</ol>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;">Khch hng c quyn t kim tra, cp nht, iu chnh thng tin c nhn ca mnh bng cch ng nhp vo ti khon v chnh sa thng tin c nhn hoc yu cu CarOntrade thc hin vic ny.</span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;">Khch hng c quyn gi khiu ni v vic l thng tin c nhn cho bn th ba n a ch email <a href="mailto:bophankinhdoanh@carontrade.com">bophankinhdoanh@carontrade.com</a>  <a href="mailto:hotrokhachhang@carontrade.com">hotrokhachhang@carontrade.com</a>. Khi tip nhn nhng phn hi ny, chng ti s xc nhn li thng tin, phi c trch nhim tr li l do v hng dn Khch hng khi phc v bo mt li thng tin.</span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<ol>\r\n	<li style="text-align: justify;" value="6"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;"><strong>Cam kt bo mt thng tin c nhn khch hng</strong></span></span></li>\r\n</ol>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;">Thng tin c nhn ca Khch hng s c chng ti cam kt bo mt tuyt i theo chnh sch bo v thng tin c nhn ca CarOntrade, da trn iu 68 n iu 73, Mc 1 Bo v thng tin c nhn trong TMT (Chng V) quy nh ti Ngh nh 52/2013/N-CP.</span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;">CarOntrade cam kt khng s dng, khng chuyn giao, cung cp hay tit l cho bn th ba no v thng tin c nhn ca Khch hng khi khng c s cho php hoc ng  t khch hng, tr nhng trng hp php lut c quy nh khc.</span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;">Trong trng hp my ch lu tr thng tin b hacker tn cng dn n mt mt d liu c nhn Khch hng, CarOntrade s c trch nhim thng bo v vic cho c quan chc nng iu tra x l kp thi v thng bo cho khch hng c bit.</span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;"><strong>VII. Bo v quyn li ca ngi tiu dng</strong></span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;">Ban qun l Sn giao dch TMT CarOntrade.com yu cu cc c nhn khi ng k ti khon Thnh vin, phi cung cp y  thng tin c nhn c lin quan v chu trch nhim v tnh php l ca nhng thng tin trn. Ban qun l khng chu trch nhim cng nh khng gii quyt mi khiu ni c lin quan n quyn li ca Thnh vin  nu xt thy tt c thng tin c nhn ca Thnh vin  cung cp khi ng k ban u l khng chnh xc.</span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;">Thnh vin c quyn gi phn nh/khiu ni trc tip n Ban qun l trong trng hp sn phm dch v do Sn giao dch TMT CarOntrade.com cung cp khng ng nh cc thng tin  cng b trc .</span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;">Sn giao dch TMT CarOntrade.com lun m bo quyn li hp php cho Thnh vin cng nh ngi dng. Ban qun l c trch nhim gii quyt cc phn nh/khiu ni t Thnh vin, ngi dng mt cch tho ng v c li nht cho c hai bn.</span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;"><strong>VIII. Qun l thng tin xu</strong></span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<ol>\r\n	<li style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;"><strong>Quy nh thnh vin</strong></span></span></li>\r\n</ol>\r\n\r\n<p style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;"></span></span></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;">Nhm nng cao uy tn cng nh s thun li trong qu trnh thng lng v giao dch gia ngi mua v ngi bn, CarOntrade xin c a ra quy nh v tin ng bn cho c nhn/i l nhm trnh b t chi khi ng tin, ng thi kim duyt  tin cy ca ngi bn, rt ngn thi gian kim duyt tin ng. CarOntrade s khng can thip vo qu trnh thng lng v giao dch gia ngi mua v ngi bn. Mt khi ngi dng ng tin bn c ngha l ngi dng  c v ng  vi quy nh v ng tin ca Sn giao dch TMT CarOntrade.com. Nu ngi dng vi phm qu 3 ln th CarOntrade s kho ti khon 2 tun ng thi g ht tt c cc tin ang c ng hin ti  cnh co cng nh bo v nhng ngi dng khc.</span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;"> Trng hp ngi dng pht hin tin ng vi phm, vui lng gi ng link tin ng qua a ch email: hotrokhachhang@carontrade.com.</span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;"><strong>1.a. i tng ng tin</strong></span></span></p>\r\n\r\n<p style="text-align: 