style="font-size:16px;"><span style="font-family:times new roman,times,serif;">- Hnh b li khng c hin th.</span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;"><strong>CarOntrade khuyn khch ngi ng tin nn ng hnh nh c chp theo ch dn di y: </strong></span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;">- Pha trc v pha sau xe.</span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;">- Hai bn hng xe.</span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;">- Hnh bnh xe bao gm lp xe v mm xe.</span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;">- Ni tht xe.</span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;">- Hp s ca xe th hin r rng s kilomet  i c t trc n nay, s kilomet c chp trong hnh v c ghi trong ni dung tin ng ch c chch lch nhiu nht l 10%.</span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;"><strong>1.b.4. Ni dung tin ng </strong></span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;">- Ni dung cn c: Miu t tn xe, hng xe, xut x, mu sc, tnh trng s dng, s km  i, nm ng k, hp s, loi nhin liu, giy t xe,</span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;">- Ni dung ng ch lin quan n vic bn sn phm xe hi, ngoi ra khng c ng vi mc ch khc.</span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;">- Ni dung ng khng c c nhng thng tin mang tnh cht qung co nh s in thoi, logo hay website ca cng ty khc.</span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;">- Ni dung ng khng c c nhng t ng v vn ho, v d: nhng t chi th. Khng c c nhng t ng mua bn thiu chuyn nghip nh: "cn bn", "thanh l", "siu r", "siu hot", "rt p", "bn gp", "tt nht", "hng u", "r nht", hoc nhng t c  ngha tng t.</span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;">- Cc tin ng c ni dung, hnh nh mang tnh xc phm lin quan n tn gio, cc nhm sc tc, c nhn hoc ngi ni ting b cm.</span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;">- Mt bi ng tin ch ng mt sn phm xe duy nht, nu ngi bn c mong mun bn nhiu sn phm xe, vui lng ng tng bi ring bit. Nhng tin ng trng lp s b t chi.</span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;">- Theo iu 8 mc 11 ca Lut Qung co, khng c s dng cc t ng nht, duy nht, tt nht, s mt hoc t ng c  ngha tng t trong ni dung tin ng (nu s dng phi c ti liu chng minh).</span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;"><strong>1.b.5. Gi c </strong></span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;">- Ngi bn cn phi a ra c gi bn hp l, gi phi ng so vi th trng xe hi Vit Nam, khng c bn ph gi.</span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;">- Gi bn phi c nim yt bng gi Vit Nam ng (VN), cc tin ng gi ngoi t s khng c chp thun.</span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;">- Gi bn hp l s tng c hi tip cn c ngi mua.</span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;"><strong>1.b.6. Ngn ng </strong></span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;">- CarOntrade ch s dng ngn ng Ting Vit c du</span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;">- Nhng ngn ng c ni dung kh hiu, k hiu l hoc phng ch l khng r rng, CarOntrade s t chi ng tin.</span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;">Thnh vin s t chu trch nhim v bo mt v lu gi mi hot ng s dng dch v di tn ng k, mt khu ca mnh. Thnh vin c trch nhim thng bo kp thi cho Sn giao dch TMT CarOntrade.com v nhng hnh vi s dng tri php, lm dng, vi phm bo mt, lu gi tn ng k v mt khu ca bn th ba  c bin php gii quyt ph hp.</span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;">Thnh vin khng s dng dch v ca Sn giao dch TMT CarOntrade.com vo nhng mc ch bt hp php, khng hp l, la o, e do, thm d thng tin bt hp php, ph hoi, to ra v pht tn virus gy h hi ti h thng, cu hnh, truyn ti thng tin ca Sn giao dch TMT CarOntrade.com hay s dng dch v ca mnh vo mc ch u c, lng on th trng. Trong trng hp vi phm th Thnh vin phi chu trch nhim v cc hnh vi ca mnh trc php lut.</span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;">Thnh vin khng c thay i, chnh sa, gn gp, copy, truyn b, phn phi, cung cp v to nhng cng c tng t ca dch v do Sn giao dch TMT CarOntrade.com cung cp cho mt bn th ba nu khng c s ng  ca Sn giao dch TMT CarOntrade.com trong bn Quy ch ny.</span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;">Thnh vin khng c hnh ng gy mt uy tn ca Sn giao dch TMT CarOntrade.com di mi hnh thc nh gy mt on kt gia cc Thnh vin bng cch s dng tn ng k th hai, thng qua mt bn th ba hoc tuyn truyn, ph bin nhng thng tin khng c li cho uy tn ca Sn giao dch TMT CarOntrade.com.</span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<ol>\r\n	<li style="text-align: justify;" value="2"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;"><strong>Danh sch sn phm cm giao dch v giao dch c iu kin ti Sn giao dch TMT CarOntrade.com</strong></span></span></li>\r\n</ol>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;"> - Qung co thiu thm m, tri vi truyn thng lch s, vn ha, o c, thun phong m tc Vit Nam.</span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;"> - Qung co xc phm uy tn, danh d, nhn phm ca t chc, c nhn.</span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;"> - Qung co c s dng hnh nh, li ni, ch vit ca c nhn khi cha c c nhn  ng , tr trng hp c php lut cho php.</span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;"> - Qung co khng ng hoc gy nhm ln v kh nng kinh doanh, kh nng cung cp sn phm, hng ha, dch v ca t chc, c nhn kinh doanh sn phm, hng ha, dch v; v s lng, cht lng, gi, cng dng, kiu dng, bao b, nhn hiu, xut x, chng loi, phng thc phc v, thi hn bo hnh ca sn phm, hng ho, dch v  ng k hoc  c cng b.</span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;"> - Qung co bng vic s dng phng php so snh trc tip v gi c, cht lng, hiu qu s dng sn phm, hng ha, dch v ca mnh vi gi c, cht lng, hiu qu s dng sn phm, hng ha, dch v cng loi ca t chc, c nhn khc.</span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;"> - Qung co c ni dung cnh tranh khng lnh mnh theo quy nh ca php lut v cnh tranh.</span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;"> - Qung co vi phm php lut v s hu tr tu.</span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;"> - Sng sn v n sng sn, v kh th thao, cng c h tr.</span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;"> - Thuc l iu, x g v cc dng thuc l thnh phm khc;</span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;"> - Ru cc loi;</span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;"> - Thc vt, ng vt hoang d qu him, bao gm c vt sng v cc b phn ca chng  c ch bin;</span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;"> - Cc hng ha hn ch kinh doanh khc theo quy nh ca php lut.</span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<ol>\r\n	<li style="text-align: justify;" value="3"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;"><strong>C ch r sot, kim sot thng tin v sn phm/dch v ca Ban qun l Sn giao dch TMT CarOntrade.com i vi sn phm/dch v ng ti trn website</strong></span></span></li>\r\n</ol>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;">Ngay khi ngi dng ng tin bn sn phm ln Sn giao dch TMT CarOntrade.com, ni dung thng tin bi ng s c chuyn thng vo b phn kim duyt v i c duyt, kim tra cht ch  chc chn rng ngi dng khng vi phm n cc quy nh v tin ng bn ca CarOntrade. Tin ng s c hin th ngay khi c b phn qun tr duyt thnh cng.</span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;">Cc thng tin c nhn, ni dung tin ng bn, hnh nh hay nhng thng tin c cung cp t Thnh vin, s c chuyn qua b phn kim duyt ca Sn giao dch TMT CarOntrade.com kim tra v duyt trc khi cho hin th ln Sn.</span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;">Trng hp cc thng tin, ni dung tin ng bn c cung cp t Thnh vin khng ng vi quy nh ca Sn giao dch TMT CarOntrade.com  a ra, b phn kim duyt s t chi tin ng  v gi email yu cu Thnh vin chnh sa nhng thng tin, ni dung khng chnh xc.</span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;"><strong>IX.Trch nhim trong trng hp pht sinh li k thut</strong></span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;">Sn giao dch TMT CarOntrade.com cam kt n lc m bo s an ton v n nh ca ton b h thng k thut. Tuy nhin, trong trng hp xy ra s c do li ca CarOntrade, chng ti s ngay lp tc p dng cc bin php  m bo quyn li cho Thnh vin v ngi dng.</span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;">Khi thc hin cc giao dch trn Sn, bt buc cc Thnh vin phi thc hin ng theo cc quy trnh hng dn.</span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;">Ban qun l Sn giao dch TMT CarOntrade.com cam kt cung cp cht lng dch v tt nht cho cc Thnh vin tham gia giao dch. Trng hp pht sinh li k thut, li phn mm hoc cc li khch quan khc dn n Thnh vin/ngi dng khng th xem sn phm, ng tin, tm kim hay nhng hot ng lin quan trn Sn, th cc Thnh vin/ngi dng thng bo cho Ban qun l Sn giao dch TMT CarOntrade.com qua a ch email: <a href="mailto:bophankinhdoanh@carontrade.com">bophankinhdoanh@carontrade.com</a>  <a href="mailto:hotrokhachhang@carontrade.com">hotrokhachhang@carontrade.com</a>  c chng ti khc phc li trong thi gian sm nht, to iu kin cho cc Thnh vin cng nh ngi dng tham gia Sn giao dch TMT CarOntrade.com</span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;">Tuy nhin, Ban qun l Sn giao dch TMT CarOntrade.com s khng chu trch nhim gii quyt trong trng hp thng bo ca cc Thnh vin khng n c Ban qun l, pht sinh t li k thut, li ng truyn, phn mm hoc cc li khc khng do Ban qun l gy ra.</span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;"><strong>X.Quyn v ngha v ca Ban qun l website TMT CarOntrade.com</strong></span></span></p>\r\n\r\n<ol>\r\n	<li style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;"><strong>Quyn ca Ban qun l Sn giao dch/website TMT CarOntrade.com</strong></span></span></li>\r\n</ol>\r\n\r\n<p style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;"></span></span></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;">  Sn giao dch TMT CarOntrade.com s tin hnh cung cp cc dch v cho nhng thnh vin tham gia sau khi  hon thnh cc th tc v cc iu kin bt buc Sn giao dch TMT CarOntrade.com a ra.</span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;"> Trong trng hp c c s  chng minh thnh vin cung cp thng tin cho Sn giao dch TMT CarOntrade.com khng chnh xc, sai lch, khng y  hoc vi phm php lut hay thun phong m tc Vit Nam th Sn giao dch TMT CarOntrade.com c quyn t chi, tm ngng hoc chm dt quyn s dng dch v ca thnh vin.</span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;"> Sn giao dch TMT CarOntrade.com c th chm dt quyn thnh vin v quyn s dng dch v c cung cp t CarOntrade. Thnh vin s c thng bo trong thi hn t nht l mt (01) thng trong trng hp thnh vin vi phm cc quy nh ca Sn giao dch TMT CarOntrade.com hoc c nhng hnh vi la o, lm nh hng n hot ng mua bn trn Sn giao dch TMT CarOntrade.com.</span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;"> Sn giao dch TMT CarOntrade.com gi bn quyn s dng dch v v cc ni dung trn Sn giao dch TMT CarOntrade.com theo cc quy nh php lut v bo h s hu tr tu ti Vit Nam. Tt c cc biu tng, ni dung theo cc ngn ng khc nhau u thuc quyn s hu ca Sn giao dch TMT CarOntrade.com. Nghim cm mi hnh vi sao chp, s dng v ph bin bt hp php cc quyn s hu trn.</span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;"> Sn giao dch TMT CarOntrade.com gi quyn c thay i bng, biu gi dch v v phng thc thanh ton trong thi gian cung cp dch v cho thnh vin theo nhu cu v iu kin kh nng ca Sn giao dch TMT CarOntrade.com v s bo trc tip n thnh vin trong thi hn l mt (01) thng.</span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<ol>\r\n	<li style="text-align: justify;" value="2"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;"><strong>Ngha v v trch nhim ca Ban qun l Sn giao dch/website CarOntrade.com</strong></span></span></li>\r\n</ol>\r\n\r\n<p style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;">ng k thit lp website cung cp dch v sn giao dch thng mi in t theo quy nh ti Mc 2 Chng IV Ngh nh 52/2013/N-CP v cng b cc thng tin  ng k trn trang ch website.</span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;">Xy dng v cng b cng khai trn website quy ch hot ng ca sn giao dch thng mi in t theo quy nh ti iu 38 Ngh nh 52/2013/N-CP; theo di v bo m vic thc hin quy ch  trn sn giao dch thng mi in t.</span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;">Yu cu thng nhn, t chc, c nhn l ngi bn trn sn giao dch thng mi in t cung cp cc thng tin theo quy nh ti Khon 1, Khon 2 v Khon 3 iu 29 Ngh nh s 52/2013/N-CP khi ng k s dng dch v l Thng nhn, t chc, c nhn s hu website thng mi in t bn hng phi cng b nhng thng tin ti thiu sau trn trang ch website: Tn v a ch tr s ca thng nhn, t chc hoc tn v a ch thng tr ca c nhn. S, ngy cp v ni cp giy chng nhn ng k kinh doanh ca thng nhn, hoc s, ngy cp v n v cp quyt nh thnh lp ca t chc, hoc m s thu c nhn ca c nhn. S in thoi hoc mt phng thc lin h trc tuyn khc.</span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;">C c ch kim tra, gim st  m bo vic cung cp thng tin ca ngi bn trn sn giao dch thng mi in t c thc hin chnh xc, y .</span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;">Lu tr thng tin ng k ca cc thng nhn, t chc, c nhn tham gia sn giao dch thng mi in t v thng xuyn cp nht nhng thng tin thay i, b sung c lin quan.</span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;">Thit lp c ch cho php thng nhn, t chc, c nhn tham gia sn giao dch thng mi in t thc hin c quy trnh giao kt hp ng theo quy nh ti Mc 2 Chng II Ngh nh 52/2013/N-CP nu website c chc nng t hng trc tuyn.</span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;">p dng cc bin php cn thit  m bo an ton thng tin lin quan n b mt kinh doanh ca thng nhn, t chc, c nhn v thng tin c nhn ca ngi tiu dng.</span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;">C bin php x l kp thi khi pht hin hoc nhn c phn nh v hnh vi kinh doanh vi phm php lut trn sn giao dch thng mi in t.</span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;">H tr c quan qun l nh nc iu tra cc hnh vi kinh doanh vi phm php lut, cung cp thng tin ng k, lch s giao dch v cc ti liu khc v i tng c hnh vi vi phm php lut trn sn giao dch thng mi in t.</span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;">Cng b cng khai c ch gii quyt cc tranh chp pht sinh trong qu trnh giao dch trn sn giao dch thng mi in t. Khi khch hng trn sn giao dch thng mi in t pht sinh mu thun vi ngi bn hoc b tn hi li ch hp php, phi cung cp cho khch hng thng tin v ngi bn, tch cc h tr khch hng bo v quyn v li ch hp php ca mnh. Theo quy nh ti iu 36 Ngh nh 52/2013/N-CP.</span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;">Sn giao dch TMT CarOntrade.com c trch nhim ngn chn v loi b khi website nhng thng tin bn hng ha, dch v thuc danh mc hng ha, dch v cm kinh doanh theo quy nh ca php lut v hng ha hn ch kinh doanh theo quy nh ti Khon 1 iu 3 Thng t 47/2014/TT-BCT l Thng nhn, t chc, c nhn khng c s dng website thng mi in t  kinh doanh cc hng ha hn ch kinh doanh sau: a) Sng sn v n sng sn, v kh th thao, cng c h tr; b) Thuc l iu, x g v cc dng thuc l thnh phm khc; c) Ru cc loi; d) Thc vt, ng vt hoang d qu him, bao gm c vt sng v cc b phn ca chng  c ch bin; ) Cc hng ha hn ch kinh doanh khc theo quy nh ca php lut. Thng nhn thit lp website  bn cc hng ha, dch v thuc danh mc hng ha, dch v kinh doanh c iu kin cp Giy chng nhn  iu kin kinh doanh phi cng b trn website s, ngy cp v ni cp Giy chng nhn  iu kin kinh doanh i vi hng ha, dch v .</span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;">Loi b khi website nhng thng tin bn hng gi, hng nhi, hng nhp lu, hng vi phm quyn s hu tr tu v cc hng ha, dch v vi phm php lut khc khi pht hin hoc nhn c phn nh c cn c xc thc v nhng thng tin ny.</span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;">Sn giao dch TMT CarOntrade.com chu trch nghim xy dng chnh sch, pht trin v bo tr Website  phc v cho hot ng giao dch ca cc thnh vin trong iu kin v phm vi cho php, bo v quyn li ca ngi tiu dng. Sn giao dch TMT CarOntrade.com s tin hnh trin khai v hp tc vi cc i tc trong vic xy dng h thng cc dch v, cc cng c tin ch phc v cho vic giao dch ca cc thnh vin tham gia v ngi s dng trn Sn giao dch TMT CarOntrade.com.</span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;">Loi b khi Sn giao dch TMT CarOntrade.com nhng i tng c  nh bun bn la o vi cc thnh vin cng nh ngi dng khc, nhng i tng c hnh vi vi phm php lut khi pht hin hoc nhn c s phn nh c cn c xc thc v nhng thng tin ny.</span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;">Yu cu ngi bn cc hng ha, dch v thuc danh mc hng ha, dch v kinh doanh c iu kin trn Sn giao dch TMT CarOntrade.com phi cung cp Giy chng nhn  iu kin kinh doanh i vi hng ha, dch v  (trong trng hp php lut quy nh phi c Giy chng nhn  iu kin kinh doanh).</span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;">Sn giao dch TMT CarOntrade.com s c gng n mc cao nht trong phm vi v iu kin c th  duy tr hot ng bnh thng ca CarOntrade v khc phc cc s c nh: li h thng ng truyn internet, k thut v my mc, phn mm, nhn s, cc bin ng x hi, thin tai, mt in, cc quyt nh ca c quan nh nc hay mt t chc lin quan th ba. Tuy nhin nu nhng s c trn xy ra nm ngoi kh nng kim sot, l nhng trng hp bt kh khng m gy thit hi cho thnh vin th CarOntrade khng phi chu trch nhim lin i.</span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;"><strong>XI.Quyn v trch nhim thnh vin tham gia Sn giao dch/website CarOntrade.com</strong></span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<ol>\r\n	<li style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;"><strong>Quyn ca Thnh vin Sn giao dch/website TMT CarOntrade.com</strong></span></span></li>\r\n</ol>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;"> Khi ng k tr thnh thnh vin ca CarOntrade v c CarOntrade ng , thnh vin s c quyn ng tin bn sn phm ln trn Sn giao dch TMT CarOntrade.com.</span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;"> Thnh vin s c cp tn ng k da trn email c nhn ca mnh v mt khu ring  c vo s dng trong vic qun l nhng tin ng bn sn phm ca mnh, cng nh s dng dch v cung cp t Sn giao dch TMT CarOntrade.com.</span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;"> Thnh vin s c nhn vin CarOntrade hng dn cng nh h tr cch s dng cc cng c tin ch trn Sn giao dch TMT CarOntrade.com  phc v cho vic ng bn sn phm thnh vin.</span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;"> Thnh vin c quyn gp , nh gi cng nh phn hi cho CarOntrade v sn phm dch v t Sn giao dch TMT CarOntrade.com. Cc kin ngh c gi trc tip bng email, gi in thoi lin h n cho Sn giao dch TMT CarOntrade.com.</span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<ol>\r\n	<li style="text-align: justify;" value="2"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;"><strong>Ngha v ca Thnh vin Sn giao dch/website TMT CarOntrade.com</strong></span></span></li>\r\n</ol>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;"> Thng nhn, t chc, c nhn l ngi bn trn sn giao dch thng mi in t cung cp cc thng tin theo quy nh ti Khon 1, Khon 2 v Khon 3 iu 29 Ngh nh s 52/2013/N-CP khi ng k s dng dch v l Thng nhn, t chc, c nhn s hu website thng mi in t bn hng phi cng b nhng thng tin ti thiu sau trn trang ch website: Tn v a ch tr s ca thng nhn, t chc hoc tn v a ch thng tr ca c nhn. S, ngy cp v ni cp giy chng nhn ng k kinh doanh ca thng nhn, hoc s, ngy cp v n v cp quyt nh thnh lp ca t chc, hoc m s thu c nhn ca c nhn. S in thoi hoc mt phng thc lin h trc tuyn khc.</span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;"> Cung cp y  thng tin v hng ha, dch v theo quy nh t iu 30 n iu 34 Ngh nh 52/2013/N-CP khi bn hng ha hoc cung ng dch v trn sn giao dch thng mi in t l i vi hng ha, dch v c gii thiu trn website thng mi in t bn hng, thng nhn, t chc, c nhn phi cung cp nhng thng tin  khch hng c th xc nh chnh xc cc c tnh ca hng ha, dch v nhm trnh s hiu nhm khi quyt nh vic  ngh giao kt hp ng. Thng tin v gi hng ha hoc dch v, nu c, phi th hin r gi   bao gm hay cha bao gm nhng chi ph lin quan n vic mua hng ha hoc dch v nh thu, ph ng gi, ph vn chuyn v cc chi ph pht sinh khc. Tr trng hp cc bn c tha thun khc, nu thng tin gi hng ha hoc dch v nim yt trn website khng th hin r gi   bao gm hay cha bao gm nhng chi ph lin quan n vic mua hng ha hoc dch v nh thu, ph ng gi, ph vn chuyn v cc chi ph pht sinh khc th gi ny c hiu l  bao gm mi chi ph lin quan ni trn.</span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;"> Thng nhn, t chc, c nhn phi cng b nhng iu kin giao dch chung i vi hng ha hoc dch v gii thiu trn website, bao gm: a) Cc iu kin hoc hn ch trong vic cung cp hng ha hoc dch v, nh gii hn v thi gian hay phm vi a l, nu c; b) Chnh sch hon tr, bao gm thi hn hon tr, phng thc tr hoc i hng  mua, cch thc ly li tin, chi ph cho vic hon tr ny; c) Chnh sch bo hnh sn phm, nu c; d) Cc tiu chun dch v, quy trnh cung cp dch v, biu ph v cc iu khon khc lin quan n vic cung cp dch v, bao gm c nhng iu kin v hn ch nu c; ) Ngha v ca ngi bn v ngha v ca khch hng trong mi giao dch.</span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;"> Thng nhn, t chc, c nhn phi cng b nhng thng tin sau v iu kin vn chuyn v giao nhn p dng cho hng ha hoc dch v gii thiu trn website: a) Cc phng thc giao hng hoc cung ng dch v; b) Thi hn c tnh cho vic giao hng hoc cung ng dch v, c tnh n yu t khong cch a l v phng thc giao hng; c) Cc gii hn v mt a l cho vic giao hng hoc cung ng dch v, nu c. Trng hp pht sinh chm tr trong vic giao hng hoc cung ng dch v, thng nhn, t chc, c nhn phi c thng tin kp thi cho khch hng v to c hi  khch hng c th hy hp ng nu mun.</span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;"> Thng nhn, t chc, c nhn phi cng b ton b cc phng thc thanh ton p dng cho hng ha hoc dch v gii thiu trn website, km theo gii thch r rng, chnh xc  khch hng c th hiu v la chn phng thc thanh ton ph hp. Nu website thng mi in t c chc nng thanh ton trc tuyn, thng nhn, t chc, c nhn phi thit lp c ch  khch hng s dng chc nng ny c r sot v xc nhn thng tin chi tit v tng giao dch thanh ton trc khi thc hin vic thanh ton.</span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;"> Thnh vin s t chu trch nhim v bo mt v lu gi mi hot ng s dng dch v di tn ng k, mt khu v hp th in t ca mnh.</span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;"> Thnh vin c trch nhim thng bo kp thi cho CarOntrade v nhng hnh vi s dng tri php, lm dng, vi phm bo mt, php lut, lu gi tn ng k v mt khu ca mnh  hai bn cng hp tc x l.</span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;"> Thnh vin cam kt nhng thng tin cung cp cho Sn giao dch TMT CarOntrade.com v nhng thng tin ng v hng ha, dch v cung cp trn sn giao dch thng mi in t ti l chnh xc, trung thc.</span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;"> Thnh vin chu trch nhim v ni dung, hnh nh ca thng tin ng bn v cc thng tin khc cng nh ton b qu trnh giao dch vi ngi mua trn Sn giao dch TMT CarOntrade.com.</span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;"> Thnh vin l ngi bn v ngi mua, c trch nhim cung cp thng tin v giao dch, sn phm mua bn  h tr CarOntrade trong vic gii quyt tranh chp pht sinh gia ngi mua v ngi bn din ra trn Sn giao dch TMT CarOntrade.com.</span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;"> Thnh vin ngi bn c trch nhim bi thng thit hi cho ngi mua nu chng minh c li  thuc v ngi bn.</span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;"> Thnh vin c trch nhim cung cp thng tin v tnh hnh kinh doanh ca mnh khi c yu cu ca c quan nh nc c thm quyn  phc v hot ng thng k thng mi in t.</span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;"> Thnh vin c trch nhim Tun th quy nh ca php lut v thanh ton, qung co, khuyn mi, bo v quyn s hu tr tu, bo v quyn li ngi tiu dng v cc quy nh ca php lut c lin quan khc khi bn hng ha hoc cung ng dch v trn sn giao dch thng mi in t. Thc hin y  ngha v thu theo quy nh ca php lut.</span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;"> Thnh vin cam kt, ng  khng s dng dch v ca Sn giao dch TMT CarOntrade.com vo nhng mc ch bt hp php, khng hp l, la o, e do, thm r thng tin bt hp php, ph hoi, to ra v pht tn virus gy h hi n h thng, cu hnh, truyn ti thng tin ca Sn giao dch TMT CarOntrade.com hay s dng dch v ca mnh vo mc ch u c, lng on th trng, ng bn sn phm vi gi c bt hp l, bn ph gi. Trong trng hp vi phm th thnh vin phi chu trch nhim v cc hnh vi ca mnh trc php lut.</span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;"> Thnh vin cam kt khng c thay i, chnh sa, sao chp, truyn b, phn phi, cung cp v to nhng cng c tng t ca dch v do Sn giao dch TMT CarOntrade.com cung cp cho mt bn th ba nu khng c s ng  ca CarOntrade trong quy nh ny.</span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;"> Thnh vin khng c hnh ng gy mt uy tn ca Sn giao dch TMT CarOntrade.com di mi hnh thc nh gy mt on kt gia cc thnh vin bng cch s dng tn ng k th hai, thng qua mt bn th ba hoc tuyn truyn, ph bin thng tin khng c li cho uy tn ca Sn giao dch TMT CarOntrade.com.</span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;"><strong>XII.Quyn v trch nhim nh cung cp tham gia Sn giao dch/website CarOntrade.com</strong></span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<ol>\r\n	<li style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;"><strong>Quyn ca nh cung cp/i l i vi Sn giao dch/website TMT CarOntrade.com</strong></span></span></li>\r\n</ol>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;">Nh cung cp/i l sau khi k hp ng hp tc, cung cp sn phm dch v ln Sn giao dch TMT CarOntrade.com c quyn qung b, tip th sn phm dch v n vi Thnh vin/ngi dng ca Sn.</span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;">Nh cung cp/i l s c nhn vin CarOntrade hng dn m hnh cng nh cch thc  qung b, tip th sn phm dch v ca mnh ln Sn.</span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;">Nh cung cp/i l c quyn thng bo vi Sn giao dch TMT CarOntrade.com v vic thay i, chnh sa thng tin qung co sn phm dch v trong qu trnh qung b, tip th trn Sn n vi ngi dng.</span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;">Nh cung cp/i l c quyn gp , nh gi cng nh phn hi cho CarOntrade v sn phm dch v t Sn giao dch TMT CarOntrade.com. Cc kin ngh c gi trc tip bng email, gi in thoi lin h n cho Sn giao dch TMT CarOntrade.com.</span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<ol>\r\n	<li style="text-align: justify;" value="2"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;"><strong>Ngha v ca nh cung cp/i l i vi Sn giao dch/website TMT CarOntrade.com</strong></span></span></li>\r\n</ol>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;">Nh cung cp/i l s t chu trch nhim v bo mt v lu gi thng tin, cc hot ng ca cng ty trong qu trnh s dng dch v trn Sn giao dch TMT CarOntrade.com.</span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;">Nh cung cp c trch nhim thng bo kp thi cho CarOntrade v nhng hnh vi s dng tri php, lm dng, vi phm bo mt, php lut v sn phm dch v ca Nh cung cp/i l  hai bn cng hp tc x l.</span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;">Nh cung cp/i l cam kt nhng thng tin cung cp cho Sn giao dch TMT CarOntrade.com v nhng thng tin ng ti l chnh xc.</span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;">Nh cung cp/i l chu trch nhim v ni dung, hnh nh ca thng tin qung b v cc thng tin khc cng nh ton b qu trnh hp tc vi Sn giao dch TMT CarOntrade.com.</span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;">Nh cung cp/i l c trch nhim cung cp thng tin v giao dch, sn phm dch v cung cp cho Thnh vin/ngi dng  h tr CarOntrade trong vic gii quyt tranh chp pht sinh gia nh cung cp/i l v thnh vin/ngi dung din ra trn Sn giao dch TMT CarOntrade.com.</span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;">Nh cung cp/i l c trch nhim bi thng thit hi cho Thnh vin/ngi dng nu chng minh c li  thuc v nh cung cp.</span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;">Nh cung cp/i l cam kt, ng  khng s dng dch v ca Sn giao dch TMT CarOntrade.com vo nhng mc ch bt hp php, khng hp l, la o, e do, thm r thng tin bt hp php, ph hoi, to ra v pht tn virus gy h hi n h thng, cu hnh, truyn ti thng tin ca Sn giao dch TMT CarOntrade.com hay s dng dch v ca mnh vo mc ch u c, lng on th trng, ng bn sn phm vi gi c bt hp l, bn ph gi. Trong trng hp vi phm th Nh cung cp/i l phi chu trch nhim v cc hnh vi ca mnh trc php lut.</span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;">Nh cung cp/i l cam kt khng c thay i, chnh sa, sao chp, truyn b, phn phi, cung cp v to nhng cng c tng t ca dch v do Sn giao dch TMT CarOntrade.com cung cp cho mt bn th ba nu khng c s ng  ca CarOntrade trong quy nh ny.</span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;">Nh cung cp/i l khng c hnh ng gy mt uy tn ca Sn giao dch TMT CarOntrade.com di mi hnh thc nh gy mt on kt gia cc thnh vin bng cch s dng tn ng k th hai, thng qua mt bn th ba hoc tuyn truyn, ph bin thng tin khng c li cho uy tn ca Sn giao dch TMT CarOntrade.com.</span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;"><strong>XIII.iu khon p dng</strong></span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;">Quy ch ca Sn giao dch TMT CarOntrade.com chnh thc c hiu lc thi hnh k t ngy k Quyt nh ban hnh km theo Quy ch ny. Sn giao dch TMT CarOntrade.com c quyn v c th thay i Quy ch ny m khng cn thng bo ln Sn giao dch TMT CarOntrade.com, cc Thnh vin c trch nhim tham kho li Quy ch  cp nht thm thng tin quy nh mi t Sn. Quy ch sa i c hiu lc k t ngy Quyt nh v vic sa i Quy ch c hiu lc. Vic thnh vin tip tc s dng dch v sau khi Quy ch sa i c cng b v thc thi ng ngha vi vic thnh vin  chp nhn Quy ch sa i ny.</span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;">Quy ch hot ng s c Sn giao dch TMT CarOntrade.com cp nht b sung lin tc m khng cn thng bo trc. Thnh vin khi tham gia Sn giao dch TMT CarOntrade.com c trch nhim c qua v tun theo quy ch hin hnh khi giao dch trn Sn. Sn giao dch TMT CarOntrade.com s hiu rng khi cc Thnh vin tin hnh vic s dng sn phm dch v ca chng ti, ng ngha vi vic cc Thnh vin  c v ng  tun theo quy ch hot ng ca Sn giao dch TMT CarOntrade.com.</span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;"><strong>XIV.iu khon cam kt</strong></span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;">Mi thnh vin khi s dng dch v trn Sn giao dch TMT CarOntrade.com ng ngha vic  chp thun tun theo quy ch ny.</span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;">Mi thc mc xin vui lng lin h vi Sn TMT CarOntrade.com theo thng tin di y  c gii p:</span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;">Sn giao dch TMT CarOntrade.com</span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;"><strong> - Cng ty TNHH CarOntrade</strong></span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;"><strong> - a ch lin h: 190/92a Xm t, Phng 10, Qun 11, Thnh Ph H Ch Minh, Vit Nam</strong></span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;"><strong> - Hotline: 0126 4428 166</strong></span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;"><strong> - a ch email: </strong><a href="mailto:bophankinhdoanh@carontrade.com">bophankinhdoanh@carontrade.com</a>  <a href="mailto:hotrokhachhang@carontrade.com">hotrokhachhang@carontrade.com</a>.</span></span></p>\r\n', '', '', 1, 1, 1530074539, 1535546917, 'Quy Ch Hot ng', 'Quy Ch Hot ng ca Sn', 'Sn giao dch TMT CarOntrade.com cung cp cho ngi dng mt th trng mua bn xe hi trc tuyn c thc hin hot ng v vn hnh bi Cng ty TNHH CARONTRADE, trong  ngi dng s', '', '', '', 'ho-tro-khach-hang', 0, 0, 0, '', '', '');
