(29, 0, 1, 'Hng dn ng tin bn', 'huong-dan-dang-tin-ban', 'Sau khi ng nhp, ti trang ch bn c th nhp vo mc Bn xe ca ti trn thanh menu hoc ngay bn di gc tri hnh banner  truy cp vo trang ng tin.', '<p></p>\r\n\r\n<p><span style="font-family:times new roman,times,serif;"><span style="font-size:16px;"><strong>Di y l cc bc gip bn thc hin ng bn sn phm xe hi ca mnh.</strong></span></span></p>\r\n\r\n<p></p>\r\n\r\n<p><span style="font-family:times new roman,times,serif;"><span style="font-size:16px;"><strong>- Bc 1:</strong> <a href="http://carontrade.com/dang-nhap.html" target="_blank"><strong>ng nhp</strong></a> ti khon Thnh vin</span></span></p>\r\n\r\n<p></p>\r\n\r\n<p style="text-align:center"><img alt="" height="367" src="http://carontrade.com/upload/images/%C4%90%C4%83ng%20nh%E1%BA%ADp(1).png" width="321" /></p>\r\n\r\n<p></p>\r\n\r\n<p><span style="font-family:times new roman,times,serif;"><span style="font-size:16px;"><strong>- Bc 2:</strong> Vo trang ng tin sn phm xe hi.</span></span></p>\r\n\r\n<p></p>\r\n\r\n<p style="text-align:center"><img alt="" height="404" src="http://carontrade.com/upload/images/B%C3%A1n%20xe%20cuae%20toi%201.png" width="793" /></p>\r\n\r\n<p></p>\r\n\r\n<p style="text-align: justify;"><span style="font-family:times new roman,times,serif;"><span style="font-size:16px;">Sau khi ng nhp, ti trang ch bn c th nhp vo mc <a href="http://carontrade.com/dang-tin/chon-mau-xe" target="_blank"><strong>Bn xe ca ti</strong></a>trn thanh menu hoc ngay bn di gc tri hnh banner  truy cp vo trang ng tin.</span></span></p>\r\n\r\n<p></p>\r\n\r\n<p style="text-align:center"><img alt="" height="337" src="http://carontrade.com/upload/images/B%C3%A1n%20xe%20cuae%20toi%202.png" width="800" /></p>\r\n\r\n<p></p>\r\n\r\n<p><span style="font-family:times new roman,times,serif;"><span style="font-size:16px;">Ngoi ra bn c th nhp vo mc Bn xe ca ti ti trang Qun l Thnh vin  thc hin vic ng tin.</span></span></p>\r\n\r\n<p></p>\r\n\r\n<p><span style="font-family:times new roman,times,serif;"><span style="font-size:16px;"><strong>- Bc 3:</strong> in cc trng thng tin v sn phm xe hi ca bn.</span></span></p>\r\n\r\n<p></p>\r\n\r\n<p style="text-align:center"><img alt="" height="395" src="http://carontrade.com/upload/images/1(1).png" width="800" /></p>\r\n\r\n<p></p>\r\n\r\n<p><span style="font-family:times new roman,times,serif;"><span style="font-size:16px;">Ti mc <strong>Chn mu xe</strong>, cc trng <strong>Nh sn xut</strong>, <strong>Kiu dng</strong>, <strong>Mu xe</strong>, <strong>Nm</strong> l cc trng m bn bt buc phi nhp  m t chic xe hi ca mnh.</span></span></p>\r\n\r\n<p></p>\r\n\r\n<p style="text-align:center"><img alt="" height="414" src="http://carontrade.com/upload/images/2.png" width="800" /></p>\r\n\r\n<p></p>\r\n\r\n<p style="text-align: justify;"><span style="font-family:times new roman,times,serif;"><span style="font-size:16px;">Ti mc <strong>Chn tnh nng</strong>, bn hy nhp chnh xc cc trng thng tin v tnh nng, thng s k thut m xe ca bn hin ang c. y l cc trng <strong>bt buc</strong> phi c bn nhp th tin ca bn mi c ng.</span></span></p>\r\n\r\n<p></p>\r\n\r\n<p style="text-align:center"><img alt="" height="536" src="http://carontrade.com/upload/images/3.png" width="800" /></p>\r\n\r\n<p></p>\r\n\r\n<p style="text-align: justify;"><span style="font-family:times new roman,times,serif;"><span style="font-size:16px;"> mc <strong>M t chi tit</strong>, hy m t chic xe hi ca bn tht chi tit v thnh tht v y l phn quan trng m bn c th bit c tin ng ca bn c tht s thu ht ngi mua hay khng. CarOntrade khuyn khch bn nn nhp tiu  theo quy nh ca Sn. (Bn c th tham kho v <strong><a href="http://carontrade.com/quy-dinh-dang-tin.html" target="_blank">Quy nh ng tin</a></strong> ti y)</span></span></p>\r\n\r\n<p></p>\r\n\r\n<p style="text-align:center"><img alt="" height="466" src="http://carontrade.com/upload/images/4.png" width="800" /></p>\r\n\r\n<p></p>\r\n\r\n<p style="text-align: justify;"><span style="font-family:times new roman,times,serif;"><span style="font-size:16px;"> ng ti hnh nh, bn vui lng click vo nt <strong>Chn hnh nh</strong>  ti nh ln Sn, hoc bn c th ko hnh ca mnh t my tnh vo  <strong>Ko th hnh</strong>  ng ti.</span></span></p>\r\n\r\n<p></p>\r\n\r\n<p style="text-align:center"><img alt="" height="361" src="http://carontrade.com/upload/images/5.png" width="800" /></p>\r\n\r\n<p></p>\r\n\r\n<p style="text-align: justify;"><span style="font-family:times new roman,times,serif;"><span style="font-size:16px;">Sau khi hon tt nhp thng tin, bn vui lng xc nhn tnh thnh, qun huyn ni bn ang sng  ngi dng c th nh v c khu vc ni bn ng bn xe.</span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-family:times new roman,times,serif;"><span style="font-size:16px;"><strong>- Bc 4:</strong> Xc nhn tin ng hp l.</span></span></p>\r\n\r\n<p></p>\r\n\r\n<p style="text-align:center"><img alt="" height="310" src="http://carontrade.com/upload/images/th%C3%A0nh%20c%C3%B4ng.png" width="439" /></p>\r\n\r\n<p></p>\r\n\r\n<p style="text-align: justify;"><span style="font-family:times new roman,times,serif;"><span style="font-size:16px;">Khi ng tin thnh cng, h thng s bo tin ng ca bn ang ch c kim duyt.</span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align:center"><img alt="" height="235" src="http://carontrade.com/upload/images/123.png" width="600" /></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-family:times new roman,times,serif;"><span style="font-size:16px;">Nu ni dung tin ng ca bn c kim duyt l hp l, b phn kim duyt s cho hin th tin ng ln Sn v gi mail thng bo n a ch email  ng k ca bn.</span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-family:times new roman,times,serif;"><span style="font-size:16px;"><b>Cc tnh nng khc</b></span></span></p>\r\n\r\n<p></p>\r\n\r\n<p style="text-align:center"><img alt="" height="158" src="http://carontrade.com/upload/images/6(1).png" width="482" /></p>\r\n\r\n<p></p>\r\n\r\n<p style="text-align: justify;"><span style="font-family:times new roman,times,serif;"><span style="font-size:16px;">Bn pha trn gc phi giao din trang ng tin, nu bn mun lu li tin ng khi cha kp hon thnh hoc xo tin ng , vui lng nhp vo nt <strong>Lu li v hon tt sau</strong> hoc <strong>Hu b</strong>.</span></span></p>\r\n\r\n<p></p>\r\n\r\n<p style="text-align:center"><img alt="" height="282" src="http://carontrade.com/upload/images/L%C6%B0u.png" width="428" /></p>\r\n\r\n<p></p>\r\n\r\n<p><span style="font-family:times new roman,times,serif;"><span style="font-size:16px;">Khi nhn nt <strong>lu li v hon tt sau</strong>, h thng s bo bn  lu thnh cng.</span></span></p>\r\n\r\n<p></p>\r\n\r\n<p style="text-align:center"><img alt="" height="276" src="http://carontrade.com/upload/images/Xo%C3%A1%20hu%E1%BB%B7.png" width="432" /></p>\r\n\r\n<p></p>\r\n\r\n<p><span style="font-family:times new roman,times,serif;"><span style="font-size:16px;">Sau khi hu b, h thng s bo bn  xo thnh cng.</span></span></p>\r\n\r\n<p></p>\r\n\r\n<p style="text-align:center"><img alt="" height="298" src="http://carontrade.com/upload/images/7.png" width="712" /></p>\r\n\r\n<p></p>\r\n\r\n<p><span style="font-family:times new roman,times,serif;"><span style="font-size:16px;">Trong qu trnh nhp thng tin, bn c th nhn nt <strong>Quay li</strong>  xem cc thng tin  in trc , hoc nt <strong>Tip theo</strong>  nhp cc thng tin cn thiu.</span></span></p>\r\n\r\n<p></p>\r\n\r\n<p style="text-align:center"><img alt="" height="303" src="http://carontrade.com/upload/images/L%E1%BB%97i.png" width="425" /></p>\r\n\r\n<p></p>\r\n\r\n<p><span style="font-family:times new roman,times,serif;"><span style="font-size:16px;">Bn phi in ht tt c thng tin  vic ng tin c hon tt, h thng thng bo li nu mt trong cc thng tin yu cu vn cha c nhp.</span></span></p>\r\n\r\n<p></p>\r\n\r\n<p style="text-align: center;"><em><span style="font-family:times new roman,times,serif;"><span style="font-size:16px;">Chc mng bn  ng tin bn thnh cng!</span></span></em></p>\r\n\r\n<p></p>\r\n', '', '', 3, 1, 1530004545, 1535288205, 'Hng Dn ng Tin Bn', 'Hng dn ng tin bn', 'Sau khi ng nhp, ti trang ch bn c th nhp vo mc Bn xe ca ti trn thanh menu hoc ngay bn di gc tri hnh banner  truy cp vo trang ng tin.', '', '', '', 'tro-giup-nguoi-dung', 0, 0, 0, '', '', ''),
(34, 0, 1, 'Cu hi thng gp', 'cau-hoi-thuong-gap', '1. Lm th no nu mu xe ng bn ca ti khng c thng tin trn Sn trong mc ng tin bn?\r\n\r\n\r\nBn hy chn Nh sn xut, Kiu dng v Mu xe l Hng khc. Khi , CarOntrade s tra cu v cp nht thng tin xe ca bn ln Sn. CarOntrade s chnh sa thng tin mu xe ca bn v email thng bo cho bn bit v s thay i ny.', '<p dir="ltr" style="line-height: 1.38; margin-top: 0pt; margin-bottom: 0pt; text-align: justify;"></p>\r\n\r\n<p dir="ltr" style="line-height: 1.38; margin-top: 0pt; margin-bottom: 0pt; text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;"><strong><span id="docs-internal-guid-e45cb583-7fff-84f9-1681-0fafef894c99"><span style="color: rgb(0, 0, 0); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;">1. Lm th no nu mu xe ng bn ca ti khng c thng tin trn Sn trong mc ng tin bn?</span></span></strong></span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p dir="ltr" style="line-height: 1.38; margin-top: 0pt; margin-bottom: 0pt; text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;"><span id="docs-internal-guid-e45cb583-7fff-84f9-1681-0fafef894c99"><span style="color: rgb(0, 0, 0); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;">Bn hy chn <strong>Nh sn xut, Kiu dng v Mu xe</strong> l <strong>Hng khc</strong>. Khi , CarOntrade s tra cu v cp nht thng tin xe ca bn ln Sn. CarOntrade s chnh sa thng tin mu xe ca bn v email thng bo cho bn bit v s thay i ny.</span></span></span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p dir="ltr" style="line-height: 1.38; margin-top: 0pt; margin-bottom: 0pt; text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;"><strong><span id="docs-internal-guid-e45cb583-7fff-84f9-1681-0fafef894c99"><span style="color: rgb(0, 0, 0); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;">2. Ti sao ti khng nhn c email kch hot ti khon hay cc email thng bo khc?</span></span></strong></span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p dir="ltr" style="line-height: 1.38; margin-top: 0pt; margin-bottom: 0pt; text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;"><span id="docs-internal-guid-e45cb583-7fff-84f9-1681-0fafef894c99"><span style="color: rgb(0, 0, 0); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;">Rt c th email kch hot ti khon hay cc email thng bo khc ang nm trong mc Spam  hp th ca bn. Xin bn hy kim tra hp th Spam v <strong><a href="http://carontrade.com/lien-he.html">lin h</a></strong> vi CarOntrade nu bn vn khng nhn c email thng bo.</span></span></span></span></p>\r\n\r\n<p dir="ltr" style="line-height: 1.38; margin-top: 0pt; margin-bottom: 0pt; text-align: justify;"></p>\r\n\r\n<p dir="ltr" style="line-height: 1.38; margin-top: 0pt; margin-bottom: 0pt; text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;"><strong><span id="docs-internal-guid-e45cb583-7fff-84f9-1681-0fafef894c99"><span style="color: rgb(0, 0, 0); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;">3. Ti sao ti khng th nh gi website hay ngi bn c?</span></span></strong></span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p dir="ltr" style="line-height: 1.38; margin-top: 0pt; margin-bottom: 0pt; text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;"><span id="docs-internal-guid-e45cb583-7fff-84f9-1681-0fafef894c99"><span style="color: rgb(0, 0, 0); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;">Bn hy <strong>ng nhp</strong> thnh vin  c th nh gi CarOntrade hay ngi bn nh. Nu bn cha c ti khon th bn c th ng k <strong><a href="http://carontrade.com/dang-ky.html">ti y</a></strong>.</span></span></span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p dir="ltr" style="line-height: 1.38; margin-top: 0pt; margin-bottom: 0pt; text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;"><strong><span id="docs-internal-guid-e45cb583-7fff-84f9-1681-0fafef894c99"><span style="color: rgb(0, 0, 0); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;">4. Ti sao tin ng ca ti b t chi? </span></span></strong></span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p dir="ltr" style="line-height: 1.38; margin-top: 0pt; margin-bottom: 0pt; text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;"><span id="docs-internal-guid-e45cb583-7fff-84f9-1681-0fafef894c99"><span style="color: rgb(0, 0, 0); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;">CarOntrade s email v cho bn bit l do v sao tin ca bn b t chi.  tin khng b t chi v tit kim thi gian ch tin c duyt, xin bn vui lng c qua <strong><a href="http://carontrade.com/quy-dinh-dang-tin.html">Quy nh ng tin</a></strong> nh.</span></span></span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p dir="ltr" style="line-height: 1.38; margin-top: 0pt; margin-bottom: 0pt; text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;"><strong><span id="docs-internal-guid-e45cb583-7fff-84f9-1681-0fafef894c99"><span style="color: rgb(0, 0, 0); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;">5. Cc i l trn Sn c tht s ng tin khng?</span></span></strong></span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p dir="ltr" style="line-height: 1.38; margin-top: 0pt; margin-bottom: 0pt; text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;"><span id="docs-internal-guid-e45cb583-7fff-84f9-1681-0fafef894c99"><span style="color: rgb(0, 0, 0); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;">n vi CarOntrade, bn c th yn tm v vic chn mua xe t cc i l, CarOntrade lun tra cu v kim duyt cht ch thng tin v s minh bch ca cc nh i l tham gia t Sn.</span></span></span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p dir="ltr" style="line-height: 1.38; margin-top: 0pt; margin-bottom: 0pt; text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;"><span id="docs-internal-guid-e45cb583-7fff-84f9-1681-0fafef894c99"><span style="color: rgb(0, 0, 0); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;">Ngoi ra, bn c th s dng <strong>tnh nng nh gi</strong> ngi bn ti <strong>thng tin ngi bn</strong>  phn hi v tri nghim ca mnh i vi h.</span></span></span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p dir="ltr" style="line-height: 1.38; margin-top: 0pt; margin-bottom: 0pt; text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;"><strong><span id="docs-internal-guid-e45cb583-7fff-84f9-1681-0fafef894c99"><span style="color: rgb(0, 0, 0); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;">6. Lm th no  ti nhn c phn hi t CarOntrade mt cch nhanh nht?</span></span></strong></span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p dir="ltr" style="line-height: 1.38; margin-top: 0pt; margin-bottom: 0pt; text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;"><span id="docs-internal-guid-e45cb583-7fff-84f9-1681-0fafef894c99"><span style="color: rgb(0, 0, 0); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;">Bn c th lin h vi CarOntrade <strong><a href="http://carontrade.com/lien-he.html">ti y</a></strong>  nhn c phn hi sm nht.</span></span></span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p dir="ltr" style="line-height: 1.38; margin-top: 0pt; margin-bottom: 0pt; text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;"><strong><span id="docs-internal-guid-e45cb583-7fff-84f9-1681-0fafef894c99"><span style="color: rgb(0, 0, 0); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;">7. Lm th no  bit tin ng ca ti  c duyt hay cha?</span></span></strong></span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p dir="ltr" style="line-height: 1.38; margin-top: 0pt; margin-bottom: 0pt; text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;"><span id="docs-internal-guid-e45cb583-7fff-84f9-1681-0fafef894c99"><span style="color: rgb(0, 0, 0); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;">CarOntrade s email thng bo n hp th ca bn khi tin ng c duyt.</span></span></span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p dir="ltr" style="line-height: 1.38; margin-top: 0pt; margin-bottom: 0pt; text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;"><strong><span id="docs-internal-guid-e45cb583-7fff-84f9-1681-0fafef894c99"><span style="color: rgb(0, 0, 0); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;">8. Qun mt khu th phi lm sao?</span></span></strong></span></span></p>\r\n\r\n<p dir="ltr" style="line-height: 1.38; margin-top: 0pt; margin-bottom: 0pt; text-align: justify;"></p>\r\n\r\n<p dir="ltr" style="line-height: 1.38; margin-top: 0pt; margin-bottom: 0pt; text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;"><span id="docs-internal-guid-e45cb583-7fff-84f9-1681-0fafef894c99"><span style="color: rgb(0, 0, 0); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;">Ti trang <strong>ng nhp</strong>, bn hy nhp vo nt <strong><a href="http://carontrade.com/quen-mat-khau.html">Bn qun mt khu?</a></strong> nm bn di  in mt khu. Tip tc vi thao tc in email ca bn v CarOntrade s cp cho bn mt khu mi v a ch email m bn cung cp.</span></span></span></span></p>\r\n\r\n<p dir="ltr" style="line-height: 1.38; margin-top: 0pt; margin-bottom: 0pt; text-align: justify;"></p>\r\n\r\n<p dir="ltr" style="line-height: 1.38; margin-top: 0pt; margin-bottom: 0pt; text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;"><strong><span id="docs-internal-guid-e45cb583-7fff-84f9-1681-0fafef894c99"><span style="color: rgb(0, 0, 0); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;">9. Lm th no  c th xo li nh gi ca ti n website hoc ngi bn?</span></span></strong></span></span></p>\r