(74, 0, 0, 'Yamaha Grand Filano Hybrid chnh thc ra mt vi ng c lai, phanh ABS, gi bn t 42,7 triu ng', 'yamaha-grand-filano-hybrid-chinh-thuc-ra-mat-voi-dong-co-lai-phanh-abs-gia-ban-tu-427-trieu-dong', 'Yamaha va chnh thc ra mt mu xe Grand Filano Hybrid ti Thi Lan vi thit k mi v trang b hng lot tin nghi cao cp dnh cho mt dng xe tay ga trong phn khc tm trung, mc gi bn t 42,7 triu ng. Mu xe tay ga dnh cho phi p Yamaha Grand Filano Hybrid cn c trang b ng c lai xng in (hybrid) hon ton mi.\r\n\r\n', '<div style="text-align:justify; font-size:14px; line-height:25px;">\r\n<p>Yamaha va chnh thc ra mt mu xe Grand Filano Hybrid ti Thi Lan vi thit k mi v trang b hng lot tin nghi cao cp dnh cho mt dng xe tay ga trong phn khc tm trung, mc gi bn t 42,7 triu ng. Mu xe tay ga dnh cho phi p Yamaha Grand Filano Hybrid cn c trang b ng c lai xng in (hybrid) hon ton mi.<br />\r\n</p>\r\n\r\n<p align="center"><img alt="Yamaha Grand Filano Hybrid chnh thc ra mt vi ng c lai, phanh ABS, gi bn t 42,7 triu ng" src="http://carontrade.com/upload/images/Yamaha-Grand%20Filano-Hybrid-ra-mat-tai-thai-la-1.jpg" /></p>\r\n\r\n<p align="center"></p>\r\n\r\n<h2 style="line-height:30px"><strong>Ngoi hnh trn Yamaha Grand Filano Hybrid</strong><br />\r\n</h2>\r\n\r\n<p>V ngoi hnh tng th, Yamaha Grand Filano Hybrid s hu phong cch n tnh ca mt dng xe tay ga. Cc ng nt cng mng phn v trn thn xe c thit k theo cm hng t mu concept Glorious.</p>\r\n\r\n<p align="center"><img alt="Yamaha Grand Filano Hybrid chnh thc ra mt vi ng c lai, phanh ABS, gi bn t 42,7 triu ng" src="http://carontrade.com/upload/images/Yamaha-Grand%20Filano-Hybrid-ra-mat-tai-thai-la-2.jpg" /><br />\r\n</p>\r\n\r\n<p>Grand Filano Hybrid c trang b cm n chnh s dng cng ngh n LED vi thit k 2 tng. n xi-nhan c lm gn hn so vi halogen. n demi s dng bng LED c trng c thit k  ym trc ngay pha di ca logo Yahama Motor.<br />\r\n</p>\r\n\r\n<p align="center"><img alt="Yamaha Grand Filano Hybrid chnh thc ra mt vi ng c lai, phanh ABS, gi bn t 42,7 triu ng" src="http://carontrade.com/upload/images/Yamaha-Grand%20Filano-Hybrid-ra-mat-tai-thai-la-3.jpg" /><br />\r\n</p>\r\n\r\n<p>V phn ui xe, cm n hu ca Grand Filano 2018 c hng lm gn v hi ha hn so vi tng th thit k, vi nhng ng nt c un cong kh p mt.</p>\r\n\r\n<p>L mt mu xe dnh cho phi p, Grand Filano Hybrid s hu kch thc cng vi trng lng tng i nh v nh cn. Xe c chiu di 1.820mm, rng 685mm, chiu cao 1.150mm, trc c s 1.280mm v chiu cao yn ch 790mm. Trng lng t ca mu xe Grand Filano 2018 t 102kg ti cu hnh "full option".<br />\r\n</p>\r\n\r\n<p align="center"><img alt="Yamaha Grand Filano Hybrid chnh thc ra mt vi ng c lai, phanh ABS, gi bn t 42,7 triu ng" src="http://carontrade.com/upload/images/Yamaha-Grand%20Filano-Hybrid-ra-mat-tai-thai-la-4.jpg" /><br />\r\n</p>\r\n\r\n<p>Grand Filano s hu b vnh c kch thc 12 inch, kt hp cng phanh trc dng phanh a, trong khi  phanh sau ca xe l phanh tang trng truyn thng.<br />\r\n</p>\r\n\r\n<p style="text-align:center"><img alt="Yamaha Grand Filano Hybrid chnh thc ra mt vi ng c lai, phanh ABS, gi bn t 42,7 triu ng" src="http://carontrade.com/upload/images/Yamaha-Grand%20Filano-Hybrid-ra-mat-tai-thai-la-5.jpg" /></p>\r\n\r\n<p><br />\r\nH thng treo ca Grand Filano vn l cp phuc ng lng pha trc xe v gim xc l xo tr n t  pha sau.<br />\r\n</p>\r\n\r\n<p align="center"><img alt="Yamaha Grand Filano Hybrid chnh thc ra mt vi ng c lai, phanh ABS, gi bn t 42,7 triu ng" src="http://carontrade.com/upload/images/Yamaha-Grand%20Filano-Hybrid-ra-mat-tai-thai-la-6.jpg" /></p>\r\n\r\n<p align="center"></p>\r\n\r\n<h2 style="line-height:30px"><strong>Trang b nhiu tnh nng hin i vi phin bn phanh ABS v kha thng minh Smart Key</strong><br />\r\n</h2>\r\n\r\n<p>Nhng im nhn d nhn ra nht ca Grand Filano l vic Yamaha  sn xut 2 phin bn vi 1 bn tiu chun s dng  kha c truyn thng v phin bn h tr phanh ABS s dng h thng kha thng minh khng dng cha Smart Key.<br />\r\n</p>\r\n\r\n<p align="center"><img alt="Yamaha Grand Filano Hybrid chnh thc ra mt vi ng c lai, phanh ABS, gi bn t 42,7 triu ng" src="http://carontrade.com/upload/images/Yamaha-Grand%20Filano-Hybrid-ra-mat-tai-thai-la-7.jpg" /><br />\r\n</p>\r\n\r\n<p>Chi tit hn, Grand Filano Hybrid phin bn cao cp c trang b y  cc tin nghi nh:  in 12V, h thng kha thng minh khng dng cha Smart Key v h thng dng ch SSS (Start/Stop System).<br />\r\n</p>\r\n\r\n<p align="center"><img alt="Yamaha Grand Filano Hybrid chnh thc ra mt vi ng c lai, phanh ABS, gi bn t 42,7 triu ng" src="http://carontrade.com/upload/images/Yamaha-Grand%20Filano-Hybrid-ra-mat-tai-thai-la-8.jpg" /><br />\r\n</p>\r\n\r\n<p> v tr  pha sau ym ca xe l hc cha  nh khng c np v ming bnh xng. V cp xe, Grabd Filano Hybrid c cp xe dung tch 27 lt, c Yamaha b tr mt n LED nh c kh nng soi hp cha , qua p gip ngi dng c th d dng tip cn  c trong cp xe vo bui ti.<br />\r\n</p>\r\n\r\n<p style="text-align:center"><img alt="Yamaha Grand Filano Hybrid chnh thc ra mt vi ng c lai, phanh ABS, gi bn t 42,7 triu ng" src="http://carontrade.com/upload/images/Yamaha-Grand%20Filano-Hybrid-ra-mat-tai-thai-la-9.jpg" /></p>\r\n\r\n<h2 style="line-height:30px"></h2>\r\n\r\n<h2 style="line-height:30px"><strong>ng h bo tc  trn xe c thit k kh p mt cng mn hnh mu c kch thc nh kh trc quan</strong><br />\r\n</h2>\r\n\r\n<p>Grand Filano Hybrid th h 2018 c trang b h thng ng h mu LCD TFT gip ngi dng theo di c tnh trang hot ng trong h thng Hybrid cng nh lng in c trong c quy.<br />\r\n</p>\r\n\r\n<p align="center"><img alt="Yamaha Grand Filano Hybrid chnh thc ra mt vi ng c lai, phanh ABS, gi bn t 42,7 triu ng" src="http://carontrade.com/upload/images/Yamaha-Grand%20Filano-Hybrid-ra-mat-tai-thai-la-10.jpg" /><br />\r\n</p>\r\n\r\n<p>Ngoi ra, cc tnh nng khc bao gm bo qung ng i, mc tiu th nhin liu trung bnh nh i trc.</p>\r\n\r\n<p></p>\r\n\r\n<h2 style="line-height:30px"><strong>H thng Hybrid,  c 4 k, xi-lanh n, SOHC v dung tch 124cc vi cng ngh Blue Core</strong><br />\r\n</h2>\r\n\r\n<p>Grand Filano 2018 c trang b khi ng c Blue Core 125cc kt vi h thng Hybrid bao gm ng c xng truyn thng, h thng phun xng in t EFI, m t in tch hp vo trong cc my xng.<br />\r\n</p>\r\n\r\n<p style="text-align:center"><img alt="Yamaha Grand Filano Hybrid chnh thc ra mt vi ng c lai, phanh ABS, gi bn t 42,7 triu ng" src="http://carontrade.com/upload/images/Yamaha-Grand%20Filano-Hybrid-ra-mat-tai-thai-la-11.jpg" /></p>\r\n\r\n<p><br />\r\nXe c vn hnh bi ng c in Smart Motor Generator thng qua h thng trung tm iu khin SGCU cung cp sc mnh ng gm cho xe, ng thi cng gip tit kim nhin liu trong nhng iu kin chy nht nh.<br />\r\n</p>\r\n\r\n<p align="center"><img alt="Yamaha Grand Filano Hybrid chnh thc ra mt vi ng c lai, phanh ABS, gi bn t 42,7 triu ng" src="http://carontrade.com/upload/images/Yamaha-Grand%20Filano-Hybrid-ra-mat-tai-thai-la-12.jpg" /><br />\r\n</p>\r\n\r\n<p>Yamaha cho bit, Grand Filano 2018 c trang b ng c 4 th SOHC, xi-lanh n, dung tch 124cc vi cng ngh Blue Core nhng khng cng b chi tit hiu nng. ng c hp s v cp CVT, cng nt bm khi ng Star-Stop vi trit l thit k ng c t chnh Yamaha  l Blue Core Efficiency.<br />\r\n</p>\r\n\r\n<p align="center"><img alt="Yamaha Grand Filano Hybrid chnh thc ra mt vi ng c lai, phanh ABS, gi bn t 42,7 triu ng" src="http://carontrade.com/upload/images/Yamaha-Grand%20Filano-Hybrid-ra-mat-tai-thai-la-13.jpg" /></p>\r\n\r\n<p align="center"></p>\r\n\r\n<h2 style="line-height:30px"><strong>Gi bn v mu sc cho 2 phin bn tiu chun v phin bn phanh ABS cao cp</strong><br />\r\n</h2>\r\n\r\n<p>Grand Filano Hybrid 2018 c gii thiu ti th trng Thi Lan vi nhiu s la chn v mu sc, v phin bn xe khng phanh ABS s c 5 mu sc, trong khi bn ABS c 2 mu cho bn la chn.</p>\r\n\r\n<p>V gi, th Yamaha cng b mc gi khi im cho Grand Filano Hybrid ch t 38,5 triu ng, v 42,9 triu ng cho phin bn c phanh ABS. Nhiu kh nng, mu xe Grand mi 2018 s c Yamaha phn phi chnh hng ti th trng Vit Nam trong thi gian ti.</p>\r\n</div>\r\n', 'yamaha-grand-filano-hybrid-ra-mat-tai-thai-la-2-7772.jpg', 'yamaha-grand-filano-hybrid-ra-mat-tai-thai-la-23990_170x128.jpg', 1, 0, 1533396675, 1533396798, 'Yamaha Grand Filano Hybrid chnh thc ra mt vi ng c lai, phanh ABS, gi bn t 42,7 triu ng', 'Grand Filano Hybrid 2018', 'Yamaha va chnh thc ra mt mu xe Grand Filano Hybrid ti Thi Lan vi thit k mi v trang b hng lot tin nghi cao cp dnh cho mt dng xe tay ga trong phn khc tm trung, mc gi bn t 42,7', '', '', '', 'tin-tuc', 0, 0, 0, '', '', '');
