(89, 0, 1, 'nh gi xe Ford Fiesta 2018: Mu xe c nh sang trng, nhiu tin nghi', 'danh-gia-xe-ford-fiesta-2018-mau-xe-co-nho-sang-trong-nhieu-tien-nghi', 'Nu bn ang c nhu cu chn mua mt chic xe  t c nh vi thit k p mt, kiu dng sang trng cng nhiu tnh nng hin i d s dng th mu xe Ford Fiesta 2018 l mt s la chn ng tin dnh cho nhng ai yu thch dng xe hi n t thng hiu M.\r\n\r\n', '<div style="text-align:justify; font-size:14px; line-height:25px;">\r\n<p></p>\r\n\r\n<p>Nu bn ang c nhu cu chn mua mt chic xe  t c nh vi thit k p mt, kiu dng sang trng cng nhiu tnh nng hin i d s dng th mu xe Ford Fiesta 2018 l mt s la chn ng tin dnh cho nhng ai yu thch dng xe hi n t thng hiu M.</p>\r\n\r\n<p></p>\r\n\r\n<p>Ni s qua v dng xe Fiesta, k t khi xut hin trn th trng vo nm 1976, th mu xe mang m cht chu u ny lun c ngi dng n nhn v ng trong TOP danh sch cc mu xe hi bn chy nht ca Ford ti Chu u trong 3 nm lin (2012 + 2013 + 2014) v  bn chy trong sut mt thi gian di ti th trng Anh.<br />\r\n</p>\r\n\r\n<p align="center"><img alt="danh-gia-Ford Fiesta-2018-" src="http://carontrade.com/upload/images/danh-gia-Ford%20Fiesta-2018-1.jpg" /><br />\r\n</p>\r\n\r\n<p>V mi y nht, dng Fiesta ny tip tc thng lnh bng xp hng danh sch cc dng xe t khch nht chu u thng 3/2017. V vy, khng c g ngc nhin khi hng Ford  u t mnh tay vo th h Ford Fiesta 2018 ny.<br />\r\n</p>\r\n\r\n<h2 style="line-height:30px"><strong>Ngoi tht xe Ford Fiesta 2018</strong><br />\r\n</h2>\r\n\r\n<p>Ford Fiesta 2018 c ngn ng thit k nng ng, hin i, l mt trong nhng mu xe i li hng ngy n nh. Phn u xe Ford Fiesta 2018 to n tng mnh m vi ngi dng khi thit k cm li tn nhit kiu dng hnh thang ngc, hc ht gi pha di cn trc xe cng c m chrome em n im nhn n tng cho u xe. H thng treo kh cng thanh cn bng c thit k  u xe v trc xon  pha sau ui xe.<br />\r\n</p>\r\n\r\n<p align="center"><img alt="danh-gia-Ford Fiesta-2018-" src="http://carontrade.com/upload/images/danh-gia-Ford%20Fiesta-2018-2.jpg" /><br />\r\n</p>\r\n\r\n<p>Xe c kch thc chi tit bao gm: 3968 mm x 1709 mm x 1468 mm kh trn bnh v gn gng vi thit k theo ngn ng One Ford quen thuc ca hng. Qua , xe c th linh hot hn trong qu trnh di chuyn  cc tuyn ph ng c hay trn ng x nh hp  cc con hm.<br />\r\n</p>\r\n\r\n<p align="center"><img alt="danh-gia-Ford Fiesta-2018-" src="http://carontrade.com/upload/images/danh-gia-Ford%20Fiesta-2018-3.jpg" /><br />\r\n</p>\r\n\r\n<p>Xe c cm n pha halogen, tch hp cm bin nh sng t ng bt khi tri ti. Khng nhng th, phn np ca-p trn xe s hu cc ng gn dp ni v dp chm an xem khi kt hp vi thn xe vi cc p v xe dp ni gip to nn cc hnh khi c bp, nam tnh mnh m cho xe. n sng m cng c b tr hi tht v sau.<br />\r\n</p>\r\n\r\n<p align="center"><img alt="danh-gia-Ford Fiesta-2018-" src="http://carontrade.com/upload/images/danh-gia-Ford%20Fiesta-2018-4.jpg" /><br />\r\n</p>\r\n\r\n<p>Ford Fiesta 2018 c trang b la-zng hp kim c kch thc 16 inch a chu, i km vi b lp c ng kch 195/50R16. Gng chiu hu trn xe cng c tch hp h thng n bo r.</p>\r\n\r\n<p></p>\r\n\r\n<p> pha sau ui xe Ford Fiesta 2018, c trang b loi n LED ngang c chiu rng ni bt hn.<br />\r\n</p>\r\n\r\n<h2 style="line-height:30px"><strong>Ni tht xe Ford Fiesta 2018 rng ri</strong><br />\r\n</h2>\r\n\r\n<p>Khng gian ni tht trong Fiesta c phong cch tr trung, khng gian rng ri, thoi mi vi kch thc cabin rng. Khoang ni tht ni bt vi mn hnh trung tm gii tr kch thc 8 inch tch hp cng ngh SYNC3. V lng 3 chu xe Fiesta 2018 mang hi hng th thao, c bc da kh sang trng kt hp vi cc ng vin m bc, tch hp nt iu khin ging ni, iu khin m thanh.</p>\r\n\r\n<p></p>\r\n\r\n<p align="center"><img alt="danh-gia-Ford Fiesta-2018-" src="http://carontrade.com/upload/images/danh-gia-Ford%20Fiesta-2018-5.jpg" /><br />\r\n</p>\r\n\r\n<p>Cm ng h analog cng mn hnh hin th a thng tin c thit k gn gng cng vi hai ng h ln c kh nng o thng s tc  vn hnh v tc  ng c xe. Chnh gia l ni kim o mc nhin liu cng vi mt mn hnh in t c kh nng cung cp thng tin hp s v nhit  cho ng c hin i.<br />\r\n</p>\r\n\r\n<p style="text-align:center"><img alt="" height="556" src="http://carontrade.com/upload/images/17-ford-fiesta-active-2018-review-instrument-cluster.jpg" width="840" /></p>\r\n\r\n<p align="center"><br />\r\n</p>\r\n\r\n<p>Trn phin bn Titanium c khoang ni tht c bc da sang trng, trong khi  trn phin bn Sport v Sport + li c bc da pha n, cc gh ngi thit k c phn th thao hn v m lng ngi ngi hn v ci thin  rng gip ngi ngi lun thoi mi.<br />\r\n</p>\r\n\r\n<p align="center"><img alt="danh-gia-Ford Fiesta-2018-" src="http://carontrade.com/upload/images/danh-gia-Ford%20Fiesta-2018-7.jpg" /><br />\r\n</p>\r\n\r\n<p>Hng gh trc trn c 3 phin bn cng u c trang b chnh tay 4 hng, khi hng gh sau ngi ngi c th gp theo t l 60:40. Qua , gip m rng khng gian hnh l hn trong cc chuyn mua sm hay khi ch cc vt dng c chiu di ln.<br />\r\n</p>\r\n\r\n<p align="center"><img alt="danh-gia-Ford Fiesta-2018-" src="http://carontrade.com/upload/images/danh-gia-Ford%20Fiesta-2018-8.jpg" /><br />\r\n</p>\r\n\r\n<h2 style="line-height:30px"><strong>H thng tin nghi trn xe</strong><br />\r\n</h2>\r\n\r\n<p>Ford Fiesta 2018 c trang b h thng m thanh gii tr vi CD 1 a c th pht c AM/FM, tch hp hu ht cc cng kt ni v kt ni khng dy hin i nht hin nay nh: AUX/USB/Bluetooth.<br />\r\n</p>\r\n\r\n<p align="center"><img alt="danh-gia-Ford Fiesta-2018-" src="http://carontrade.com/upload/images/danh-gia-Ford%20Fiesta-2018-9.jpg" /><br />\r\n</p>\r\n\r\n<p>Ngoi ra, h thng kt ni SYNC ca Microsoft trn Ford Fiesta 2018 gip h tr cho vic iu khin ging ni. i km cng vi h thng gii tr  l h thng m thanh 4 loa trc v 2 loa sau mang li cht lng gii tr ti u nht.</p>\r\n\r\n<p></p>\r\n\r\n<p>Ngoi ra, h thng iu ha trn xe cho php iu khin trc tip qua mn hnh in t hin i gip cho hi lnh phn b ng u khp xe.<br />\r\n</p>\r\n\r\n<p align="center"><img alt="danh-gia-Ford Fiesta-2018-" src="http://carontrade.com/upload/images/danh-gia-Ford%20Fiesta-2018-10.jpg" /><br />\r\n</p>\r\n\r\n<h2 style="line-height:30px"><strong>H thng an ton v kh nng vn hnh</strong><br />\r\n</h2>\r\n\r\n<p>Ford Fiesta 2018 cung cp n cho ngi dng nhiu tnh nng an ton gip h tr ti a cho ngi li bao gm: h thng li tr lc in EPAS gip ti u cho  nng ca v lng trong mt s iu kin vn hnh khc nhau, h thng iu khin hnh trnh thch ng, h thng cnh bo sai ln ng, h thng camera 360 , n pha t ng, h thng pht hin ngi qua ng, h thng pht hin im m.<br />\r\n</p>\r\n\r\n<p align="center"><img alt="danh-gia-Ford Fiesta-2018-" src="http://carontrade.com/upload/images/danh-gia-Ford%20Fiesta-2018-11.jpg" /><br />\r\n</p>\r\n\r\n<p>Ngoi ra, Ford Fiesta 2018 cn c 7 ti kh v h thng ai an ton t cng sm v t ng ni lng cho hng gh li.</p>\r\n\r\n<p></p>\r\n\r\n<p>V kh nng vn hnh, Ford Fiesta 2018 c trang b cu hnh vn hnh kh mnh m trong phn khc. Vi hai phin bn ng c Fiesta 1.5L Titanium v Fiesta 1.5L Sport, u trang b ng c xng 1.5L Ti-VCT Duratec 4 xy lanh thng hng 16 van cng vi cng ngh phun xng in t a im gip cho cng sut ti a t 110 m lc ti 6300 vng/pht v m-men xon cc i t 140Nm ti 4400 vng/pht. Ford Fiesta c trang b phanh trc dng a cng vi phanh sau dng tang trng.<br />\r\n</p>\r\n\r\n<p align="center"><img alt="danh-gia-Ford Fiesta-2018-" src="http://carontrade.com/upload/images/danh-gia-Ford%20Fiesta-2018-12.jpg" /><br />\r\n</p>\r\n\r\n<p>Xe trang b hp s t ng 6 cp ly hp kp Powershift c kh nng ti u kh lng nng lng nhin liu tiu th.<br />\r\n</p>\r\n\r\n<p align="center"><img alt="danh-gia-Ford Fiesta-2018-" src="http://carontrade.com/upload/images/danh-gia-Ford%20Fiesta-2018-13.jpg" /><br />\r\n</p>\r\n\r\n<p>Theo nh gi, trong iu kin vn hnh hn hp, xe tiu th 5,8 lt cho qung ng 100km.<br />\r\n</p>\r\n\r\n<p align="center"><img alt="danh-gia-Ford Fiesta-2018-" src="http://carontrade.com/upload/images/danh-gia-Ford%20Fiesta-2018-14.jpg" /><br />\r\n</p>\r\n\r\n<p>Ford Fiesta 2018 l mu xe ph hp vi nhng ai ang c nhu cu chn mua mt mu xe phc v cho nhu cu di chuyn trong thnh ph, nhng chuyn i chi xa.<br />\r\n</p>\r\n</div>\r\n', 'danh-gia-ford-fiesta-2018-2-0055.jpg', 'danh-gia-ford-fiesta-2018-21756_170x113.jpg', 1, 1, 1534436007, 1534476080, 'nh gi xe Ford Fiesta 2018: Mu xe c nh sang trng, nhiu tin nghi', 'nh gi xe Ford Fiesta 2018', 'Nu bn ang c nhu cu chn mua mt chic xe  t c nh vi thit k p mt, kiu dng sang trng cng nhiu tnh nng hin i d s dng th mu xe Ford Fiesta 2018 l mt s la chn ng tin d', '', '', '', 'danh-gia', 0, 0, 0, '', '', ''),
(91, 0, 1, 'nh gi chi tit xe Chevrolet Orlando 2018: Mu xe chy dch v hon ho trong thnh ph', 'danh-gia-chi-tiet-xe-chevrolet-orlando-2018-mau-xe-chay-dich-vu-hoan-hao-trong-thanh-pho', 'Bn ang c nhu cu chn mua mt mu xe sedan hng trung c gi bn cnh tranh, c mc tiu hao nhin liu thp, khoang ni tht rng ri  phc v cho nhu cu chy dch v, Grab trong thnh ph, th mu xe Chevrolet Orlando 2018 l s la chn tuyt vi. Hy cng CarOntrade nh gi chi tit mu xe Chevrolet Orlando phin bn 2018 trong bi vit di y nh!\r\n\r\n', '<div style="text-align:justify; font-size:14px; line-height:25px;">\r\n<p></p>\r\n\r\n<p>Bn ang c nhu cu chn mua mt mu xe sedan hng trung c gi bn cnh tranh, c mc tiu hao nhin liu thp, khoang ni tht rng ri  phc v cho nhu cu chy dch v, Grab trong thnh ph, th mu xe Chevrolet Orlando 2018 l s la chn tuyt vi. Hy cng<strong>CarOntrade</strong>nh gi chi tit mu xe Chevrolet Orlando phin bn 2018 trong bi vit di y nh!<br />\r\n</p>\r\n\r\n<p align="center"><img alt="nh gi chi tit xe Chevrolet Orlando 2018" src="http://carontrade.com/upload/images/danh-gia-Chevrolet-Orlando-2018-1.jpg" /><br />\r\n</p>\r\n\r\n<h2 style="line-height:30px"><strong>Ngoi tht</strong><br />\r\n</h2>\r\n\r\n<p>Chevrolet Orlando 2018 s hu nhng kiu dng sang trng v hin i vi nhiu chi tit ng vin c m c rm sng bng cng vi nhng ng nt c phn tinh t hn trc. Mu xe Chevrolet Orlando 2018 7 ch phin bn ci tin mi vi ngoi tht s hu n pha halogen c ln. B sung gng chiu hu c kh nng gp in v iu chnh in, tch hp cng n bo r dng LED kt hp vi chc nng sy mt gng.<br />\r\n</p>\r\n\r\n<p align="center"><img alt="nh gi chi tit xe Chevrolet Orlando 2018" src="http://carontrade.com/upload/images/danh-gia-Chevrolet-Orlando-2018-2.jpg" /><br />\r\n</p>\r\n\r\n<p>ng thi, n sng m cng n Halo<u>g</u>en c ln gip cho kh nng chiu sng ca xe  nhng chng ng di tr nn n tng, v lm cho u xe tr nn mnh m hn. <br />\r\n</p>\r\n\r\n<p align="center"><img alt="nh gi chi tit xe Chevrolet Orlando 2018" src="http://carontrade.com/upload/images/danh-gia-Chevrolet-Orlando-2018-3.jpg" /><br />\r\n</p>\r\n\r\n<p>Hai im nhn cng kh n tng khc  l ca s tri c th chnh in cng vi vnh hp kim ng kch 17 inch s hu kiu thit k mi. Tay nm ca c m c rm, phn ui xe Orlando 2018 c cm n hu kiu thit k li, n bo phanh nm trn cn sau.<br />\r\n</p>\r\n\r\n<p align="center"><img alt="nh gi chi tit xe Chevrolet Orlando 2018" src="http://carontrade.com/upload/images/danh-gia-Chevrolet-Orlando-2018-4.jpg" /><br />\r\n</p>\r\n\r\n<p>Xt v cc thng s khc, Orlando 2018 c bn knh quay vng n 5.55 mt gip cho xe c kh nng chy v xoay s  cc mt ng hp tr nn d dng hn.<br />\r\n</p>\r\n\r\n<p align="center"><img alt="nh gi chi tit xe Chevrolet Orlando 2018" src="http://carontrade.com/upload/images/danh-gia-Chevrolet-Orlando-2018-5.jpg" /><br />\r\n</p>\r\n\r\n<h2 style="line-height:30px"><strong>Khng gian ni tht</strong><br />\r\n</h2>\r\n\r\n<p>Chevrolet Orlando 2018 c khng gian ni tht kh rng ri, thoi mi mt cch ti a nht cho ngi ngi trn xe.<br />\r\n</p>\r\n\r\n<p align="center"><img alt="nh gi chi tit xe Chevrolet Orlando 2018" src="http://carontrade.com/upload/images/danh-gia-Chevrolet-Orlando-2018-6.jpg" /><br />\r\n</p>\r\n\r\n<p>Chi tit hn, ni tht vi bung li kp c ly cm hng t dng cc xe Corvette. Gh ngi c cht liu da mang n cm gic m i cho hnh khch v ti x.<br />\r\n</p>\r\n\r\n<p align="center"><img alt="nh gi chi tit xe Chevrolet Orlando 2018" src="http://carontrade.com/upload/images/danh-gia-Chevrolet-Orlando-2018-7.jpg" /><br />\r\n</p>\r\n\r\n<p>Trong khi , hng gh li chnh in, v-lng c kh nng tr lc in, c tch hp cc phm bm iu chnh m thanh.<br />\r\n</p>\r\n\r\n<p align="center"><img alt="nh gi chi tit xe Chevrolet Orlando 2018" src="http://carontrade.com/upload/images/danh-gia-Chevrolet-Orlando-2018-8.jpg" /><br />\r\n</p>\r\n\r\n<p>Hng gh th 2 v th 3 cn c khong  chn rng v c th gp li  tng khng gian gip cho nhng chuyn i xa tr nn d dng hn, cng nh c th sp xp  vali nhiu hn dung tch ca cp xe.<br />\r\n</p>\r\n\r\n<p align="center"><img alt="nh gi chi tit xe Chevrolet Orlando 2018" src="http://carontrade.com/upload/images/danh-gia-Chevrolet-Orlando-2018-9.jpg" /><br />\r\n</p>\r\n\r\n<h2 style="line-height:30px"><strong>Tin nghi</strong><br />\r\n</h2>\r\n\r\n<p>V h thng gii tr a phng tin cng nh s tin nghi th mu xe Chevrolet Orlando 2018 ang c ngi dng nh gi kh cao v h thng m thanh cng gii tr n tng, mang li s tin ch ti a cho ngi dng.<br />\r\n</p>\r\n\r\n<p align="center"><img alt="nh gi chi tit xe Chevrolet Orlando 2018" src="http://carontrade.com/upload/images/danh-gia-Chevrolet-Orlando-2018-10.jpg" /><br />\r\n</p>\r\n\r\n<p>Chevrolet Orlando 2018 c trang b h thng gii tr vi h thng m thanh 6 loa, nghe nhc qua u CD, MP3, cc cng kt ni USB/AUX, nghe radio AM/FM.<br />\r\n</p>\r\n\r\n<p align="center"><img alt="nh gi chi tit xe Chevrolet Orlando 2018" src="http://carontrade.com/upload/images/danh-gia-Chevrolet-Orlando-2018-11.jpg" /><br />\r\n</p>\r\n\r\n<p>Khng nhng th, cn c cc tin ch khc bao gm nh: tnh nng gt nc ma knh trc vi cm bin t ng, h thng iu ha thng minh t ng, khi ng bng nt bm v cha kha thng minh, ging chiu hu ca xe c kh nng chng chi, sy gng, ca s tri chnh in.<br />\r\n</p>\r\n\r\n<p align="center"><img alt="nh gi chi tit xe Chevrolet Orlando 2018" src="http://carontrade.com/upload/images/danh-gia-Chevrolet-Orlando-2018-12.jpg" /><br />\r\n</p>\r\n\r\n<h2 style="line-height:30px"><strong>Cc tnh nng an ton</strong><br />\r\n</h2>\r\n\r\n<p>Chevrolet Orlando 2018 s hu cc tnh nng an ton bao gm h thng 2 ti kh pha trc, 2 ti kh bn hng gip m bo an ton ti a cho ngi ti x v hnh khch.<br />\r\n</p>\r\n\r\n<p align="center"><img alt="nh gi chi tit xe Chevrolet Orlando 2018" src="http://carontrade.com/upload/images/danh-gia-Chevrolet-Orlando-2018-13.jpg" /><br />\r\n</p>\r\n\r\n<p>Cc trang b an ton bao gm: H thng chng b cng phanh ABS, cn bng in t ESP, h thng chng trt, dy ai an ton 3 im, tnh nng kha ca t ng khi xe ang di chuyn, cnh bo li, tnh nng kha ca an ton cho tr em.<br />\r\n</p>\r\n\r\n<p align="center"><img alt="nh gi chi tit xe Chevrolet Orlando 2018" src="http://carontrade.com/upload/images/danh-gia-Chevrolet-Orlando-2018-14.jpg" /><br />\r\n</p>\r\n\r\n<h2 style="line-height:30px"><strong>Kh nng vn hnh</strong><br />\r\n</h2>\r\n\r\n<p>Chevrolet Orlando 2018 s dng khi ng c EcoTec dung tch 1796cc, ng c DOHC, sn sinh cng sut ti a 140 m lc ti 6.200 vng/pht v m-men xon cc i  176 Nm ti 3.800 vng/pht. ng c kt hp cng b hp s t ng 6 cp. Xe cng cn c h tr ch  li th thao.<br />\r\n</p>\r\n\r\n<p align="center"><img alt="nh gi chi tit xe Chevrolet Orlando 2018" src="http://carontrade.com/upload/images/danh-gia-Chevrolet-Orlando-2018-15.jpg" /><br />\r\n</p>\r\n\r\n<p>Vi khong sng gm cao, cng vi bn knh vng quay  mc n, gip cho Chevrolet Orlando 2018 vn hnh linh hot hn trong nhng iu kin ng s g gh, di chuyn trong thnh ph d dng hn. Xe c mc tiu hao nhin liu n tng vi 9.0 lt cho qung ng 100km.</p>\r\n</div>\r\n', 'danh-gia-chevrolet-orlando-2018-1-4445.jpg', 'danh-gia-chevrolet-orlando-2018-19662_170x96.jpg', 1, 1, 1535020075, 1535098606, 'nh gi chi tit xe Chevrolet Orlando 2018: Mu xe chy dch v hon ho trong thnh ph', 'Chevrolet Orlando 2018', 'Bn ang c nhu cu chn mua mt mu xe sedan hng trung c gi bn cnh tranh, c mc tiu hao nhin liu thp, khoang ni tht rng ri  phc v cho nhu cu chy dch v, Grab trong thnh ph, th', '', '', '', 'danh-gia', 0, 0, 0, '', '', ''),
(92, 0, 1, 'nh gi chi tit Mitsubishi Xpander 2018 gi bn t 550 triu', 'danh-gia-chi-tiet-mitsubishi-xpander-2018-gia-ban-tu-550-trieu', 'Mi y, Mitsubishi  chnh thc ra mt mu xe 7 ch thuc phn khc gi r mi mang tn Xpander 2018. Mu xe ny c hng gii thiu ti Vit Nam vi 2 phin bn s sn v s t ng, gi bn d kin ln lt l 550 v 650 triu ng. S hu thit k p mt, sang trng, khi ng c n 1,5L cng mc gi rt cnh tranh, Mitsubishi Xpander 2018 c kh nng p ng y  mi nhu cu ca ngi dng ti Vit Nam hay khng?\r\n\r\n\r\n\r\n', '<div style="text-align:justify; font-size:14px; line-height:25px;">\r\n<p><br />\r\nMi y, Mitsubishi  chnh thc ra mt mu xe 7 ch thuc phn khc gi r mi mang tn Xpander 2018. Mu xe ny c hng gii thiu ti Vit Nam vi 2 phin bn s sn v s t ng, gi bn d kin ln lt l 550 v 650 triu ng.<br />\r\n</p>\r\n\r\n<p align="center"><img alt="nh gi chi tit Mitsubishi Xpander 2018 gi bn t 550 triu" src="http://carontrade.com/upload/images/danh-gia-xe-Mitsubishi-Xpander-2018-1.jpg" /><br />\r\n</p>\r\n\r\n<p>S hu thit k p mt, sang trng, khi ng c n 1,5L cng mc gi rt cnh tranh, Mitsubishi Xpander 2018 c kh nng p ng y  mi nhu cu ca ngi dng ti Vit Nam hay khng?<br />\r\n</p>\r\n\r\n<p align="center"><img alt="nh gi chi tit Mitsubishi Xpander 2018 gi bn t 550 triu" src="http://carontrade.com/upload/images/danh-gia-xe-Mitsubishi-Xpander-2018-2.jpg" /><br />\r\n</p>\r\n\r\n<h2 style="line-height:30px"><strong>Ngoi tht</strong><br />\r\n</h2>\r\n\r\n<p>Mitsubishi Xpander 2018 s hu ngn ng thit k Dynamic Shield vi ngoi hnh khe khn, sang trng v mnh m. Kiu thit k ny c da trn nn tng concept XM, theo ui xu hng lai gia 2 mu Crossover v MPV, hay cn gi l MPV gm cao.<br />\r\n</p>\r\n\r\n<p align="center"><img alt="nh gi chi tit Mitsubishi Xpander 2018 gi bn t 550 triu" src="http://carontrade.com/upload/images/danh-gia-xe-Mitsubishi-Xpander-2018-3.jpg" /><br />\r\n</p>\r\n\r\n<p>Li tn nhit ca xe c hnh ch X kch thc ln  phn u xe, n pha ca xe c thit k rt sc so. Xe c kch thc tng th bao gm: chiu di  chiu cao t 4.475 x 1.750mm.<br />\r\n</p>\r\n\r\n<p align="center"><img alt="nh gi chi tit Mitsubishi Xpander 2018 gi bn t 550 triu" src="http://carontrade.com/upload/images/danh-gia-xe-Mitsubishi-Xpander-2018-4.jpg" /><br />\r\n</p>\r\n\r\n<p>Cc chi tit khc ca xe  phn hng v ui xe cng s hu nhng nt mnh m v c tnh vi nhiu ng gn kim loi dp ni sc cnh. Xe c b mm hp kim 5 chu kp ng knh 16 inch trng kh p mt, gng chiu hu tch hp n xi nhan bo r. Ngoi ra, cc chi tit nh tay nm ca, vin knh c m chrome sng bng gip tng tnh thm m ca xe.<br />\r\n</p>\r\n\r\n<p align="center"><img alt="nh gi chi tit Mitsubishi Xpander 2018 gi bn t 550 triu" src="http://carontrade.com/upload/images/danh-gia-xe-Mitsubishi-Xpander-2018-5.jpg" /><br />\r\n</p>\r\n\r\n<p>ng thi, xe cn c trang b cm n pha, n bo r  2 hc ring bit v 2 bng sng m trn xe cng c thit k  p cn trc. Li thit k mi m ny gip cho Xpander 2018 to nn s khc bit so vi phn cn li.<br />\r\n</p>\r\n\r\n<p align="center"><img alt="nh gi chi tit Mitsubishi Xpander 2018 gi bn t 550 triu" src="http://carontrade.com/upload/images/danh-gia-xe-Mitsubishi-Xpander-2018-6.jpg" /><br />\r\n</p>\r\n\r\n<h2 style="line-height:30px"><strong>Ni tht</strong><br />\r\n</h2>\r\n\r\n<p>Ngoi tht ca xe Mitsubishi Xpander 2018 c ly cm hng t mu Outlander, vi cm tay li v-lng 3 chu tch hp hp cc nt iu khin chc nng, nt bm khi ng. iu ha c th chnh tay c trang b 2 gin lnh.<br />\r\n</p>\r\n\r\n<p align="center"><img alt="nh gi chi tit Mitsubishi Xpander 2018 gi bn t 550 triu" src="http://carontrade.com/upload/images/danh-gia-xe-Mitsubishi-Xpander-2018-7.jpg" /><br />\r\n</p>\r\n\r\n<p>Mn hnh trung tm 2-DIN ca xe kch thc kh n 6,2 inch. Gh li bn s t ng chnh c 6 hng, bn s sn ch 4 hng.<br />\r\n</p>\r\n\r\n<p align="center"><img alt="nh gi chi tit Mitsubishi Xpander 2018 gi bn t 550 triu" src="http://carontrade.com/upload/images/danh-gia-xe-Mitsubishi-Xpander-2018-8.jpg" /><br />\r\n</p>\r\n\r\n<p>V tr gh ti x v gh hnh khch trc cng c Mitsubishi thit k kh m lng. ng thi, hng gh gia v th ba c trang b 2 ta u gip cho ngi dng ngi trong xe thoi mi hn.<br />\r\n</p>\r\n\r\n<p align="center"><img alt="nh gi chi tit Mitsubishi Xpander 2018 gi bn t 550 triu" src="http://carontrade.com/upload/images/danh-gia-xe-Mitsubishi-Xpander-2018-9.jpg" /><br />\r\n</p>\r\n\r\n<p>Khng gian gia hng gh u v hng gh gia c khong cch va  vn m bo thoi mi cho hnh khch c chiu cao hn 175cm , hng gh th 3 c kh nng gp 50/10 v gia l 40/60 qua  gip cho khng gian cha  rng ri hn khi cn thit.<br />\r\n</p>\r\n\r\n<p align="center"><img alt="nh gi chi tit Mitsubishi Xpander 2018 gi bn t 550 triu" src="http://carontrade.com/upload/images/danh-gia-xe-Mitsubishi-Xpander-2018-10.jpg" /><br />\r\n</p>\r\n\r\n<h2 style="line-height:30px"><strong>Trang b tin nghi trn xe</strong><br />\r\n</h2>\r\n\r\n<p>Xe c ti 16 khay ng chai l ti khu vc ca v  cm cn s, h thng iu ha khng kh t ng 2 vng c lp, mn hnh cm ng trung tm, kt ni USB/Bluetooth.<br />\r\n</p>\r\n\r\n<p align="center"><img alt="nh gi chi tit Mitsubishi Xpander 2018 gi bn t 550 triu" src="http://carontrade.com/upload/images/danh-gia-xe-Mitsubishi-Xpander-2018-11.jpg" /><br />\r\n</p>\r\n\r\n<p>Hn th na, Xpander 2018 cng s dng loi knh c kh nng cch m tt cng vi mt lp dn c kh nng hp th m thanh b sung  gip cho cabin trong xe yn tnh hn.<br />\r\n</p>\r\n\r\n<p align="center"><img alt="nh gi chi tit Mitsubishi Xpander 2018 gi bn t 550 triu" src="http://carontrade.com/upload/images/danh-gia-xe-Mitsubishi-Xpander-2018-12.jpg" /><br />\r\n</p>\r\n\r\n<p>Ngoi ra, h thng thng tin gii tr ca Mitsubishi Xpander 2018 s hu mn hnh cm ng 2DIN kt hp vi h thng nh v v tinh GPS, u m thanh c iu khin trn cc nt v lng ca xe.<br />\r\n</p>\r\n\r\n<h2 style="line-height:30px"><strong>H thng an ton v kh nng vn hnh ca xe</strong><br />\r\n</h2>\r\n\r\n<p>Mitsubishi Xpander 2018 s hu nhiu cng ngh an ton em n cho ngi dng cm gic li an ton hn nh: h thng chng b cng phanh ABS, EBD, h thng h tr lc phanh, 2 ti kh, h tr khi hnh ngang dc, h thng cn bng in t, kim sot n nh thn xe, camera li.<br />\r\n</p>\r\n\r\n<p align="center"><img alt="nh gi chi tit Mitsubishi Xpander 2018 gi bn t 550 triu" src="http://carontrade.com/upload/images/danh-gia-xe-Mitsubishi-Xpander-2018-13(1).jpg" /><br />\r\n</p>\r\n\r\n<p>Chi tit hn v kh nng an ton ca xe. Theo chng trnh nh gi  t mi dnh cho cc nc ng Nam  (ASEAN NCAP) da trn cc th nghim va chm ca mu xe Mitsubishi Xpander 2018. Kt qu cho thy, Xpander  t c tng im 71,66 im. Trong , chi tit bao gm 39,08 im dnh cho kh nng bo v ngi ln (chun AOP); 18,69 im dnh cho kh nng bo v tr em (chun COP) v cui cng l 13,89 im cho cng ngh h tr an ton (SAT). Vi tng s im trn l   Xpander c th t chun nh gi an ton ca 4 sao ca ASEAN NCAP.<br />\r\n</p>\r\n\r\n<p align="center"><img alt="nh gi chi tit Mitsubishi Xpander 2018 gi bn t 550 triu" src="http://carontrade.com/upload/images/danh-gia-xe-Mitsubishi-Xpander-2018-14(1).jpg" /><br />\r\n</p>\r\n\r\n<p>V ng c v kh nng vn hnh th xe s dng khi ng c MIVEC dung tch 1.5L, 4 xy-lanh, DOHC, cho ra cng sut t 103 m lc  6.000 vng/pht, m-men xon cc i 141 Nm ti 4.000 vng/pht, hp s sn 5 cp hoc s t ng 4 cp ty phin bn v h dn ng cu trc.<br />\r\n</p>\r\n\r\n<p align="center"><img alt="nh gi chi tit Mitsubishi Xpander 2018 gi bn t 550 triu" src="http://carontrade.com/upload/images/danh-gia-xe-Mitsubishi-Xpander-2018-15.jpg" /><br />\r\n</p>\r\n\r\n<p>Xt tng th, mu xe Mitsubishi Xpander 2018 s hu mc gi hp dn vi 2 phin bn s sn v s t ng, gi bn d kin ln lt l 550 v 650 triu ng s l s la chn hon ho cho ngi s dng xe cho gia nh, p ng nhu cu i li cng vic, cng tc xa, v di chuyn trong thnh ph.</p>\r\n</div>\r\n', 'danh-gia-xe-mitsubishi-xpander-2018-13-5781.jpg', 'danh-gia-xe-mitsubishi-xpander-2018-133536_170x90.jpg', 1, 1, 1535031922, 1535032511, 'nh gi chi tit Mitsubishi Xpander 2018 gi bn t 550 triu', 'Mitsubishi Xpander 2018 ', 'Mi y, Mitsubishi  chnh thc ra mt mu xe 7 ch thuc phn khc gi r mi mang tn Xpander 2018. Mu xe ny c hng gii thiu ti Vit Nam vi 2 phin bn s sn v s t ng, gi bn d ki', '', '', '', 'video', 0, 0, 0, '', '', 'https://www.youtube.com/watch?v=mQG4bbs3JDk'),
(93, 0, 1, 'Lm th no khi tin ng b t chi?', 'lam-the-nao-khi-tin-dang-bi-tu-choi', '', '<p></p>\r\n\r\n<p><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;">Khi tin ng b t chi, bn c th thc hin 2 cch sau:</span></span></p>\r\n\r\n<p></p>\r\n\r\n<p><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;"><strong>Cch 1:</strong> Kim tra hp th <strong>Email</strong> ca bn  bit c l do v sao tin ng b t chi, v hng dn  chnh sa tin ng.</span></span></p>\r\n\r\n<p></p>\r\n\r\n<p><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;"><strong>Cch 2:</strong> Kim tra v chnh sa tin ng ngay ti mc <strong>Qun l tin b t chi</strong> trn website</span></span></p>\r\n\r\n<p></p>\r\n\r\n<p><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;"><strong> - Bc 1</strong>: <a href="http://carontrade.com/dang-nhap.html" target="_blank"><strong>ng nhp</strong></a> thnh vin</span></span></p>\r\n\r\n<p></p>\r\n\r\n<p><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;"><strong> - Bc 2:</strong> Nhp vo <strong>Trang c nhn</strong> ca bn trn thanh Menu, chn mc <strong>Qun l tin b t chi</strong> <strong>Hnh 1</strong></span></span></p>\r\n\r\n<p></p>\r\n\r\n<p style="text-align:center"><img alt="" height="291" src="http://carontrade.com/upload/images/frsf.png" width="600" /></p>\r\n\r\n<p></p>\r\n\r\n<p style="text-align: center;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;">Hinh 1</span></span></p>\r\n\r\n<p></p>\r\n\r\n<p><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;"><strong>Bc 3:</strong> Kim tra l do t chi, nhn vo icon <strong>Sa tin</strong>  tin hnh sa ni dung tin ng ca bn <strong>Hnh 2</strong></span></span></p>\r\n\r\n<p></p>\r\n\r\n<p style="text-align:center"><img alt="" height="267" src="http://carontrade.com/upload/images/okoko.png" width="600" /></p>\r\n\r\n<p></p>\r\n\r\n<p style="text-align: center;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;">Hnh 2</span></span></p>\r\n\r\n<p style="text-align: center;"></p>\r\n\r\n<p style="text-align: center;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;"><em style="box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; font-size: 16px; vertical-align: baseline; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; font-family: &quot;times new roman&quot;, times, serif; text-align: center;">Chn thnh cm n bn  s dng dch v ca CarOntrade!</em></span></span></p>\r\n', '', '', 3, 1, 1535252693, 1537054705, 'Lm th no khi tin ng b t chi?', 'Lm th no khi tin ng b t chi', 'Khi tin ng b t chi, bn c th thc hin 2 cch sau:\r\n\r\n\r\n\r\nCch 1: Kim tra hp th Email ca bn  bit c l do v sao tin ng b t chi, v hng dn  chnh sa tin ng.\r\n\r\n\r\n\r\nCch 2', '', '', '', 'tro-giup', 0, 0, 0, '', '', ''),
(94, 0, 1, 'Tnh nng Tin u tin l g?', 'tinh-nang-tin-uu-tien-la-gi', 'Khi bn chn cc loi Tin u tin  ng bn th c hi tip cn c ng ngi mua s cao hn nhiu so vi nhng tin khc. CarOntrade chc chn rng Tin no ca , nu bn khng tin, hy th ngay!', '<p></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;">Ai cng than l ti sao ng tin li lu c ngi lin h n hi, CarOntrade mch cho bn mt b mt  l ng nh th no cng khng bng ng ng thi im v ng nhu cu ca ngi mua.</span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;">ng lo lng, Tin u tin s gip cho bn thc hin iu !</span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;">Khi bn chn cc loi Tin u tin  ng bn th c hi tip cn c ng ngi mua s cao hn nhiu so vi nhng tin khc. Nu bn khng tin, hy th ngay!</span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;">Di y l bng gi v m t chi tit cc chi ph, cch thc hot ng ca cc loi Tin u tin:</span></span></p>\r\n\r\n<p></p>\r\n\r\n<p style="text-align:center"><img alt="" height="935" src="http://carontrade.com/upload/images/B%E1%BA%A3ng%20gi%C3%A1%20ch%C3%ADnh%20th%E1%BB%A9c%202(2).png" width="600" /></p>\r\n\r\n<p></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;">(<span style="color:#FF0000;">**</span>):  c th ng tin min ph vi Tin Khuyn Mi th bn hy s dng M Gii Thiu ca mnh m CarOntrade  gi vo email ca bn trong qu trnh bn ng k ti khon  gii thiu bn b ng k thnh vin v c hai u nhn c M Khuyn Mi nh.</span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: center;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;"><em style="box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; font-size: 16px; vertical-align: baseline; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; font-family: &quot;times new roman&quot;, times, serif; text-align: center;">CarOntrade chn thnh cm n bn  tin tng chng ti</em></span></span></p>\r\n', '', '', 17, 1, 1535252838, 1537059813, 'Tnh nng Tin u tin l g', 'Tnh nng Tin u tin l g', 'Khi bn chn cc loi Tin u tin  ng bn th c hi tip cn c ng ngi mua s cao hn nhiu so vi nhng tin khc. CarOntrade chc chn rng Tin no ca , nu bn khng tin, hy th', '', '', '', 'tro-giup', 0, 0, 0, '', '', ''),
(111, 0, 1, 'Tr gip ngi bn', 'tro-giup-nguoi-ban', '', '<p></p>\r\n\r\n<p><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;">Bn c th tham kho ti <a href="http://carontrade.com/tro-giup-nguoi-ban.html" target="_blank"><strong>Tr gip ngi bn</strong></a> nh!</span></span></p>\r\n\r\n<p></p>\r\n\r\n<p style="text-align: center;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;"><em style="box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; font-size: 16px; vertical-align: baseline; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; font-family: &quot;times new roman&quot;, times, serif; text-align: center;">Chn thnh cm n bn  s dng dch v ca CarOntrade!</em></span></span></p>\r\n', '', '', 1, 1, 1537054632, 0, '', '', '', '', '', '', 'tro-giup', 0, 0, 0, '', '', '');
