(95, 0, 1, 'Mo mua xe hiu qu', 'meo-mua-xe-hieu-qua', '', '<p align="center"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;">Tm l ngi mua xe lc no cng mun mnh c th chn c mt chic xe hi ph hp vi ti tin cng nh tnh trng xe vn cn tt. Tuy nhin, hu nh mi ngi khi mua xe s rt b thit thi trong vic kim tra cht lng cng nh tnh trng xe bi v s hn ch v kin thc chuyn su v xe hi m ch c ngi trong chuyn ngnh mi c th hiu ht c.</span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;">Chnh v vy,  c th n gin ho vic la chn xe ca bn, CarOntrade xin c a ra nhng mo kim tra ngoi tht cng nh ni tht ca xe hi mt cch chi tit nhm gip cho bn phn no c th c d dng hn trong vic la chn mua nhng chic xe hi tt nht.</span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;"><strong>1. Kim tra ngoi tht xe</strong></span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;"><strong> -  thng bng:</strong> Bn phi chc chn rng xe c u  ni c b mt phng  c th kim tra c nu xe c b chng xung bn no hay khng. Rt c th l do b nhn l xo ca khung bnh xe (phuc) b h hng.</span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;"><strong> - Mu sn:</strong> Bn nh l phi   phn sn xe nh, kim tra xem xe c b xc, c xut hin vt r st nhiu hay khng. T , bn c th cn nhc v tr gi cho chic xe a thch ca mnh mt cch hp l. iu ng lu   y l bn phi kim tra mu sn bn trong cnh ca c trng vi mu sn bn ngoi khung xe hay khng, v nhiu ngi li xe c th em xe i sn li mu khc lm mt i mu zin ca xe, rt kh trong vic nhng li xe cho ch k tip.</span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;"><strong> - Cp sau xe:</strong> Cp sau xe phi c gi gn  tnh trng tt, v sinh sch s, khng bi bn nhiu v ngi li xe i khi s khng c thi quen dn dp cp sau xe. Cp xe khng nn c nhng du hiu r st, b nc nhu vo t cc khe h. Bn phi kim tra bn di thm cp xe xem b  ngh sa xe, v mt bnh xe s cua i km c cc nh sn xut cung cp c y  hay khng, v hu nh chic xe hi no cng c cp tiu chun mt b  ngh v mt bnh xe s cua  phng nhng trng hp xe ang i b b lp gia ng.</span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;"><strong> - Lp bnh xe:</strong> Bn nn kim tra b mt lp xe xem c b mn, nt nhiu hay khng, c bit l kim tra hn s dng c in trn lp xe (hnh bn di)  bit lp xe c cn s dng c hay khng, trnh c nhng trng hp n lp trn ng. Khi mua gp phi lp xe tnh trng khng tt, bn nn  ngh ngi bn thay lp cho bn, nu khng th bn nn cn nhc la chn chic xe khc ph hp vi mnh hn.</span></span></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;"><strong> </strong></span></span></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;"><strong> </strong><strong>- Khung xe:</strong> Nu gp phi nhng trng hp khung xe b h hi, mp, lm nhiu th bn nn cn nhc trong vic la chn chic xe .  phn khung mi xe, kim tm chn bn bn trong mui xe, nu u ca cc con c vt ca tm chn bn bn trong mui xe b xc nhiu th c th  l du hiu ca vic ch xe  thay khung mi xe sau khi va chm tai nn.</span></span></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;"><strong></strong></span></span></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;"><strong> - ng x (b) xe hi:</strong> Nu c c hi, bn hy nhn mt cch tht an ton v cn thn b ng x bn di gm xe hi xem c b r st nhiu khng, c bit l nhng im en trn ng x bi v n cho thy du hiu r r. Ly ngn tay ch nh ln ng x, nu thy c vt du nht th chng t h thng ng x c vn . ng x thi khi trng khi n my cng cho thy du hiu h hng.</span></span></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;"><strong></strong></span></span></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;"><strong> </strong><strong>- n xe:</strong> Bn hy kim tra xem tt c cc h thng n chiu sang trn xe cn hot ng tt v khng bng n no b h hi. Cc b phn n cn kim tra: n ct, n pha, n xi-nhan trc v sau, n khn cp (hazard light), n li xe, n ui xe, n bn trong ni tht xe, n bn trong cp xe.</span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;"><strong>2. Kim tra ng c di mui xe</strong></span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;"><strong> - Tng th: </strong>Bn nhn vo cc b phn ng c xem c du hiu mp hoc lm, nt hay r st khng. Nu c nhng du hiu trn th c th thy chic xe hi ny khng c chm sc k lng hoc b va chm do tai nn. Tu vo tui th ca xe m bn c th nh gi c tnh trng xe mt cch hp l nht, v d: nu l xe vi 2 n 3 nm tui th th ng c s t c du hiu r st hn l xe c tui th t 7 nm tr ln.</span></span></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;"><strong> </strong></span></span></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;"><strong> </strong><strong>- ng tn nhit v dy ai cao su:</strong> ng tn nhit v dy ai cao su phi c nguyn vn, khng nn c du hiu rn nt. c bit l ng tn nhit khng c c du hiu mm.</span></span></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;"><strong> </strong></span></span></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;"><strong> - ng c:</strong> Bn nn quan st k phn ng c di mui xe xem c b phn no b r r hay b n mn hay khng. Du hiu r r s c pht hin bng vic xut hin ca nhng vt ng du nht mu nu sm r r ti cc khe ng c. Nguyn nhn c th xut pht t thng cha du bi trn ng c, hoc du tr lc li v du phanh.</span></span></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;"><strong> </strong></span></span></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;"><strong> - Np du bi trn ng c:</strong> M np du ra xem nu bn di np xut hin vt bt nu bn th bn tuyt i nn cn nhc v vic mua chic xe . Nguyn nhn c th do kh hu thay i hoc ch xe thng xuyn ra ng c xe khin cho  m ca nc xm nhp vo ming np du v vo bn trong thng cha du, lu ngy lm xi bt. iu ny cng c th thy ch xe khng thng thay nht xe nh k.</span></span></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;"><strong> </strong></span></span></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;"><strong> - Kim tra du bi trn ng c (nht my):</strong> Bn c th kim tra bng cch s dng que thm nht my c t cnh ng c, thng c mu vang hoc cam. Rt que thm nht my ra v lau sch nht bm trn que, sau  cm vo ng c v rt ra li v quan st. Nu mu du nht nn c mu hng , i vi xe  qua s dng th mu c th b sm hn nhng khng c c mu hay mi chy kht. Mc  du nht phi nm trong khon Min v Max, nu nm ngoi hai khong  th bn nn x l ngay bng cch chm thm hoc rt bt ra.</span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;"><strong>3. Kim tra ni tht xe</strong></span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;"><strong> - Gh ngi: </strong>Gh ngi nn c gi gn, v sinh sch s. Bn nn kim tra gh ngi c b rch, ta ch, b vt bn hay h hi g hay khng.</span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;"><strong> - H thng iu ho: </strong>Bn ln xe v khi ng my, sau  bt iu ho ln, nu iu ho to nhit nhanh th h thng cn tt. Nu khng thy to nhit th bn nn cn nhc v vic mua chic xe ny v chi ph sa cha h thng iu ho rt t.</span></span></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;"><strong> </strong></span></span></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;"><strong> - Hp s xe: </strong>Vic kim tra hp s xe rt quan trng bi v n cho thy c tnh trng ca xe. Lng cy s kilomet trung bnh mt nm ca mt chic xe hi chy c giao ng t 10,000 kilomet n 15,000 kilomet, tuy nhin s km chy c cn tu thuc vo nhng yu t khc. Tu vo tui th ca xe m bn c th kt lun c chic xe ny chy c bao nhiu kilomet l hp l, v d: i vi chic xe khi  c tui th trn 10 nm m s kilomet chy c li thp hn 50,000 kilomet th tht v l.</span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;"><strong>4. Li th</strong></span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;"><strong> -  git ca xe: </strong>Khng c cch no kim tra tt hn l li th. Bn hy ln xe,  my, nhp ga tng tc t ngt, v kim tra xem trong qu trnh tng tc xe c b git li hay b ngt qung nhiu hay khng. Xe tt s c  mt khi p ga ln s t ngt.</span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;"><strong> - Kim tra phanh: </strong>Bn hy chy xe th vi tc  45km/h v p phanh   gim tc  m khng b trt bnh. Trong qu trnh p phanh m bn cm thy bn p rung ln hay phanh pht ra nhng ting ng l th nn kim tra li thng trc khi mua. Phanh khng nn b dng t ngt, rt d lm mn phanh.</span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;"><strong>5. Kim tra s bo hnh</strong></span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;">ng bao gi qun kim tra s bo hnh ca xe, v n c th gip bn bit c tnh trng xe t trc n gi, v d xe c c bo hnh ng nh k hay khng, c c thay thit b hay ng c g hay khng, hoc xe c b h hng hay tai nn xe hay khng.  c th la chn c mt chic xe tt, th CarOntrade khuyn bn nn c mt ngi c kin thc chuyn mn v xe  gip bn kim tra xe mt cch k lng hn.</span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;"><strong>6. Tnh trng php l ca xe</strong></span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;">Bn hy hi r rng ngi bn xem xe ca h c ang b cm  vay mn tin ngn hng hay nhng trng hp lin quan hay khng nh.  bo v quyn li cho bn th CarOntrade khuyn bn nn kim tra  trong sch ca chic xe trc khi quyt nh mua.</span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: center;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;"><em new="" style="box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; font-size: 16px; vertical-align: baseline; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; font-family: " text-align:="" times="">Chn thnh cm n bn  s dng dch v ca CarOntrade!</em></span></span></p>\r\n\r\n<p style="margin-left:54.0pt;"></p>\r\n', '', '', 2, 1, 1535258073, 1537054822, 'Mo mua xe hiu qu', 'Mo mua xe hiu qu', 'Tm l ngi mua xe lc no cng mun mnh c th chn c mt chic xe hi ph hp vi ti tin cng nh tnh trng xe vn cn tt. Tuy nhin, hu nh mi ngi khi mua xe s rt b thit thi trong', '', '', '', 'tro-giup', 0, 0, 0, '', '', ''),
(96, 0, 1, 'Mo bn xe hiu qu', 'meo-ban-xe-hieu-qua', 'Vi mong mun gip cho ngi bn c c mt tin ng bn xe thuyt phc, c th bn c xe mt cch hiu qu v nhanh nht. CarOntrade xin bt m mt vi mo nh c th gip cc bn phn no thu ht c s ch  ca ngi mua v tng kh bn c xe ca mnh.', '<p align="center"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-family:times new roman,times,serif;"><span style="font-size:16px;">Vi mong mun gip cho ngi bn c c mt tin ng bn xe thuyt phc, c th bn c xe mt cch hiu qu v nhanh nht. CarOntrade xin bt m mt vi mo nh c th gip cc bn phn no thu ht c s ch  ca ngi mua v tng kh bn c xe ca mnh.</span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-family:times new roman,times,serif;"><strong><span style="font-size:16px;">1. Bo dng, kim tra xe</span></strong></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-family:times new roman,times,serif;"><span style="font-size:16px;">Bc bo dng v kim tra tnh trng xe nh k trc khi ng bn (thay nht, kim tra phanh, ci thin my mc, thay cc b phn b h, n, iu ho,) l mt iu quan trng khng th thiu nu bn mun xe mnh c c hi bn c nhanh. Ngoi ra, hy khc phc cc vt xc trn thn xe nu c th  chic xe ca bn nhn tht lng ly cho d n  qua s dng. Tnh trng xe khng tt l nguyn nhn chnh dn n vic gi bn m bn a ra b ngi mua mc c, d l chi tit nh nht.</span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><strong new="" style="font-family: " times=""><span style="font-size:16px;">2. V sinh ni tht xe</span></strong></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-family:times new roman,times,serif;"><span style="font-size:16px;">Tht khng tt khi ngi mua ngi vo xe ca bn m ngi thy mi hi, thy bi bn hay nhng vt nc ng li trong xe. Hy dn dp, v sinh sch s cc ni tht bn trong xe ca bn, s dng nc hoa hay kh mi  bn trong xe c mt bu khng kh d chu. Hy li cun ngi mua bng mt khng gian thoi mi khi c ngi li bn trong xe ca bn.</span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-family:times new roman,times,serif;"><strong><span style="font-size:16px;">3. Ra xe</span></strong></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-family:times new roman,times,serif;"><span style="font-size:16px;">Bn hy chc chn rng xe ca mnh nhn tht bng by, hay ra xe sch s trc khi mang xe ca bn n vi ngi mua. Bi v xe cng sch, cng bng th nhn s cng mi, cng li ko ngi mua phi chn chic xe ca bn.</span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-family:times new roman,times,serif;"><strong><span style="font-size:16px;">4. V sinh ng c di mui xe</span></strong></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-family:times new roman,times,serif;"><span style="font-size:16px;">Hy b ra t thi gian  v sinh ng c di mui xe bi v tnh trng ca ng c ca mui xe cng phn nh r rt n tnh trng tng th chic xe ca bn. ng c di mui xe cng bi bn, xung cp th s khin cho ngi mua mc c v gi c ngay, hay thm ch l t chi mua chic xe ca bn. V bn xin lu  rng, v sinh ng c di mui xe phi ng cch nu khng s nh hng khng tt n cc my mc bn trong.</span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-family:times new roman,times,serif;"><strong><span style="font-size:16px;">5. nh bng lp xe</span></strong></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-family:times new roman,times,serif;"><span style="font-size:16px;">Bn ng qun v sinh bnh xe, lp xe trc khi bn cho ngi mua nh. Tnh trng ca lp xe c bit nh hng n s quyt nh ca ngi mua, hy nh bng lp xe bng cc bnh xt lp xe thng dng  cho lp xe bn nhn tht en tuyn, bng by nh. CarOntrade m bo vi bn rng ngi mua s b hp dn bi s lng ly ca lp xe bn.</span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-family:times new roman,times,serif;"><strong><span style="font-size:16px;">6. Giy t xe</span></strong></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-family:times new roman,times,serif;"><span style="font-size:16px;">iu quan trng khng th thiu  chnh l chun b y  cc giy t xe, s bo hnh xe v cc giy t lin quan m ngi mua c th i hi t bn nhm kim tra  trong sch ca xe bn trc khi quyt nh mua n.</span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-family:times new roman,times,serif;"><strong><span style="font-size:16px;">7. Hnh nh tht, trung thc v r nt</span></strong></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-family:times new roman,times,serif;"><span style="font-size:16px;">Hy chp hnh nh tht r nt, sc cnh, v chi tit nhm gip cho ngi mua c th nh gi tng th chic xe ca bn. u t k lng cho nh i din v n l tm hnh p vo mt ngi mua v gy s ch  u tin.</span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-family:times new roman,times,serif;"><span style="font-size: 16px;">Bn c th tham kho thm v </span><a font-size:="" href="http://carontrade.com/quy-dinh-dang-tin.html" new="" style="font-family: " target="_blank" times=""><strong>Quy nh chp hnh</strong></a><span style="font-size: 16px;"> m CarOntrade  ra sau khi  nghin cu k lng nhng gc cnh c th hp dn ngi xem cng nh ngi mua.</span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-family:times new roman,times,serif;"><strong><span style="font-size:16px;">8. Ni dung tin ng chi tit, hp dn</span></strong></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-family:times new roman,times,serif;"><span style="font-size:16px;"> c ni dung tht hp dn th bn hy ng mt cch tht chi tit, ng vi c im k thut ca xe. Nu ra c nhng c tnh ni bt ca xe bn m c th thu ht ngi mua (tit kim xng, ng c mnh, mui trn,)</span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-family:times new roman,times,serif;"><span style="font-size:16px;">Trnh s dng nhng t so rng: Bnh d phng cha dc dng qua, xe chy hp vi ph n.</span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-family:times new roman,times,serif;"><span style="font-size:16px;">ng qun nu r hnh thc thanh ton.</span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-family:times new roman,times,serif;"><span style="font-size:16px;">Bn c th tham kho thm v <a href="http://carontrade.com/quy-dinh-dang-tin.html" target="_blank"><strong>Quy nh v ni dung tin ng, gi c</strong></a> trong quy nh ca CarOntrade.</span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-family:times new roman,times,serif;"><strong><span style="font-size:16px;">9. Gi bn hp l</span></strong></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-family:times new roman,times,serif;"><span style="font-size:16px;">Hy chc chn rng gi m bn a ra hp l, khng ph gi. Gi chnh l yu t quyt nh ngi mua c chn chic xe ca bn hay khng.</span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-family:times new roman,times,serif;"><span style="font-size:16px;">Chnh v vy,  c c mt mc gi hp l, bn nn tham kho gi th trng trn CarOntrade hoc cc din n chi xe hi.</span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-family:times new roman,times,serif;"><span style="font-size:16px;">Ngoi ra,  n gin ho v vic bn phi ct cng i tm hiu gi c th trng, hy s dng tnh nng <a href="http://carontrade.com/dinh-gia-xe.html" target="_blank"><strong>nh gi xe</strong></a> ca CarOntrade da trn th trng xe hi  gip cho bn c c mt mc gi bn tht hp l.</span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-family:times new roman,times,serif;"><strong><span style="font-size:16px;">10. S dng tnh nng Tin u tin t CarOntrade</span></strong></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-family:times new roman,times,serif;"><span style="font-size:16px;"> c th tng c  tip cn gia bn v ngi mua trong hng nghn tin ng trn Sn, bn c th tham kho thm tnh nng <a href="http://carontrade.com/tro-giup/tinh-nang-tin-uu-tien-la-gi.html" target="_blank"><b>Tin u tin</b></a>nhm tng c hi bn c xe ca bn trong thi gian ngn nht, rt ngn c thi gian tip cn c khch hng tim nng.</span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n', '', '', 20, 0, 1535262062, 1535966858, 'Mo bn xe hiu qu', 'Mo bn xe hiu qu', 'Vi mong mun gip cho ngi bn c c mt tin ng bn xe thuyt phc, c th bn c xe mt cch hiu qu v nhanh nht. CarOntrade xin bt m mt vi mo nh c th gip cc bn phn no thu h', '', '', '', 'tro-giup', 0, 0, 0, '', '', ''),
(103, 0, 1, 'Tnh nng Tin u tin l g?', 'tinh-nang-tin-uu-tien-la-gi', 'Khi bn chn cc loi Tin u tin  ng bn th c hi tip cn c ng ngi mua s cao hn nhiu so vi nhng tin khc. CarOntrade chc chn rng Tin no ca , nu bn khng tin, hy th ngay!', '<p></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;"><span new="" times="">Ai cng than l ti sao ng tin li lu c ngi lin h n hi, CarOntrade mch cho bn mt b mt  l ng nh th no cng khng bng ng ng thi im v ng nhu cu ca ngi mua.</span></span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;"><span new="" times="">ng lo lng, Tin u tin s gip cho bn thc hin iu !</span></span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;"><span new="" times="">Khi bn chn cc loi Tin u tin  ng bn th c hi tip cn c ng ngi mua s cao hn nhiu so vi nhng tin khc. Nu bn khng tin, hy th ngay!</span></span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;"><span new="" times="">Di y l bng gi v m t chi tit cc chi ph, cch thc hot ng ca cc loi Tin u tin:</span></span></span></p>\r\n\r\n<p></p>\r\n\r\n<p style="text-align:center"><img alt="" height="925" src="http://carontrade.com/upload/images/B%E1%BA%A3ng%20gi%C3%A1%20ch%C3%ADnh%20th%E1%BB%A9c%202(1).png" width="600" /></p>\r\n\r\n<div contenteditable="false" style="line-height: 0; text-align: center;" tabindex="-1"></div>\r\n\r\n<p></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;"><span new="" times="">(<span style="color: rgb(255, 0, 0);">**</span>):  c th ng tin min ph vi Tin Khuyn Mi th bn hy s dng M Gii Thiu ca mnh m CarOntrade  gi vo email ca bn trong qu trnh bn ng k ti khon  gii thiu bn b ng k thnh vin v c hai u nhn c M Khuyn Mi nh.</span></span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: center;"><em font-size:="" new="" style="font-family: " text-align:="" times="">CarOntrade chn thnh cm n bn  tin tng chng ti</em></p>\r\n', '', '', 1, 1, 1535966914, 1537059825, 'Tnh nng Tin u tin l g?', 'Tnh nng Tin u tin l g', 'Khi bn chn cc loi Tin u tin  ng bn th c hi tip cn c ng ngi mua s cao hn nhiu so vi nhng tin khc. CarOntrade chc chn rng Tin no ca , nu bn khng tin, hy th', '', '', '', 'tro-giup-nguoi-dung', 0, 0, 0, '', '', ''),
(97, 0, 1, 'S an ton trong qu trnh mua bn', 'su-an-toan-trong-qua-trinh-mua-ban', 'CarOntrade lun t s an ton ca ngi dng ln hng u, a ra nhng gii php mua bn an ton  bo v ngi dng chnh l trch nhim v ngha v ca chng ti.\r\n\r\n\r\n\r\nQuy trnh kim duyt tin ng cht ch t i ng kim duyt vin chuyn nghip.\r\n\r\n', '<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;">CarOntrade lun t s an ton ca ngi dng ln hng u, a ra nhng gii php mua bn an ton  bo v ngi dng chnh l trch nhim v ngha v ca chng ti.</span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;">Quy trnh kim duyt tin ng cht ch t i ng kim duyt vin chuyn nghip.</span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;">Pht trin tnh nng cho php ngi dng nh gi tin ng ca ngi bn, to iu kin cho ngi dng phi hp cng CarOntrade loi b nhng trng hp mang tnh cht la o.</span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;"><strong>H tr</strong> v <strong>phn hi</strong> ngi dng <strong>nhanh chng</strong> thng qua hotline <strong>0126 4428 166</strong> hoc a ch email <strong>hotrokhachhang@carontrade.com</strong>.</span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;"><strong>1. V s an ton ca Ngi mua</strong></span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;">- Khng nn chuyn tin trc khi nhn xe. Gp nhau trc tip  mua bn.</span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;">- KIm tra thng tin xe c ng vi tin c ng hay khng.</span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;">- Test my mc, li th, kim tra k lng ri mi tr tin.</span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;">- V gi tr mua xe ln, hy lun i cng ngi quen.</span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;">- Giao dch trc tip  ni quen thuc nh a im gn nh, cng ty hoc cc trung tm bo hnh c th kim tra c sn phm.</span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;">- Thn trng i vi cc sn phm xe c bn vi gi qu r so vi gi tr ca cc xe khc  cng th trng.</span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;">- Yu cu ngi bn phi cung cp y  cc giy t php l  chng minh s hu xe hoc h tr cho qu trnh giao dch gia hai bn. Trc khi gp ngi bn hy hi h c nhng giy sau y hay khng th mi cn nhc v vic gp mt giao dch: c-vt xe, chng minh nhn dn, bng li xe, s bo hnh xe, bin lai mua xe (nu c).</span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;">- ng qun bo qun ti sn c nhn trong khi tham gia giao dch.</span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><strong><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;">Nhng trng hp ngi mua cn  cao cnh gic:</span></span></strong></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;">- Xe khng c bn bi ch s hu xe m c nh bn th ba bn gip.</span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;">- Giy t php l khng r rng, thiu st.</span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;"><strong>2. V s an ton ca Ngi bn</strong></span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;">- Nn gp nhau trc tip  mua bn.</span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;">- V gi tr mua xe ln, hy lun i cng ngi quen.</span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;">-  trnh nhng trng hp pht sinh mu thun sau khi bn, bn nn trao i chi tit, k lng cc iu khon khi giao dch v yu cu ngi mua kim tra sn phm xe hi cn thn trc khi ng  mua.</span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;">- Mi chi ph y tin u c thanh ton trc tuyn qua Sn giao dch TMT CarOntrade.com do chnh bn chi tr, hy thn trng nu c ai  lin h vi bn  thu ph di danh ngha CarOntrade. Hy thng bo ngay cho chng ti  c h tr kp thi.</span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;">- Khi ngi mua xin li th, hy chc chn rng bn cng c mt bn trong xe.</span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;">- Hy bo qun xe v ti sn c nhn ca bn cn thn trong qu trnh giao dch.</span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;">- Khng giao xe khi cha c g m bo t ngi mua, v d: giy t tu thn, tin t cc.</span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><strong><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;">Nhng trng hp ngi bn cn  cao cnh gic:</span></span></strong></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;">- Ngi mua lm gi giy chyn khon, khin cho bn khng nhn c tin.</span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;">- Ngi mua xin li th v khng c  nh tr li xe cho bn sau khi dng.</span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: center;"><em style="box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; font-size: 16px; vertical-align: baseline; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; font-family: &quot;times new roman&quot;, times, serif; text-align: center;">Chn thnh cm n bn  s dng dch v ca CarOntrade!</em></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n', '', '', 4, 1, 1535289814, 1537054839, 'S an ton trong qu trnh mua bn', 'S an ton trong qu trnh mua bn', 'CarOntrade lun t s an ton ca ngi dng ln hng u, a ra nhng gii php mua bn an ton  bo v ngi dng chnh l trch nhim v ngha v ca chng ti.\r\n\r\n\r\n\r\nQuy trnh kim duyt tin ', '', '', '', 'tro-giup', 0, 0, 0, '', '', '');
