(98, 0, 1, 'Chnh sch bo mt thng tin', 'chinh-sach-bao-mat-thong-tin', 'Chnh sch bo mt cho bn bit chng ti s dng thng tin c nhn ca bn ti Sn giao dch TMT CarOntrade.com ny nh th no. Xin vui lng c chnh sch bo mt trc khi s dng trang web hoc gi bt k thng tin c nhn no.\r\n\r\n\r\n\r\nKhi s dng trang web, bn ang chp nhn nhng iu c m', '<p></p>\r\n\r\n<p style="text-align: center;"><span style="font-family: &quot;times new roman&quot;, times, serif;"><strong><span style="font-size: 24px;">Chnh sch bo mt</span></strong></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-family: &quot;times new roman&quot;, times, serif;"><span style="font-size: 16px;">Chnh sch bo mt cho bn bit chng ti s dng thng tin c nhn ca bn ti Sn giao dch TMT CarOntrade.com ny nh th no. Xin vui lng c chnh sch bo mt trc khi s dng trang web hoc gi bt k thng tin c nhn no.</span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-family: &quot;times new roman&quot;, times, serif;"><span style="font-size: 16px;">Khi s dng trang web, bn ang chp nhn nhng iu c m t trong chnh sch bo mt. Nhng iu ny c th thay i, nhng bt k thay i no cng u sc ng ln v thay i s ch p dng cho cc hot ng v thng tin trn c s tnh tin, ch khng phi hi t. Bn nn xem li chnh sch bo mt bt c khi no bn truy cp trang web  m bo rng mnh hiu cc thng tin c nhn m bn cung cp s c s dng nh th no. Chnh sch ca chng ti l gi kn thng tin c nhn nhn c t trang web hon ton b mt v ch dng cho mc ch ni b. Chng ti s khng chia s thng tin c nhn ca bn vi bt k bn no khc. Hy yn tm rng chng ti tn trng s ring t ca bn v x l d liu c nhn ca bn vi s cn trng ti a.</span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-family: &quot;times new roman&quot;, times, serif;"><span style="font-size: 16px;"><strong>Mc ch v phm vi thu thp</strong></span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-family: &quot;times new roman&quot;, times, serif;"><span style="font-size: 16px;">Vic thu thp d liu ch yu trn Sn giao dch TMT CarOntrade.com bao gm: h v tn, a ch email, s in thoi, tn ng nhp, mt khu ng nhp, a ch khch hng. y l cc thng tin m CarOntrade cn khch hng cung cp bt buc khi ng k s dng dch v v chng ti s dng  lin h xc nhn khi khch hng ng k s dng dch v trn CarOntrade, m bo quyn li cho khch hng, da trn quy nh ti khoan 3 iu 36 Nghi inh 52/2013/N-CP ngay 16/5/2013. Khi ng k thnh vin ca CarOntrade, ng ngha vi vic khch hng t nguyn cung cp thng tin c nhn ca mnh cho chng ti.</span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-family: &quot;times new roman&quot;, times, serif;"><span style="font-size: 16px;">Cc khch hng s t chu trch nhim v bo mt v lu gi mi hot ng s dng dch v di tn ng k, mt khu v hp th in t ca mnh. Ngoi ra, khch hng c trch nhim thng bo kp thi cho Sn TMT CarOntrade.com v nhng hnh vi s dng tri php, lm dng, vi phm bo mt, lu gi tn ng k v mt khu ca bn th ba  c bin php gii quyt ph hp.</span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-family: &quot;times new roman&quot;, times, serif;"><span style="font-size: 16px;"><strong>Phm v s dng thng tin</strong></span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-family: &quot;times new roman&quot;, times, serif;"><span style="font-size: 16px;">Sn giao dch TMT CarOntrade.com s dng thng tin khch hng cung cp :</span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-family: &quot;times new roman&quot;, times, serif;"><span style="font-size: 16px;">- Cung cp cc dch v n khch hng.</span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-family: &quot;times new roman&quot;, times, serif;"><span style="font-size: 16px;">- Gi cc thng bo v cc hot ng trao i thng tin gia khch hng v CarOntrade.</span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-family: &quot;times new roman&quot;, times, serif;"><span style="font-size: 16px;">- Ngn nga cc hot ng ph hy ti khon ngi dng ca khch hng hoc cc hot ng gi mo khch hng.</span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-family: &quot;times new roman&quot;, times, serif;"><span style="font-size: 16px;">- Lin lc v gii quyt vi khch hng trong nhng trng hp c bit.</span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-family: &quot;times new roman&quot;, times, serif;"><span style="font-size: 16px;">- Khng s dng thng tin c nhn ca khch hng ngoi mc ch xc nhn v lin h c lin quan n giao dch ti CarOntrade.</span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-family: &quot;times new roman&quot;, times, serif;"><span style="font-size: 16px;">Chng ti c trch nhim hp tc cung cp thng tin c nhn khch hng khi c yu cu t c quan nh nc c thm quyn.</span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-family: &quot;times new roman&quot;, times, serif;"><span style="font-size: 16px;"><strong>Thi gian lu tr thng tin</strong></span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-family: &quot;times new roman&quot;, times, serif;"><span style="font-size: 16px;">D liu c nhn ca khch hng s c lu tr cho n khi c yu cu hy b hoc t khch hng ng nhp v thc hin vic hy b. Cn li trong mi trng hp thng tin c nhn khch hng s c bo mt trn my ch ca CarOntrade.</span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-family: &quot;times new roman&quot;, times, serif;"><span style="font-size: 16px;"><strong>a ch ca n v thu thp, qun l thng tin v h tr khch hng</strong></span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<ul>\r\n	<li style="text-align: justify;"><span style="font-family: &quot;times new roman&quot;, times, serif;"><span style="font-size: 16px;"><strong>CNG TY TNHH CARONTRADE</strong></span></span></li>\r\n	<li style="text-align: justify;"><span style="font-family: &quot;times new roman&quot;, times, serif;"><span style="font-size: 16px;"><strong>a ch lin h: 190/92a Xm t, Phng 10, Qun 11, Thnh Ph H Ch Minh, Vit Nam</strong></span></span></li>\r\n	<li style="text-align: justify;"><span style="font-family: &quot;times new roman&quot;, times, serif;"><span style="font-size: 16px;"><strong>VPGD: 190/92a Xm t, Phng 10, Qun 11, Thnh Ph H Ch Minh, Vit Nam</strong></span></span></li>\r\n	<li style="text-align: justify;"><span style="font-family: &quot;times new roman&quot;, times, serif;"><span style="font-size: 16px;"><strong>Hotline: 0126 4428 166</strong></span></span></li>\r\n	<li style="text-align: justify;"><span style="font-family: &quot;times new roman&quot;, times, serif;"><span style="font-size: 16px;"><strong>a ch email:</strong><a href="mailto:bophankinhdoanh@carontrade.com">bophankinhdoanh@carontrade.com</a><a href="mailto:hotrokhachhang@carontrade.com">hotrokhachhang@carontrade.com</a>. </span></span></li>\r\n</ul>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-family: &quot;times new roman&quot;, times, serif;"><span style="font-size: 16px;"><strong>Phng tin v cng c  khch hng tip cn v chnh sa d liu ca mnh</strong></span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-family: &quot;times new roman&quot;, times, serif;"><span style="font-size: 16px;">Khch hng c quyn t kim tra, cp nht, iu chnh thng tin c nhn ca mnh bng cch ng nhp vo ti khon v chnh sa thng tin c nhn hoc yu cu CarOntrade thc hin vic ny.</span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-family: &quot;times new roman&quot;, times, serif;"><span style="font-size: 16px;">Khch hng c quyn gi khiu ni v vic l thng tin cc nhn cho bn th ba n a ch email<a href="mailto:bophankinhdoanh@carontrade.com">bophankinhdoanh@carontrade.com</a><a href="mailto:hotrokhachhang@carontrade.com">hotrokhachhang@carontrade.com</a>. Khi tip nhn nhng phn hi ny, chng ti s xc nhn li thng tin, phi c trch nhim tr li l do v hng dn khch hng khi phc v bo mt li thng tin.</span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-family: &quot;times new roman&quot;, times, serif;"><span style="font-size: 16px;"><strong>Cam kt bo mt thng tin c nhn khch hng</strong></span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-family: &quot;times new roman&quot;, times, serif;"><span style="font-size: 16px;">Thng tin c nhn ca khch hng s c chng ti cam kt bo mt tuyt i theo chnh sch bo v thng tin c nhn ca CarOntrade, da trn iu 68 n iu 73, Mc 1 Bo v thng tin c nhn trong TMT (Chng V) quy nh ti Ngh nh 52/2013/N-CP.</span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-family: &quot;times new roman&quot;, times, serif;"><span style="font-size: 16px;">CarOntrade cam kt khng s dng, khng chuyn giao, cung cp hay tit l cho bn th ba no v thng tin c nhn ca khch hng khi khng c s cho php hoc ng  t khch hng, tr nhng trng hp php lut c quy nh khc.</span></span></p>\r\n\r\n<p style="text-align: justify;"></p>\r\n\r\n<p style="text-align: justify;"><span style="font-family: &quot;times new roman&quot;, times, serif;"><span style="font-size: 16px;">Trong trng hp my ch lu tr thng tin b hacker tn cng dn n mt mt d liu c nhn khch hng, CarOntrade s c trch nhim thng bo v vic cho c quan chc nng iu tra x l kp th v thng bo cho khch hng c bit.</span></span></p>\r\n', '', '', 3, 1, 1535546852, 1535546900, 'Chnh sch bo mt thng tin', 'Chnh sch bo mt thng tin', 'Chnh sch bo mt cho bn bit chng ti s dng thng tin c nhn ca bn ti Sn giao dch TMT CarOntrade.com ny nh th no. Xin vui lng c chnh sch bo mt trc khi s dng trang web hoc ', '', '', '', 'ho-tro-khach-hang', 0, 0, 0, '', '', ''),
(99, 0, 1, 'Qun mt khu', 'quen-mat-khau', 'Khi qun mt khu, bn hy thc hin theo hng dn:\r\n\r\n\r\n\r\nBc 1: n vo dng ch Bn qun mt khu trong mc ng nhp thnh vin CarOntrade  Hnh 1', '<p></p>\r\n\r\n<p><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;"><span new="" times="">Khi qun mt khu, bn hy thc hin theo hng dn:</span></span></span></p>\r\n\r\n<p></p>\r\n\r\n<p><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;"><span new="" times=""><strong>Bc 1:</strong>n vo dng ch Bn qun mt khu trong mc<strong><a href="http://carontrade.com/dang-nhap.html" target="_blank">ng nhp</a></strong>thnh vin CarOntrade<strong>Hnh 1</strong></span></span></span></p>\r\n\r\n<p></p>\r\n\r\n<div contenteditable="false" style="line-height: 0; text-align: center;" tabindex="-1">\r\n<p data-widget="image"><img alt="" height="299" src="http://carontrade.com/upload/images/2(7).png" width="600" /></p>\r\n</div>\r\n\r\n<p></p>\r\n\r\n<p style="text-align: center;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;"><span new="" times="">Hnh 1</span></span></span></p>\r\n\r\n<p style="text-align: center;"></p>\r\n\r\n<p><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;"><span new="" times=""><strong>Bc 2:</strong>Nhp Email bn s dng lc ng k ti khon trn CarOntrade, mt khu mi s c gi n hp th Email ca bn <strong>Hnh 2</strong></span></span></span></p>\r\n\r\n<p></p>\r\n\r\n<div contenteditable="false" style="line-height: 0; text-align: center;" tabindex="-1">\r\n<p data-widget="image"><img alt="" height="300" src="http://carontrade.com/upload/images/3(5).png" width="600" /></p>\r\n</div>\r\n\r\n<p style="text-align: center;"></p>\r\n\r\n<p style="text-align: center;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;"><span new="" times="">Hnh 2</span></span></span></p>\r\n\r\n<p style="text-align: center;"></p>\r\n\r\n<p style="text-align: center;"><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;"><span new="" times=""><em>Chc mng bn  ly li c mt khuca mnh!</em></span></span></span></p>\r\n', '', '', 3, 0, 1535547070, 1535547669, 'Qun mt khu', 'Qun mt khu', 'Khi qun mt khu, bn hy thc hin theo hng dn:\r\n\r\n\r\n\r\nBc 1: n vo dng ch Bn qun mt khu trong mc ng nhp thnh vin CarOntrade  Hnh 1', '', '', '', 'tro-giup-nguoi-dung', 0, 0, 0, '', '', ''),
(100, 0, 1, 'Ford Everest 2018 chnh thc ra mt ti Vit Nam vi mc gi t 1,12 t, ng c 2.0 tng p, hp s 10 cp th h mi', 'ford-everest-2018-chinh-thuc-ra-mat-tai-viet-nam-voi-muc-gia-tu-112-ty-dong-co-20-tang-ap-hop-so-10-cap-the-he-moi', 'Mi y, Ford Everest 2018 va c chnh thc ra mt ti Vit Nam vi 5 phin bn, bao gm 1 bn s sn cng 4 phin bn s t ng. im hp dn nht trn Ford Everest 2018  l mc gi bn hp dn hn kh nhiu, ng c 2.0 Bi-Turbo tng p i mi cng hp s t ng 10 cp v hp s sn 6 cp. Hy cng CarOntrade nh gi nhanh mu xe Ford Everest 2018,  xem mu xe gm cao Everest ny c g mi nh!  \r\n\r\n', '<div style="text-align:justify; font-size:14px; line-height:25px;">\r\n<p><br />\r\nMi y, Ford Everest 2018 va c chnh thc ra mt ti Vit Nam vi 5 phin bn, bao gm 1 bn s sn cng 4 phin bn s t ng. im hp dn nht trn Ford Everest 2018  l mc gi bn hp dn hn kh nhiu, ng c 2.0 Bi-Turbo tng p i mi cng hp s t ng 10 cp v hp s sn 6 cp. Hy cng CarOntrade nh gi nhanh mu xe Ford Everest 2018,  xem mu xe gm cao Everest ny c g mi nh!<br />\r\n</p>\r\n\r\n<p align="center"><img alt="Ford Everest 2018 chnh thc ra mt ti Vit Nam vi mc gi t 1,12 t, ng c 2.0 tng p, hp s 10 cp th h mi" src="http://carontrade.com/upload/images/Ford-Everest-2018-chinh-thuc-ra-mat-tai-viet-nam-1.jpg" /><br />\r\n</p>\r\n\r\n<h2 style="line-height:24px"><strong>Ngoi hnh</strong><br />\r\n</h2>\r\n\r\n<p>V mt thit k, Ford Everest 2018 c trang b kch thc (DxRxC) 4.820 X 1.860 X 1.837 mm, khoang sng gm xe t 210 mm, chiu dai co s 2.850 mm. Ford Everest 2018 s hu kt cu Body on Frame cng vi vi hp khung thep ln c kha nang chng xon vn cao.<br />\r\n</p>\r\n\r\n<p align="center"><img alt="Ford Everest 2018 chnh thc ra mt ti Vit Nam vi mc gi t 1,12 t, ng c 2.0 tng p, hp s 10 cp th h mi" src="http://carontrade.com/upload/images/Ford-Everest-2018-chinh-thuc-ra-mat-tai-viet-nam-2.jpg" /><br />\r\n</p>\r\n\r\n<p>Cu truc khung vo ca xe c thit k rt chc chn, tang kha nang chiu va p, xon vn. S dung thep Boron sieu cng, co  chiu lc cao va nhe hon 10-15% thep chiu lc thong thung giup giam trong lung xe. Xe c khoang hnh l c thit k rng ri, khi gp ht cc hng gh pha sau, dung tch cha , hnh l ca xe c th ln n 2.010 lit.<br />\r\n</p>\r\n\r\n<p align="center"><img alt="Ford Everest 2018 chnh thc ra mt ti Vit Nam vi mc gi t 1,12 t, ng c 2.0 tng p, hp s 10 cp th h mi" src="http://carontrade.com/upload/images/Ford-Everest-2018-chinh-thuc-ra-mat-tai-viet-nam-3.jpg" /><br />\r\n</p>\r\n\r\n<p>Ngoi ra, h thng treo trc ca xe c thit k c lp, cnh tay ca xe n kp, l xo xon tr c kch thc ln, thanh cn bng ngang. ng thi, h thng treo sau cng c trang b l xo tr c lp kt hp cng c cu thanh n nh lin kt kiu Watts linkage.<br />\r\n</p>\r\n\r\n<p align="center"><img alt="Ford Everest 2018 chnh thc ra mt ti Vit Nam vi mc gi t 1,12 t, ng c 2.0 tng p, hp s 10 cp th h mi" src="http://carontrade.com/upload/images/Ford-Everest-2018-chinh-thuc-ra-mat-tai-viet-nam-4.jpg" /><br />\r\n</p>\r\n\r\n<p>Hc hut gio c thit k ln cng vi lui kiu dng dang t ong c n sau cac ung vin chrome nhin kh thanh thoat. Can xe pha trc cng c thit k goc canh kt hp vi tm p th thao ln dang canh en gip tao im nhn v tang dang th thao, mang m tnh cch manh me cua dong xe SUV.<br />\r\n</p>\r\n\r\n<p align="center"><img alt="Ford Everest 2018 chnh thc ra mt ti Vit Nam vi mc gi t 1,12 t, ng c 2.0 tng p, hp s 10 cp th h mi" src="http://carontrade.com/upload/images/Ford-Everest-2018-chinh-thuc-ra-mat-tai-viet-nam-5.jpg" /><br />\r\n</p>\r\n\r\n<p>Mt trong nhng im ng ch  nht trn Ford Everest 2018  l h thng n pha chun HID trn bn Titanium c kh nng t ng iu chnh gc chiu, t ng kch hot chiu sng khi tri ti, khi khng c n ng, khong co xe ang chy nguc chiu va khi tc  xe ln hon 40Km/h.<br />\r\n</p>\r\n\r\n<p align="center"><img alt="Ford Everest 2018 chnh thc ra mt ti Vit Nam vi mc gi t 1,12 t, ng c 2.0 tng p, hp s 10 cp th h mi" src="http://carontrade.com/upload/images/Ford-Everest-2018-chinh-thuc-ra-mat-tai-viet-nam-6.jpg" /><br />\r\n</p>\r\n\r\n<p>n cn c kh nng t ng chuyn sang ch  chiu gn khi phat hin co xe i nguc chiu, co anh sang en ung va khi tc  xe giam xung dui 25Km/h. n LED nh v hin i.<br />\r\n</p>\r\n\r\n<p align="center"><img alt="Ford Everest 2018 chnh thc ra mt ti Vit Nam vi mc gi t 1,12 t, ng c 2.0 tng p, hp s 10 cp th h mi" src="http://carontrade.com/upload/images/Ford-Everest-2018-chinh-thuc-ra-mat-tai-viet-nam-7.jpg" /><br />\r\n</p>\r\n\r\n<p>Ring trn bn Ford Everest phin bn Titanium c trang b cng ngh cnh bo va chm trc (ting Anh gi l Pre-Collision), kt hp cng h thng phanh t ng khn cp (AEB  In-urban Autonomous Emergency Braking) gip cho xe t ng dng hn trong mi iu kin c chng ngi vt, hot ng trn di tc  t 5km/h n 80km/h.<br />\r\n</p>\r\n\r\n<p align="center"><img alt="Ford Everest 2018 chnh thc ra mt ti Vit Nam vi mc gi t 1,12 t, ng c 2.0 tng p, hp s 10 cp th h mi" src="http://carontrade.com/upload/images/Ford-Everest-2018-chinh-thuc-ra-mat-tai-viet-nam-8.jpg" /><br />\r\n</p>\r\n\r\n<h2 style="line-height:24px"><strong>Khoang ni tht</strong><br />\r\n</h2>\r\n\r\n<p>Khoang ni tht Everest s hu phong cch thit k mnh m c trng vn c trn cc mu xe gm cao ca Ford. C 5 phin bn Everest 2018 u c trang b gh ngi bc da, bng tablo cng c bc da v nha cao cp em n v sang chnh ca mt dng xe SUV.<br />\r\n</p>\r\n\r\n<p align="center"><img alt="Ford Everest 2018 chnh thc ra mt ti Vit Nam vi mc gi t 1,12 t, ng c 2.0 tng p, hp s 10 cp th h mi" src="http://carontrade.com/upload/images/Ford-Everest-2018-chinh-thuc-ra-mat-tai-viet-nam-9.jpg" /><br />\r\n</p>\r\n\r\n<p>Hang gh sau th 2 ca xe uc thit k rng rai, tin nghi va linh hot, ngi dng co th iu chinh trut tin lui,  nga ta lung va gp uc khi cn thit.<br />\r\n</p>\r\n\r\n<p align="center"><img alt="Ford Everest 2018 chnh thc ra mt ti Vit Nam vi mc gi t 1,12 t, ng c 2.0 tng p, hp s 10 cp th h mi" src="http://carontrade.com/upload/images/Ford-Everest-2018-chinh-thuc-ra-mat-tai-viet-nam-10.jpg" /><br />\r\n</p>\r\n\r\n<p>Cm ng h ca dng xe Ford Everest 2018 c hng thit k li nhm gip hin th thm nhiu thng tin hn n cho ngi li, nt bm khi ng cng chia kha thng minh cng c tch hp.<br />\r\n</p>\r\n\r\n<p align="center"><img alt="Ford Everest 2018 chnh thc ra mt ti Vit Nam vi mc gi t 1,12 t, ng c 2.0 tng p, hp s 10 cp th h mi" src="http://carontrade.com/upload/images/Ford-Everest-2018-chinh-thuc-ra-mat-tai-viet-nam-11.jpg" /><br />\r\n</p>\r\n\r\n<h2 style="line-height:24px"><strong>Tin nghi</strong><br />\r\n</h2>\r\n\r\n<p>C 5 phin bn Ford Everest 2018 u c trang b h thng gii tr vi mn hnh cm ng kch thc 8 inch i km h thng m thanh ni 10 loa, h tr Apple CarPlay/Android Auto, kt ni Bluetooth/USB/AUX v c tch hp cng ngh SYNC 3 mi nht.<br />\r\n</p>\r\n\r\n<p align="center"><img alt="Ford Everest 2018 chnh thc ra mt ti Vit Nam vi mc gi t 1,12 t, ng c 2.0 tng p, hp s 10 cp th h mi" src="http://carontrade.com/upload/images/Ford-Everest-2018-chinh-thuc-ra-mat-tai-viet-nam-12.jpg" /><br />\r\n</p>\r\n\r\n<p>Qua , h thng SYNC 3 ny cn cho php kt ni vi in thoi thng minh thng qua phn mm Android Auto v Apple CarPlay tch hp tnh nng dn ng bng h thng nh v ton cu.<br />\r\n</p>\r\n\r\n<p align="center"><img alt="Ford Everest 2018 chnh thc ra mt ti Vit Nam vi mc gi t 1,12 t, ng c 2.0 tng p, hp s 10 cp th h mi" src="http://carontrade.com/upload/images/Ford-Everest-2018-chinh-thuc-ra-mat-tai-viet-nam-13.jpg" /><br />\r\n</p>\r\n\r\n<p>Ford Everest 2018 s hu h thng iu hoa t ng, kt hp cng vi chc nang sy gh va hai dn lanh c lp cung h thng ca gio cho mi hang gh kh tin nghi trn bn Titanium. Tuy nhin, phin bn Trend li khng c trang b tnh nng sy gh.<br />\r\n</p>\r\n\r\n<p align="center"><img alt="Ford Everest 2018 chnh thc ra mt ti Vit Nam vi mc gi t 1,12 t, ng c 2.0 tng p, hp s 10 cp th h mi" src="http://carontrade.com/upload/images/Ford-Everest-2018-chinh-thuc-ra-mat-tai-viet-nam-14.jpg" /><br />\r\n</p>\r\n\r\n<p>H thng gii tr trn xe bao gm 10 loa, tch hp 1 loa siu trm (subwoofer), trn xe tch hp ca s tri Panoramic. Phin bn Titanium c trang b  ngun in xoay chiu (AC) 230V  150W.<br />\r\n</p>\r\n\r\n<h2 style="line-height:24px"><strong>ng c v kh nng vn hnh</strong><br />\r\n</h2>\r\n\r\n<p>V trang b sc mnh, phin bn cao cp Ford Everest Titanium 2.0L AT 4WD uc trang bi ng co Diesel 2.0L i4 Bi-Turbo (Turbo kp) san sinh ra cong sut ti a 213 PS va mo-men xon cc ai t 500 Nm.<br />\r\n</p>\r\n\r\n<p align="center"><img alt="Ford Everest 2018 chnh thc ra mt ti Vit Nam vi mc gi t 1,12 t, ng c 2.0 tng p, hp s 10 cp th h mi" src="http://carontrade.com/upload/images/Ford-Everest-2018-chinh-thuc-ra-mat-tai-viet-nam-15.jpg" /><br />\r\n</p>\r\n\r\n<p>ng co mi nay c Ford trang b em n sc manh ln hon ca ng co Diesel 3.2L i5 (200 ma lc, 470 Nm) so vi cc dng xe khc.<br />\r\n</p>\r\n\r\n<p align="center"><img alt="Ford Everest 2018 chnh thc ra mt ti Vit Nam vi mc gi t 1,12 t, ng c 2.0 tng p, hp s 10 cp th h mi" src="http://carontrade.com/upload/images/Ford-Everest-2018-chinh-thuc-ra-mat-tai-viet-nam-16.jpg" /><br />\r\n</p>\r\n\r\n<p>Ngoi ra, trn cc phin bn khc u c trang b ng c 2.0L Turbo n c cng sut 180 PS, m-men xon cc i t 420 Nm. Tt c cc Ford Everest 2018 bn s t ng u i km hp s 10 cp trong khi bn s sn dng hp s 6 cp.<br />\r\n</p>\r\n\r\n<p align="center"><img alt="Ford Everest 2018 chnh thc ra mt ti Vit Nam vi mc gi t 1,12 t, ng c 2.0 tng p, hp s 10 cp th h mi" src="http://carontrade.com/upload/images/Ford-Everest-2018-chinh-thuc-ra-mat-tai-viet-nam-17.jpg" /><br />\r\n</p>\r\n\r\n<h2 style="line-height:30px"><strong>Cc tnh nng an ton</strong><br />\r\n</h2>\r\n\r\n<p>Ford Everest 2018 u c trang b cc cng ngh gip h tr li xe an ton ging nh cc phin bn trc  bao gm: cng ngh chng n ch ng, h thng gip kim sot a hnh, h thng cnh bo ln ng, h thng cnh bo va chm pha trc xe, h thng cnh bo khi li xe, n pha t ng bt tt, h thng cnh bo im m v kt hp vi cnh bo c xe ct ngang, camera li cng vi cm bin.<br />\r\n</p>\r\n\r\n<p align="center"><img alt="Ford Everest 2018 chnh thc ra mt ti Vit Nam vi mc gi t 1,12 t, ng c 2.0 tng p, hp s 10 cp th h mi" src="http://carontrade.com/upload/images/Ford-Everest-2018-chinh-thuc-ra-mat-tai-viet-nam-18.jpg" /><br />\r\n</p>\r\n\r\n<p>Tuy nhin, trn phin bn cao cp Ford Everest Titanium 2.0L AT 4WD cn c u i tch hp thm 3 tnh nng mi nh: cng ngh cnh bo va chm pha trc kt hp phanh t ng khn cp, h thng kim sot hnh trnh thch ng, h thng kim sot p sut lp, h tr  xe t ng. C 5 phin bn u c trang b 7 ti kh an ton.</p>\r\n\r\n<p></p>\r\n\r\n<p>Hin ti, Ford Vit Nam  cho php khch hng t xe sau ngay ra mt. D kin th gia thng 9/2018, Ford Everest s c mt ti cc i l ca Ford Vit Nam.</p>\r\n\r\n<p></p>\r\n\r\n<p>Mc gi bn c th nh sau:</p>\r\n\r\n<p>- Everest phin bn Ambiente 2.0L Turbo 6MT 4x2: cha cng b.</p>\r\n\r\n<p>-Everest phin bn Ambiente 2.0L Turbo 10AT 4x2: 1,112 t.</p>\r\n\r\n<p>-Everest phin bn Trend 2.0L Turbo 10AT 4x2: 1,112 t.</p>\r\n\r\n<p>-Everest phin bn Titanium 2.0L Turbo 10AT 4x2: 1,177 t.</p>\r\n\r\n<p>-Everest phin bn Titanium 2.0L Bi-Turbo 10AT 4x4: 1,399 t.</p>\r\n\r\n<p>                                                                                      <em></em><span style="font-size: 14px; text-align: justify;">CarOntrade</span><em> - nh: Tinhte.vn</em></p>\r\n</div>\r\n', 'ford-everest-2018-chinh-thuc-ra-mat-tai-viet-nam-5-1770.jpg', 'ford-everest-2018-chinh-thuc-ra-mat-tai-viet-nam-58282_170x110.jpg', 1, 1, 1535645122, 1535718731, 'Ford Everest 2018 chnh thc ra mt ti Vit Nam vi mc gi t 1,12 t, ng c 2.0 tng p, hp s', 'Ford Everest 2018 chnh thc ra mt ti Vit Nam', 'Mi y, Ford Everest 2018 va c chnh thc ra mt ti Vit Nam vi 5 phin bn, bao gm 1 bn s sn cng 4 phin bn s t ng. im hp dn nht trn Ford Everest 2018  l mc gi bn hp dn', '', '', '', 'tin-tuc', 0, 0, 0, '', '', ''),
(101, 0, 1, 'Nhng thi quen ph xe ca ti x d gy h hi cho  t', 'nhung-thoi-quen-pha-xe-cua-tai-xe-de-gay-hu-hai-cho-o-to', 'Trong qu trnh s dng xe  t, d v tnh hay c  th ngi dng thng xuyn mc nhng thi quen nh hng nghim trng n chic xe  t ca mnh theo thi gian, vi nhiu triu chng kh chu v ng c, li vt, lm gim tui th v tng chi ph sa cha khng ng c. Hy cng CarOntrade im danh nhng thi quen ph xe ca ti x d gy h hi cho  t  bit thm kin thc v khc phc nhanh chng nh!\r\n\r\n', '<div style="text-align:justify; font-size:14px; line-height:25px;">\r\n<p><br />\r\nTrong qu trnh s dng xe  t, d v tnh hay c  th ngi dng thng xuyn mc nhng thi quen nh hng nghim trng n chic xe  t ca mnh theo thi gian, vi nhiu triu chng kh chu v ng c, li vt, lm gim tui th v tng chi ph sa cha khng ng c.</p>\r\n\r\n<p></p>\r\n\r\n<p>Hy cng CarOntrade im danh nhng thi quen ph xe ca ti x d gy h hi cho  t  bit thm kin thc v khc phc nhanh chng nh!<br />\r\n</p>\r\n\r\n<p></p>\r\n\r\n<h2 style="line-height:30px"><strong>1. Khng thay lp xe nh k</strong><br />\r\n</h2>\r\n\r\n<p>Lp xe l mt trong b phn quan trng nht gip m bo  an ton ca xe trong qu trnh vn hnh trn ng. Nu xy ra nhng trng hp n lp  t th s dn n nhng tai nn nguy him n chnh mnh v c nhng ngi xung quanh, c bit l khi chy xe trn cao tc vi tc  cao.<br />\r\n</p>\r\n\r\n<p style="text-align:center"><img alt="Nhng thi quen ph xe ca ti x d gy h hi cho  t" src="http://carontrade.com/upload/images/sai-lam-khi-su-dung-xe-oto-1.jpg" /></p>\r\n\r\n<p><br />\r\nVi nhng lp xe  t b mi mn, th cc du hiu  bn nhn bit nh: vt nt trn lp s bt u xut hin, lm cho tay li b rung trong qu trnh vn hnh, v thanh ch  mn trn lp xe  t bt u xut hin c th khin cho lp b n t ngt.<br />\r\n</p>\r\n\r\n<p style="text-align:center"><img alt="Nhng thi quen ph xe ca ti x d gy h hi cho  t" src="http://carontrade.com/upload/images/sai-lam-khi-su-dung-xe-oto-2.png" /></p>\r\n\r\n<p><br />\r\nChnh v vy, nu thy xut hin cc du hiu nh trn, bn nn ngay lt tc i n cc trung tm bo hnh chnh hng, hoc  nhng ni cung cp lp xe  t uy tn  c h tr thay lp xe  t ng cch.<br />\r\n</p>\r\n\r\n<p style="text-align:center"><img alt="Nhng thi quen ph xe ca ti x d gy h hi cho  t" src="http://carontrade.com/upload/images/sai-lam-khi-su-dung-xe-oto-3.jpg" /></p>\r\n\r\n<h2 style="line-height:30px"><br />\r\n<strong>2. Lin tc r ga khi mi khi ng xe</strong><br />\r\n</h2>\r\n\r\n<p>Mt trong nhng sai lm c bn ca ngi li xe  t khi khi ng xe  l n my, ln ga, r ga v i ngay. iu ny nh hng nghim trng n cc ph tng bn trong xe v khin chng b hao mn trong khong thi gian nht nh.<br />\r\n</p>\r\n\r\n<p style="text-align:center"><img alt="Nhng thi quen ph xe ca ti x d gy h hi cho  t" src="http://carontrade.com/upload/images/sai-lam-khi-su-dung-xe-oto-4.jpg" /></p>\r\n\r\n<p><br />\r\nBi v khi n my, xe cn thi gian  lm nng n nhit  l tng cho vic vn hnh, cc chi tit ca xe cn c bi trn hon ton  gip cho vic vn hnh ca xe trn tru v hiu qu hn.<br />\r\n</p>\r\n\r\n<p style="text-align:center"><img alt="Nhng thi quen ph xe ca ti x d gy h hi cho  t" src="http://carontrade.com/upload/images/sai-lam-khi-su-dung-xe-oto-5.jpg" /></p>\r\n\r\n<h2 style="line-height:30px"><br />\r\n<strong>3. R phanh lin tc khi  dc</strong></h2>\r\n\r\n<p><br />\r\nTrn cc cung ng o dc, th b phn phanh xe ng vai tr cc k quan trng. Vic r phanh lin tc khi  dc c th gip cho xe gim tc , nhng nu bn r phanh qu nhiu v lin tc trong khong thi gian ngn th s khin cho m phanh b ma st, h thng phanh xe nng ln, du phanh si lin tc khin cho phanh d t, hng v mt thng.<br />\r\n</p>\r\n\r\n<p style="text-align:center"><img alt="Nhng thi quen ph xe ca ti x d gy h hi cho  t" src="http://carontrade.com/upload/images/sai-lam-khi-su-dung-xe-oto-6.jpg" /></p>\r\n\r\n<p><br />\r\nBi vy, khi  o, dc th bn nn chuyn xe v cc cp s thp  tn dng vic nguyn l hm phanh theo cch m phanh ng c v khng cn p phanh nhiu. Cn i vi cc loi xe  t s t ng, th bn nn tn dng ch  chuyn s tay, s gip cho bn ch ng iu chnh cc cp s.<br />\r\n</p>\r\n\r\n<p style="text-align:center"><img alt="Nhng thi quen ph xe ca ti x d gy h hi cho  t" src="http://carontrade.com/upload/images/sai-lam-khi-su-dung-xe-oto-7.jpg" /></p>\r\n\r\n<h2 style="line-height:30px"><br />\r\n<strong>4. Thng xuyn  bnh nhin liu trong tnh trng cn</strong></h2>\r\n\r\n<p><br />\r\nVic  bnh cha nhin liu xe  t thng xuyn trng tnh trng cn, sp cn, kim xng bo vch  v lu di s gy tn hi ln n cc chi tit trong ng c v ph tng. Ngoi ra, nu  bnh nhin liu trong tnh trng pht sng mi  xng vo, th s lm nh hng n h thng ny.</p>\r\n\r\n<p style="text-align:center"><img alt="Nhng thi quen ph xe ca ti x d gy h hi cho  t" src="http://carontrade.com/upload/images/sai-lam-khi-su-dung-xe-oto-8.jpg" /></p>\r\n\r\n<p><br />\r\nChi tit hn, thng cha nhin liu bng kim loi trong s c xu hng ng cn khi mc nhin liu trong tnh trang thp. V khi , cn b s b ht trong bnh xng c th bm vo cc b lc, khin b lc b nghn, ng cn gy nght bm, kim phun, nh hng nghim trng n bung t lm cho xe kh khn hn trong qu trnh khi ng.<br />\r\n</p>\r\n\r\n<p style="text-align:center"><img alt="Nhng thi quen ph xe ca ti x d gy h hi cho  t" src="http://carontrade.com/upload/images/sai-lam-khi-su-dung-xe-oto-9.jpg" /></p>\r\n\r\n<h2 style="line-height:30px"><br />\r\n<strong>5. Ko phanh tay sau khi i tri ma</strong></h2>\r\n\r\n<p><br />\r\nXe  t va hot ng trong iu kin tri ma to th cc phanh rt d b tn thng nht. V c cu phanh  v tr thp nn bn t v nc rt d xm nhp vo.<br />\r\n</p>\r\n\r\n<p style="text-align:center"><img alt="Nhng thi quen ph xe ca ti x d gy h hi cho  t" src="http://carontrade.com/upload/images/sai-lam-khi-su-dung-xe-oto-10.jpg" /></p>\r\n\r\n<p><br />\r\nNgoi ra, i vi phanh tay dng tang trng sau khi i tri ma v m bn ko  qua m th s c hin tng cc m phanh p st tng-bua, kh nh tr li khi bn nh phanh.  khc phc, bn chn cc vt dng cng  gi nguyn v tr xe thay v ko phanh tay nh thi quen.<br />\r\n</p>\r\n\r\n<p style="text-align:center"><img alt="Nhng thi quen ph xe ca ti x d gy h hi cho  t" src="http://carontrade.com/upload/images/sai-lam-khi-su-dung-xe-oto-11.jpg" /></p>\r\n\r\n<h2 style="line-height:30px"><br />\r\n<strong>6. Qun thay du ng c</strong></h2>\r\n\r\n<p><br />\r\nMt thi quen m a s ngi Vit u mc phi khi s hu mt chic xe  t v chy chng l qun thay du ng c ng hn. Hu qu ca vic qun thay du ng c sau khi chy ng km nht nh  l lm nh hng n cc chi tit ng c, hnh thnh cc khe h trong khoang ng c dn n du bi trn d lt vo bung t v khng chy ht, to mui than v ph hy ng c. ng thi, nu thiu i  bi trn, th cc chi tit kim loi d b bo mn v gy h hi.<br />\r\n</p>\r\n\r\n<p style="text-align:center"><img alt="Nhng thi quen ph xe ca ti x d gy h hi cho  t" src="http://carontrade.com/upload/images/sai-lam-khi-su-dung-xe-oto-12.jpg" /></p>\r\n\r\n<p><br />\r\nChnh v vy, sau mi 5000  8000km th bn nn thay du ng c ngay nu c th  xay vn hnh tt hn.<br />\r\n</p>\r\n\r\n<p style="text-align:center"><img alt="Nhng thi quen ph xe ca ti x d gy h hi cho  t" src="http://carontrade.com/upload/images/sai-lam-khi-su-dung-xe-oto-13.jpg" /></p>\r\n\r\n<p><br />\r\nHy vng qua 6 thi quen c hi cho xe  t m CarOntrade  nu ra trong bi vit trn s gip bn c thm c kin thc trong vic bo dng v li xe ng cch gip cho mi chng ng an ton v vui v hn.<br />\r\n</p>\r\n</div>\r\n', 'sai-lam-khi-su-dung-xe-oto-5-4550.jpg', 'sai-lam-khi-su-dung-xe-oto-54790_170x106.jpg', 1, 1, 1535702689, 1535718716, 'Nhng thi quen ph xe ca ti x d gy h hi cho  t', 'sai lm khi dng xe  t', 'Trong qu trnh s dng xe  t, d v tnh hay c  th ngi dng thng xuyn mc nhng thi quen nh hng nghim trng n chic xe  t ca mnh theo thi gian, vi nhiu triu chng kh chu v', '', '', '', 'tin-tuc', 0, 0, 0, '', '', '');
