(62, 0, 1, 'Nhng trng hp tin ng ca bn b t chi', 'nhung-truong-hop-tin-dang-cua-ban-bi-tu-choi', ' trnh tin ng ca bn b t chi, bn hy b ra mt t  c Quy nh ng tin nh.\r\n\r\n\r\n\r\nDi y l nhng trng hp tin ca bn c th b t chi:\r\n\r\n\r\n\r\nTrng hp 1: Tin ng b trng lp\r\n\r\n  \r\n\r\n - Tin ng b xem l trng lp nu bn ng bn mt chic xe trn CarOntrade ging vi chic xe bn  ng bn trc .', '<p></p>\r\n\r\n<p><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;">Di y l nhng trng hp tin ca bn c th b t chi:</span></span></p>\r\n\r\n<p></p>\r\n\r\n<p><strong><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;">Trng hp 1: Tin ng b trng lp</span></span></strong></p>\r\n\r\n<p><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;"> </span></span></p>\r\n\r\n<p><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;">- Tin ng b xem l trng lp nu bn ng bn mt chic xe trn CarOntrade ging vi chic xe bn  ng bn trc .</span></span></p>\r\n\r\n<p><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;"> </span></span></p>\r\n\r\n<p><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;">- Trong trng hp bn cha bn c xe v mun bn nhanh hn, bn c th s tnh nng <strong><a href="http://carontrade.com/tro-giup/tinh-nang-day-tin-la-gi.html" target="_blank">y tin</a></strong>  tin bn c hin th u tin hn so vi nhng tin khc.</span></span></p>\r\n\r\n<p></p>\r\n\r\n<p><strong><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;">Trng hp 2: S dng hnh nh ti t trn mng hoc ca ngi khc</span></span></strong></p>\r\n\r\n<p><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;"> </span></span></p>\r\n\r\n<p><span style="font-size:16px;"><span style="font-family:times new roman,times,serif;">-Hnh nh khng trung thc, s dng hnh nh t trn mng, hoc copy ca ngi khc u s khin cho tin ng ca bn b C