(1, 0, 1, 'S t i thi t sng sm, nhiu tuyn ng n ', 'ten-khong-dau', 'Dasha Gold l hot blogger hng u th gii. Bt c trang phc no fashionista ny khoc ln ngi cng to ln sng like mnh m, c bit l cc kiu phi  en trng cht l.', '<div class="summary zing">\r\n<p>S&aacute;ng sm nay, mt s tuyn ng quanh H Quc gia H&agrave; Ni &ugrave;n  do lng ngi  v &ocirc;ng trong ng&agrave;y u thi i hc bng &aacute;nh gi&aacute; nng lc.</p>\r\n</div>\r\n<div class="content">\r\n<table class="picture" cellspacing="0" cellpadding="0">\r\n<tbody>\r\n<tr>\r\n<td class="pic"><img src="http://img.v3.news.zdn.vn/w660/Uploaded/jbvunte/2015_05_30/1_zing.JPG" alt="S t i thi t s&aacute;ng sm, nhiu tuyn ng &ugrave;n " /></td>\r\n</tr>\r\n<tr>\r\n<td class="pCaption caption">6h s&aacute;ng nay, 30/5, &ocirc;ng th&iacute; sinh  v i hc Quc gia H&agrave; Ni l&agrave;m thi &aacute;nh gi&aacute; nng lc. Nhiu tuyn ng &ugrave;n tc v&igrave; lng xe tham gia giao th&ocirc;ng tng.</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<table class="picture" cellspacing="0" cellpadding="0">\r\n<tbody>\r\n<tr>\r\n<td class="pic"><img src="http://img.v3.news.zdn.vn/w660/Uploaded/jbvunte/2015_05_30/2_zing_1.JPG" alt="S t i thi t s&aacute;ng sm, nhiu tuyn ng &ugrave;n " /></td>\r\n</tr>\r\n<tr>\r\n<td class="pCaption caption">Trong khu&ocirc;n vi&ecirc;n i hc Quc gia H&agrave; Ni, ngi nh&agrave; v&agrave; th&iacute; sinh phi dt xe.</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<table class="picture" cellspacing="0" cellpadding="0">\r\n<tbody>\r\n<tr>\r\n<td class="pic"><img src="http://img.v3.news.zdn.vn/w660/Uploaded/jbvunte/2015_05_30/3_zing.JPG" alt="S t i thi t s&aacute;ng sm, nhiu tuyn ng &ugrave;n " /></td>\r\n</tr>\r\n<tr>\r\n<td class="pCaption caption">n trng thi, th&iacute; sinh c lc lng sinh vi&ecirc;n t&igrave;nh nguyn h tr nhit t&igrave;nh.&nbsp;</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<table class="picture" cellspacing="0" cellpadding="0">\r\n<tbody>\r\n<tr>\r\n<td class="pic"><img src="http://img.v3.news.zdn.vn/w660/Uploaded/jbvunte/2015_05_30/4_zing_1.JPG" alt="S t i thi t s&aacute;ng sm, nhiu tuyn ng &ugrave;n " /></td>\r\n</tr>\r\n<tr>\r\n<td class="pCaption caption">Nhiu th&iacute; sinh n sm, tranh th xem li b&agrave;i c, chun b trc gi thi.</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<table class="picture" cellspacing="0" cellpadding="0">\r\n<tbody>\r\n<tr>\r\n<td class="pic"><img src="http://img.v3.news.zdn.vn/w660/Uploaded/jbvunte/2015_05_30/5_zing.JPG" alt="S t i thi t s&aacute;ng sm, nhiu tuyn ng &ugrave;n " /></td>\r\n</tr>\r\n<tr>\r\n<td class="pCaption caption">N&eacute;t cng thng tho&aacute;ng hin tr&ecirc;n khu&ocirc;n mt s t...</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<table class="picture" cellspacing="0" cellpadding="0">\r\n<tbody>\r\n<tr>\r\n<td class="pic"><img src="http://img.v3.news.zdn.vn/w660/Uploaded/jbvunte/2015_05_30/6_zing_1.JPG" alt="S t i thi t s&aacute;ng sm, nhiu tuyn ng &ugrave;n " /></td>\r\n</tr>\r\n<tr>\r\n<td class="pCaption caption">V&igrave; &acirc;y l&agrave; k thi i mi to&agrave;n din n&ecirc;n nhiu em c&ograve;n b ng, lo lng. S kh&aacute;c mt mi do thi tit nng n&oacute;ng.&nbsp;</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</div>', 'gia-mot-so-dong-dien-thoai-samsung-dang-hot-tai-viet-nam-7128.jpg', 'gia-mot-so-dong-dien-thoai-samsung-dang-hot-tai-viet-nam5456_170x128.jpg', 1, 1, 1432955938, 0, '', '', '', '', '', '', 'tintuc'),
(2, 0, 1, 'ng Nhi ln u biu din trn sn khu Vietnam Idol', 'ten-khong-dau', 'Dasha Gold l hot blogger hng u th gii. Bt c trang phc no fashionista ny khoc ln ngi cng to ln sng like mnh m, c bit l cc kiu phi  en trng cht l.', '<div class="summary zing">\r\n<p>Tng d thi v&agrave; b loi sm  nm 2007, trong &ecirc;m c&ocirc;ng b kt qu Gala 1 sp ti, ngi y&ecirc;u ca ca s in trai &Ocirc;ng Cao Thng c&oacute; dp t&aacute;i ng chng tr&igrave;nh vi vai tr&ograve; kh&aacute;ch mi.</p>\r\n</div>\r\n<div class="content">\r\n<p>Ln u xut hin tr&ecirc;n s&acirc;n khu Vietnam Idol, &ocirc;ng Nhi chia s, c&ocirc; cm thy rt h&agrave;o hng, phn kh&iacute;ch. Ging ca&nbsp;<em>Bad boy</em>&nbsp;bc bch: &ldquo;Nh mi ngi bit, cuc thi n&agrave;y l&agrave; ni t&ocirc;i tng th sc khi cha theo ui con ng ca h&aacute;t chuy&ecirc;n nghip. Tuy kh&ocirc;ng th&agrave;nh c&ocirc;ng, nhng &oacute; l&agrave; mt tri nghim kh&oacute; qu&ecirc;n i vi bn th&acirc;n. Th n&ecirc;n, l&uacute;c nhn li mi t ban t chc, t&ocirc;i ng &yacute; ngay v&agrave; mong ch n gi&acirc;y ph&uacute;t c tr&igrave;nh din&rdquo;.</p>\r\n<p>L&agrave; mt trong nhng ca s ti&ecirc;n phong bc ra t th gii mng, song vi s n lc, s&aacute;ng to kh&ocirc;ng ngng, &ocirc;ng Nhi sm c&oacute; v tr&iacute; vng chc  l&agrave;ng nhc Vit. Hin, c&ocirc; s hu lng kh&aacute;n gi h&acirc;m m &ocirc;ng nht nh&igrave; Vpop, cng nh tr th&agrave;nh c&aacute;i t&ecirc;n quen thuc ti hu ht c&aacute;c gii thng &acirc;m nhc ln nh.</p>\r\n<table class="picture" cellspacing="0" cellpadding="0">\r\n<tbody>\r\n<tr>\r\n<td class="pic"><img src="http://img.v3.news.zdn.vn/w660/Uploaded/wopthuo/2015_05_29/Dong_Nhi_zing.jpg" alt="Ca s &ocirc;ng Nhi. nh: An Trn" /></td>\r\n</tr>\r\n<tr>\r\n<td class="pCaption caption">\r\n<p>Ca s &ocirc;ng Nhi. nh:&nbsp;<em><strong>An Trn</strong></em></p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p>N&oacute;i v b&iacute; quyt th&agrave;nh c&ocirc;ng ca m&igrave;nh, n ca s sinh nm 1988 t&acirc;m s: &ldquo;iu t&ocirc;i r&uacute;t ra c trong chng ng m&agrave; bn th&acirc;n &atilde; i qua l&agrave; khi quyt t&acirc;m theo ui am m&ecirc;, bn phi sng ht m&igrave;nh c&ugrave;ng n&oacute;, sn s&agrave;ng i mt v&agrave; vt qua mi kh&oacute; khn, th th&aacute;ch. B&ecirc;n cnh t&agrave;i nng, s chm ch, chu kh&oacute; l&agrave; yu t quan trng cn c&oacute;&rdquo;.</p>\r\n<p>Ngo&agrave;i ra, &ldquo;mt na&rdquo; ca &Ocirc;ng Cao Thng cho rng,  i n nh th&agrave;nh c&ocirc;ng, bt k ai cng phi tri qua qu&aacute; tr&igrave;nh phn u l&acirc;u d&agrave;i. C&ocirc; nh&igrave;n nhn vic c gng hc hi, ho&agrave;n thin bn th&acirc;n mi ng&agrave;y kh&ocirc;ng bao gi l&agrave; tha.</p>\r\n<p>Chia s cm nhn v Thn tng &acirc;m nhc Vit Nam m&ugrave;a 6 ln c&aacute;c th&iacute; sinh c&oacute; mt trong top 8, n din vi&ecirc;n&nbsp;<em>Gii cu thn cht</em>&nbsp;cho bit: &ldquo;Do lch din d&agrave;y c, t&ocirc;i kh&ocirc;ng th theo d&otilde;i k cuc thi nm nay, tuy nhi&ecirc;n, bn th&acirc;n c&oacute; xem li tin tc tr&ecirc;n c&aacute;c trang b&aacute;o mng v&agrave; phn thi n tng ca mt s bn  k&ecirc;nh YouTube. T&ocirc;i thy chng tr&igrave;nh nm nay c&oacute; nhiu thay i th&uacute; v. Phong c&aacute;ch &acirc;m nhc ca c&aacute;c th&iacute; sinh hin i, a m&agrave;u sc hn hn&rdquo;.</p>\r\n<p>Vi vai tr&ograve; ca s kh&aacute;ch mi, &ocirc;ng Nhi s th hin li b&agrave;i h&aacute;t m&agrave; c&ocirc; tng song ca c&ugrave;ng gi&aacute;m kho Thu Minh. C&ocirc; cng b&agrave;y t s tic nui bi bn th&acirc;n kh&ocirc;ng th biu din trc tip cho &agrave;n ch xem.</p>\r\n<table class="picture" cellspacing="0" cellpadding="0">\r\n<tbody>\r\n<tr>\r\n<td class="pic"><img src="http://img.v3.news.zdn.vn/w660/Uploaded/wopthuo/2015_05_29/Top_8_Vietnam_Idol_2015.jpg" alt=" Top 8 Vietnam Idol 2015. nh: BHD" /></td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</div>', 'sony-xperia-sola-root-updated-2738.jpg', 'sony-xperia-sola-root-updated3898_170x128.jpg', 1, 0, 1432955992, 0, '', '', '', '', '', '', 'tintuc'),
(3, 0, 1, 'My Trng tung nh gi cm ti xut Vpop', 'ten-khong-dau', 'Dasha Gold l hot blogger hng u th gii. Bt c trang phc no fashionista ny khoc ln ngi cng to ln sng like mnh m, c bit l cc kiu phi  en trng cht l.', '<div class="summary zing">\r\n<p>Kh&ocirc;ng ch xut hin vi h&igrave;nh nh ni lon, c&aacute; t&iacute;nh, 3 th&agrave;nh vi&ecirc;n ca nh&oacute;m nhc n c&ograve;n tuy&ecirc;n b s ra mt nhiu sn phm &acirc;m nhc c &aacute;o.</p>\r\n</div>\r\n<div class="content">\r\n<p>M&acirc;y Trng l&agrave; mt trong nhng nh&oacute;m nhc n th&agrave;nh c&ocirc;ng v&agrave; c&oacute; sc nh hng ln n th h 8X, 9X ti Vit Nam nhng nm 2000. Ngay t khi th&agrave;nh lp, nh&oacute;m c&oacute; 5 th&agrave;nh vi&ecirc;n gm Anh Th&uacute;y, Thu Thy, Yn Trang, Thu Ngc v&agrave; Ngc Ch&acirc;u, x&acirc;y dng h&igrave;nh nh trong s&aacute;ng, nh nh&agrave;ng v&agrave; n t&iacute;nh.<br />Nm 2001, Anh Th&uacute;y t&aacute;ch nh&oacute;m u ti&ecirc;n, Yn Nhi (em rut ca Yn Trang) gia nhp, M&acirc;y Trng gi vng con s 5 th&agrave;nh vi&ecirc;n. Nm 2002, Thu Thy t&aacute;ch ra h&aacute;t n ca, c&aacute;c c&ocirc; g&aacute;i vn hot ng ngh thut vi 4 th&agrave;nh vi&ecirc;n v&agrave; t nhiu th&agrave;nh c&ocirc;ng vi lot b&agrave;i hit:&nbsp;<em>Ai ai ai, Thm mong anh quay v, T&igrave;nh bn...</em></p>\r\n<p>Cui nm 2006, Yn Trang v&agrave; Yn Nhi (hai ch em rut) ri nh&oacute;m  theo ui s nghip ri&ecirc;ng, M&acirc;y Trng tuyn th&ecirc;m th&agrave;nh vi&ecirc;n l&agrave; Hi Bng. n nm 2009, sau liveshow&nbsp;<em>Night of 9</em>&nbsp;k nim 9 nm th&agrave;nh lp, th&agrave;nh vi&ecirc;n tr tui nht n&agrave;y ch&iacute;nh thc t&aacute;ch nh&oacute;m  theo ui s nghip solo. Ngc Ch&acirc;u v&agrave; Thu Ngc vi li ha s tip tc hot ng &atilde; chn th&ecirc;m th&agrave;nh vi&ecirc;n mi l&agrave; Nguyn V Kim Ngc. Ng&agrave;y 1/6/2013, M&acirc;y Trng ch&iacute;nh thc ngng hot ng sau 13 nm.&nbsp;</p>\r\n<table class="picture" cellspacing="0" cellpadding="0">\r\n<tbody>\r\n<tr>\r\n<td class="pic"><img src="http://img.v3.news.zdn.vn/w660/Uploaded/zagtrz/2015_05_27/may_trang_7.jpg" alt="M&acirc;y Trng tung nh gi cm t&aacute;i xut Vpop" /></td>\r\n</tr>\r\n<tr>\r\n<td class="pCaption caption">M&acirc;y Trng c&ugrave;ng to h&igrave;nh n tng trong phi&ecirc;n bn 2015.</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p>Sau 2 nm ngng hot ng, th&ocirc;ng tin M&acirc;y Trng t&aacute;i xut Vpop trong nm 2015 khin nhiu ngi h&acirc;m m h&agrave;o hng v&agrave; mong i c gp li nh&oacute;m nhc y&ecirc;u th&iacute;ch. Tuy nhi&ecirc;n, h&igrave;nh nh gi cm, c&aacute; t&iacute;nh v&agrave; ni lon ca Ngc Ch&acirc;u v&agrave; 2 th&agrave;nh vi&ecirc;n mi nhn nhiu &yacute; kin tr&aacute;i chiu.</p>\r\n<p>Ngc Ch&acirc;u, trng nh&oacute;m M&acirc;y Trng, cho bit: "Kh&aacute;n gi ca M&acirc;y Trng theo thi gian cng ln dn, bn th&acirc;n nh&oacute;m cn c&oacute; s thay i  to n tng, th&iacute;ch nghi vi s ph&aacute;t trin ca th trng &acirc;m nhc hin ti. Ch&uacute;ng t&ocirc;i hy vng kh&aacute;n gi c&oacute; c&aacute;i nh&igrave;n tho&aacute;ng hn vi h&igrave;nh nh mi v&agrave; mong mi ngi s y&ecirc;u mn 2 th&agrave;nh vi&ecirc;n mi nh tng y&ecirc;u mn M&acirc;y Trng trc &acirc;y&rdquo;.</p>\r\n<table class="picture" cellspacing="0" cellpadding="0">\r\n<tbody>\r\n<tr>\r\n<td class="pic"><img src="http://img.v3.news.zdn.vn/w660/Uploaded/zagtrz/2015_05_27/unnamed.jpg" alt="M&acirc;y Trng tung nh gi cm t&aacute;i xut Vpop" /></td>\r\n</tr>\r\n<tr>\r\n<td class="pCaption caption">Nh&oacute;m M&acirc;y Trng phi&ecirc;n bn 2015 c&oacute; s lt x&aacute;c  h&igrave;nh nh.</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p>Ng&agrave;y 1/6, dp sinh nht 15 nm ca nh&oacute;m, M&acirc;y Trng ch&iacute;nh thc c&ocirc;ng b h&igrave;nh nh th&agrave;nh vi&ecirc;n mi v&agrave; k hoch tr li Vpop bng nhng hot ng d&agrave;i hi.</p>\r\n</div>', '333387907_samsung-galaxy-grand-gt-i9080-0828.jpg', '333387907_samsung-galaxy-grand-gt-i90809451_166x130.jpg', 1, 0, 1432956061, 0, '', '', '', '', '', '', 'tintuc'),
(4, 0, 0, 'Noo Phc Thnh chy show di tri nng 40  ca H Ni', 'ten-khong-dau', 'Dasha Gold l hot blogger hng u th gii. Bt c trang phc no fashionista ny khoc ln ngi cng to ln sng like mnh m, c bit l cc kiu phi  en trng cht l.', '<div class="summary zing">\r\n<p>Tranh th thi gian rnh ri khi chy show ti Th &ocirc;, nam ca s "Gt i nc mt" thm th&uacute; ph phng v&agrave; mua qu&agrave; tng ph huynh.</p>\r\n</div>\r\n<div class="content">\r\n<table class="picture" cellspacing="0" cellpadding="0">\r\n<tbody>\r\n<tr>\r\n<td class="pic"><img src="http://img.v3.news.zdn.vn/w660/Uploaded/mzdmc/2015_05_28/noophuocthinh1_zing.jpg" alt="Noo Phc Thnh chy show di tri n&oacute;ng 40  ca H&agrave; Ni" /></td>\r\n</tr>\r\n<tr>\r\n<td class="pCaption caption">Cui th&aacute;ng 5, Noo Phc Thnh ra H&agrave; Ni chy show. Sau khi t s&acirc;n bay v kh&aacute;ch sn, nam ca s d&agrave;nh ch&uacute;t thi gian ngh ngi ri nhanh ch&oacute;ng bt u c&aacute;c hot ng v&agrave;o bui chiu. Anh chn trang phc n gin v&agrave; nng ng nh &aacute;o thun d&agrave;i tay, qun jean v&agrave; s mi k ca r&ocirc; buc ngang h&ocirc;ng ra ph.&nbsp;</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<table class="picture" cellspacing="0" cellpadding="0">\r\n<tbody>\r\n<tr>\r\n<td class="pic"><img src="http://img.v3.news.zdn.vn/w660/Uploaded/mzdmc/2015_05_28/noophuocthinh2_zing.jpg" alt="Noo Phc Thnh chy show di tri n&oacute;ng 40  ca H&agrave; Ni" /></td>\r\n</tr>\r\n<tr>\r\n<td class="pCaption caption">D&ugrave; nhiu ln ra H&agrave; Ni biu din nhng Noo Phc Thnh cho bit anh vn cha quen vi nng n&oacute;ng gay gt l&ecirc;n ti 40  ti &acirc;y.&nbsp;</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<table class="picture" cellspacing="0" cellpadding="0">\r\n<tbody>\r\n<tr>\r\n<td class="pic"><img src="http://img.v3.news.zdn.vn/w660/Uploaded/mzdmc/2015_05_28/noophuocthinh3_zing.jpg" alt="Noo Phc Thnh chy show di tri n&oacute;ng 40  ca H&agrave; Ni" /></td>\r\n</tr>\r\n<tr>\r\n<td class="pCaption caption">Noo Phc Thnh n a im biu din  kim tra &acirc;m thanh v&agrave; dt v o c&ugrave;ng hai v c&ocirc;ng ca m&igrave;nh. Tuy tha nhn kh&ocirc;ng c&oacute; nng khiu v&agrave; cng chng th&iacute;ch nhy nhng  c&oacute; th ph&aacute;t trin ngh nghip theo phong c&aacute;ch hin i, anh &atilde; d&agrave;nh nhiu thi gian tp luyn v o. Noo cho rng, iu &oacute; gi&uacute;p anh t tin hn khi bc l&ecirc;n s&acirc;n khu. .&nbsp;</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<table class="picture" cellspacing="0" cellpadding="0">\r\n<tbody>\r\n<tr>\r\n<td class="pic"><img src="http://img.v3.news.zdn.vn/w660/Uploaded/mzdmc/2015_05_28/noophuocthinh4_zing.jpg" alt="Noo Phc Thnh chy show di tri n&oacute;ng 40  ca H&agrave; Ni" /></td>\r\n</tr>\r\n<tr>\r\n<td class="pCaption caption">Nam ca s sinh nm 1988 h&agrave;o hng trao i vi c&aacute;c v c&ocirc;ng v phn tr&igrave;nh din.&nbsp;</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<table class="picture" cellspacing="0" cellpadding="0">\r\n<tbody>\r\n<tr>\r\n<td class="pic"><img src="http://img.v3.news.zdn.vn/w660/Uploaded/mzdmc/2015_05_28/noophuocthinh5_zing.jpg" alt="Noo Phc Thnh chy show di tri n&oacute;ng 40  ca H&agrave; Ni" /></td>\r\n</tr>\r\n<tr>\r\n<td class="pCaption caption">Ging ca&nbsp;<em>Gt i nc mt&nbsp;</em>tranh th n l&oacute;t d trc khi thm th&uacute; ph phng H&agrave; Ni.&nbsp;</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<table class="picture" cellspacing="0" cellpadding="0">\r\n<tbody>\r\n<tr>\r\n<td class="pic"><img src="http://img.v3.news.zdn.vn/w660/Uploaded/mzdmc/2015_05_28/noophuocthinh6_zing.jpg" alt="Noo Phc Thnh chy show di tri n&oacute;ng 40  ca H&agrave; Ni" /></td>\r\n</tr>\r\n<tr>\r\n<td class="pCaption caption">Noo Phc Thnh tranh th gh&eacute; qua ca h&agrave;ng b&aacute;n &ocirc; mai tr&ecirc;n ph H&agrave;ng ng, H&agrave; Ni.&nbsp;</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<table class="picture" cellspacing="0" cellpadding="0">\r\n<tbody>\r\n<tr>\r\n<td class="pic"><img src="http://img.v3.news.zdn.vn/w660/Uploaded/mzdmc/2015_05_28/noophuocthinh7_zing.jpg" alt="Noo Phc Thnh chy show di tri n&oacute;ng 40  ca H&agrave; Ni" /></td>\r\n</tr>\r\n<tr>\r\n<td class="pCaption caption">Anh quyt nh mua v&agrave;i loi &ocirc; mai m v&agrave; su v l&agrave;m qu&agrave; biu m. Theo chia s ca Noo Phc Thnh, m anh rt th&iacute;ch c&aacute;c loi &ocirc; mai ca H&agrave; Ni. V&igrave; vy, mi ln ra lu din ti Th &ocirc;, anh u d&agrave;nh thi gian gh&eacute; qua khu ph n&agrave;y.&nbsp;</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<table class="picture" cellspacing="0" cellpadding="0">\r\n<tbody>\r\n<tr>\r\n<td class="pic"><img src="http://img.v3.news.zdn.vn/w660/Uploaded/mzdmc/2015_05_28/noophuocthinh8_zing_1.jpg" alt="Noo Phc Thnh chy show di tri n&oacute;ng 40  ca H&agrave; Ni" /></td>\r\n</tr>\r\n<tr>\r\n<td class="pCaption caption">Mt kh&aacute;n gi h&acirc;m m ng &yacute; chp h&igrave;nh c&ugrave;ng Noo Phc Thnh khi nhn ra anh ang do chi tr&ecirc;n ph phng Th &ocirc;. B&ecirc;n cnh v ngo&agrave;i in trai v&agrave; phong c&aacute;ch tr&igrave;nh din cun h&uacute;t, anh c&ograve;n c fan y&ecirc;u mn bi s gn gi v&agrave; th&acirc;n thin.&nbsp;</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</div>', 'gia-mot-so-dong-dien-thoai-samsung-dang-hot-tai-viet-nam-0077.jpg', 'gia-mot-so-dong-dien-thoai-samsung-dang-hot-tai-viet-nam0111_170x128.jpg', 1, 0, 1432956155, 0, '', '', '', '', '', '', 'tintuc'),
(5, 0, 0, 'Hoi Linh ng gt trn trng quay Ngi b n', 'ten-khong-dau', 'Dasha Gold l hot blogger hng u th gii. Bt c trang phc no fashionista ny khoc ln ngi cng to ln sng like mnh m, c bit l cc kiu phi  en trng cht l.', '<div class="summary zing">\r\n<p>S&aacute;u Bnh tranh th chp mt l&uacute;c gii lao nhng khi ph&aacute;t hin ng k&iacute;nh m&aacute;y nh hng v m&igrave;nh, anh lin to d&aacute;ng rt x&igrave;-tin  chc ci mi ngi.</p>\r\n</div>\r\n<div class="content">\r\n<table class="picture" cellspacing="0" cellpadding="0">\r\n<tbody>\r\n<tr>\r\n<td class="pic">\r\n<p><img src="http://img.v3.news.zdn.vn/w660/Uploaded/inotzq/2015_05_29/IMG_6939.JPG" alt="1" /></p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td class="pCaption caption">\r\n<p>Trong tp 12 ca Ngi b&iacute; n, Ho&agrave;i Linh c &ecirc;-k&iacute;p h&oacute;a trang gi&uacute;p anh tr h&oacute;a vi phong c&aacute;ch cc ngu. Danh h&agrave;i mt kh&aacute; nhiu thi gian trong hu trng  trau chut ngoi h&igrave;nh thay v&igrave; qun t&acirc;y, &aacute;o s mi n gin nh c&aacute;c tp trc.</p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<table class="picture" cellspacing="0" cellpadding="0">\r\n<tbody>\r\n<tr>\r\n<td class="pic">\r\n<p><img src="http://img.v3.news.zdn.vn/w660/Uploaded/inotzq/2015_05_29/IreMG_6965.jpg" alt="2" /></p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td class="pCaption caption">\r\n<p>S&aacute;u Bnh s&agrave;nh iu ci chic Yamaha R15 l&ecirc;n s&acirc;n khu c&ugrave;ng Vit Hng. Nhng anh th&uacute; nhn m&igrave;nh ch c&oacute; "da bc xng" l&agrave;m kh&aacute;n gi ci th&iacute;ch th&uacute;.</p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<table class="picture" cellspacing="0" cellpadding="0">\r\n<tbody>\r\n<tr>\r\n<td class="pic">\r\n<p><img src="http://img.v3.news.zdn.vn/w660/Uploaded/inotzq/2015_05_29/IMG_7503.JPG" alt="1" /></p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td class="pCaption caption">\r\n<p>Trong l&uacute;c chng tr&igrave;nh tm ngng, Ho&agrave;i Linh cng tranh th ngh ngi. Thi gian qua, danh h&agrave;i mit m&agrave;i c&oacute; mt trong c&aacute;c chng tr&igrave;nh truyn h&igrave;nh thc t. V&igrave; qu&aacute; bn rn vi lch l&agrave;m vic d&agrave;y c n&ecirc;n anh kh&ocirc;ng tr&aacute;nh khi mt mi.</p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<table class="picture" cellspacing="0" cellpadding="0">\r\n<tbody>\r\n<tr>\r\n<td class="pic">\r\n<p><img src="http://img.v3.news.zdn.vn/w660/Uploaded/inotzq/2015_05_29/IMG_7509.JPG" alt="2" /></p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td class="pCaption caption">\r\n<p>S&aacute;u Bnh ng thip i v&igrave; mt. Ngi b&iacute; n &atilde; to c ting vang  m&ugrave;a u nhng  sp xp ghi h&igrave;nh l&agrave; iu v&ocirc; c&ugrave;ng kh&oacute; khn v&igrave; b ba Ho&agrave;i Linh - Vit Hng - Trn Th&agrave;nh u rt bn rn. Nu Ho&agrave;i Linh phi di chuyn li&ecirc;n tc gia c&aacute;c game show th&igrave; Vit Hng nh c  M rt kh&oacute; thu xp thi gian c&ograve;n MC in trai cng vng lch quay  c&aacute;c show kh&aacute;c.</p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<table class="picture" cellspacing="0" cellpadding="0">\r\n<tbody>\r\n<tr>\r\n<td class="pic">\r\n<p><img src="http://img.v3.news.zdn.vn/w660/Uploaded/inotzq/2015_05_29/IMG_7506.JPG" alt="1" /><a class="btnSlideshow" href="http://news.zing.vn/Hoai-Linh-ngu-gat-tren-truong-quay-Nguoi-bi-an-post544316.html#slideshow">Ph&oacute;ng to</a></p>\r\n<div class="fbShareImage"><span><iframe title="fb:share_button Facebook Social Plugin" name="f3fcea43d" src="http://www.facebook.com/plugins/share_button.php?app_id=622829237762080&amp;channel=http%3A%2F%2Fstatic.ak.facebook.com%2Fconnect%2Fxd_arbiter%2FQrU_tEEWym9.js%3Fversion%3D41%23cb%3Df2e488bad%26domain%3Dnews.zing.vn%26origin%3Dhttp%253A%252F%252Fnews.zing.vn%252Ff14334f30%26relation%3Dparent.parent&amp;container_width=0&amp;href=http%3A%2F%2Fnews.zing.vn%2Fshare%2Flink.aspx%3Furl%3Dhttp%3A%2F%2Fnews.zing.vn%2Fw660%2FUploaded%2Finotzq%2F2015_05_29%2FIMG_7506.JPG%26origin%3Dhttp%3A%2F%2Fnews.zing.vn%2Fznews-post544316.html&amp;locale=vi_VN&amp;sdk=joey" frameborder="0" scrolling="no" width="1000px" height="1000px"></iframe></span></div>\r\n<p>&nbsp;</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td class="pCaption caption">\r\n<p>Khi ph&aacute;t hin b "chp l&eacute;n", Ho&agrave;i Linh to d&aacute;ng x&igrave;-tin ngay. Lch quay kh&aacute; cng thng nhng kh&ocirc;ng kh&iacute; trng quay lu&ocirc;n tr&agrave;n ngp ting ci v&igrave; b ba din vi&ecirc;n h&agrave;i lu&ocirc;n bit c&aacute;ch chc ci mi ngi.</p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</div>', 'sony-xperia-z1-card-case-black-sma5136b-sny-z1bcek-d31-3456.jpg', 'sony-xperia-z1-card-case-black-sma5136b-sny-z1bcek-d317699_170x107.jpg', 1, 1, 1432956223, 0, '', '', '', '', '', '', 'tintuc'),
(6, 0, 0, 'MC xinh p v git nc mt ut c v Tun Hng', 'mc-xinh-dep-va-giot-nuoc-mat-uat-uc-vi-tuan-hung', 'Dasha Gold l hot blogger hng u th gii. Bt c trang phc no fashionista ny khoc ln ngi cng to ln sng like mnh m, c bit l cc kiu phi  en trng cht l.', '<div class="summary">\r\n<p>Xinh p v gn gi, Ph Linh to cm gic thoi mi cho ngi i din ngay giy pht u gp g. C MC tr trung ln u chia s cu chuyn bun vui vi thn tng Tun Hng.</p>\r\n</div>\r\n\r\n<div class="content">\r\n<p>Gia lng chng tt bt ca i sng, ba vy ca cng vic, Ph Linh dnh cho ti mt cuc gp lc x tra, ni gc qun quen ca c. Qun vng ngi nm khut mt gc trong mt khch sn ca H Ni khin ti cht c  ngh dng nh Linh cng mun nu mnh nh qun, khi nhng nhn nhp thng nht.</p>\r\n\r\n<p><strong>4 tui  ln sng truyn hnh</strong></p>\r\n\r\n<p>C tn y  l Ph Nguyn Thy Linh nhng n MC mun c gi tt l Ph Linh bi c t thy ci tn ny th hin s khc bit v c g  ''''xng pha" hn. Linh bt u cu chuyn vi ti v nim t ho khi c sinh ra v ln ln trong mt gia nh hnh phc, c c b v m u lm trong ngnh cng an.</p>\r\n\r\n<p>"30 tui m em mi ly chng, ngha l khi sinh ra em, m khng cn tr na. C l do bn tnh ngh nghip nn b m d yu thng chm sc nhng cng y nghim khc vi em. T nh em c b m rn vo khun kh k lut thp vi lch hc tp v sinh hot r rng" - Ph Linh nh li.</p>\r\n\r\n<table cellpadding="0" cellspacing="0" class="picture">\r\n	<tbody>\r\n		<tr>\r\n			<td class="pic"><img alt="Ph Linh vi bc nh en trng n tng." src="http://img.v3.news.zdn.vn/w660/Uploaded/ycgmvvbt/2015_05_29/philinh1.jpg" /></td>\r\n		</tr>\r\n		<tr>\r\n			<td class="pCaption caption">Ph Linh vi bc nh en trng n tng.</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p>Linh bo d i khi nghim ngh vi con ci (di Linh cn em gi km 6 tui) nhng b m l ngi yu ngh thut, lun c v  con ci tip cn vi cc hot ng pht trin nng khiu v t duy. Ln u tin Linh c ln sng truyn hnh l nm 4 tui khi tham gia c th v ht.</p>\r\n\r\n<p>Sut nhng nm tiu hc v cp hai, bn cnh thnh tch hc tp tt, c tch cc tham gia cc hot ng nh tuyn truyn ca khc mng non, dn chng trnh cho phng v nm trong ban ch huy lin i cho trng. Nh ngoan ngon hc tp m lp 8 Linh bt ng c m thng cho bui i xem ca nhc.</p>\r\n\r\n<p>Linh chia s: "Bui biu din ca nhc  em n tng ca s Tun Hng. Anh Hng c ging ht tnh cm v cch giao lu trn sn khu thch v cng. K t ngy  Linh bt u hm m Tun Hng. Nh bao bn khc Linh bt u su tm nh, bo vit v anh.</p>\r\n\r\n<p>Anh Hng khi   vo Si Gn lp nghip nhng cc bui biu din ca anh  H Ni, Linh u c gng khng b st. Cng ngy cng hm m ging ca ny m khng hiu iu g hp dn mnh n vy. Ging ht ? Hay v p trai? C l khng hn ch l nh th!''''.</p>\r\n\r\n<p><strong>B m gin v c in thoi mi i c ph ca Tun Hng</strong></p>\r\n\r\n<p>Linh vn nh m c  rt au kh khi ln u tin bit c mt cuc in thoi Tun Hng hn gp Ph Linh i c ph. Lc  bo ch ang r ln thng tin l mt ca s no  li dng lng hm m ca fan  sm s. "M gin khng ni chuyn vi em mt tun ch v c in thoi " - Linh nh li.</p>\r\n\r\n<table cellpadding="0" cellspacing="0" class="picture">\r\n	<tbody>\r\n		<tr>\r\n			<td class="pic"><img alt="Ph Linh v Tun Hng trong mt chng trnh." src="http://img.v3.news.zdn.vn/w660/Uploaded/ycgmvvbt/2015_05_29/philinh2.jpg" /></td>\r\n		</tr>\r\n		<tr>\r\n			<td class="pCaption caption">Ph Linh v Tun Hng trong mt chng trnh.</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p>Nhng v con gi vn m ng vic hc tp tt nn dn dn m Ph Linh khng qu can thip vo vic c c thn tng. Linh khng b ngn cn nn thoi mi hn trong vic chia s mi bun vui trong cuc sng i vi Tun Hng. Thm ch, c lc ni hng, Ph Linh cn c  nh lp fan club  min Bc  ng h cho thn tng nhng p li l mt phn ng gay gt.</p>\r\n\r\n<p>"Linh vn nh khi bit anh Hng ra H Ni din, Linh v mt s bn  ln tn nh anh  Hng Khay  chia s v  nh lp fan club nhng anh Hng khng ng .</p>\r\n\r\n<p>Anh Hng cho rng fan club ch c hi hn l c li. Anh em nu  yu qu nhau th thi thong c c hi gp g hi han hoc chia s vi nhau trn mng l c. Nhng v bn Linh c khng khng mun lp nn khin anh bc. Anh Hng qut: ''Khng mun lm g ht, gii tn ht''''.</p>\r\n\r\n<p>Lc  v cn tr con nn Linh va ti thn va ut c v s phn ng ca anh Hng nn bt khc tc ti. Sau  c nhm ra v v vn c tnh t chc mt bui gp g vi li nhn mong anh Hng qua giao lu. Ng tng anh Hng s khng n hoc c n th cng ch giao lu qua loa. Nhng cui cng anh Hng cng ti, vui v v cn ht a tu vi cc bn tr. Anh Hng l vy, i khi "c mm", i khi hay t v bng bnh, bt cn nhng trong su thm tri tim l mt ngi sng tnh cm v sng ngh cho mi ngi" - MC Ph Linh k.</p>\r\n\r\n<p><strong>T cng tc vin tr thnh ngi ca VTV</strong></p>\r\n\r\n<p>Ph Linh bo v hm m Tun Hng nn ht cp hai, Ph Linh  t t ra mc tiu l mnh s c gng hc tp tt  sau ny thi  i hc hc xong ra trng s lm mt ngh no  lin quan n vn ha, gii tr  h tr cho thn tng phn no.</p>\r\n\r\n<table cellpadding="0" cellspacing="0" class="picture">\r\n	<tbody>\r\n		<tr>\r\n			<td class="pic"><img alt="Ph Linh trong vai tr MC ca VTV." src="http://img.v3.news.zdn.vn/w660/Uploaded/ycgmvvbt/2015_05_29/philinh3.jpg" /></td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n</div>\r\n', 'gia-mot-so-dong-dien-thoai-samsung-dang-hot-tai-viet-nam-4951.jpg', 'gia-mot-so-dong-dien-thoai-samsung-dang-hot-tai-viet-nam7723_170x128.jpg', 1, 1, 1432956342, 1457937226, '', '', '', '', '', '', 'tintuc'),
(8, 0, 0, 'Mt s-mi trng c lng m nhn Vit trong thng 5', 'ten-khong-dau', 'Dasha Gold l hot blogger hng u th gii. Bt c trang phc no fashionista ny khoc ln ngi cng to ln sng like mnh m, c bit l cc kiu phi  en trng cht l.', '<div class="summary zing">\r\n<p>Kiu mt &aacute;o truyn thng gam m&agrave;u trng tinh khit d d&agrave;ng phi ph kin c nhiu sao n a chung, ng dng v&agrave;o m&ugrave;a h&egrave;.</p>\r\n</div>\r\n<div class="content">\r\n<table class="picture" cellspacing="0" cellpadding="0">\r\n<tbody>\r\n<tr>\r\n<td class="pic"><img src="http://img.v3.news.zdn.vn/w660/Uploaded/Yfrur/2015_05_29/TNA_1.jpg" alt="Mt s-mi trng c l&ograve;ng m nh&acirc;n Vit trong th&aacute;ng 5" /></td>\r\n</tr>\r\n<tr>\r\n<td class="pCaption caption">Sau nhiu nm b l&atilde;ng qu&ecirc;n, gam m&agrave;u trng tr th&agrave;nh xu hng hot trong nm 2015. c bit, thit k s-mi cn bn c y&ecirc;u th&iacute;ch hn c v&agrave;o m&ugrave;a h&egrave; 2015. &oacute;n u tr&agrave;o lu ang c&oacute; sc nh hng gii tr, nhiu sao Vit ng dng kiu mt vi nhiu c&aacute;ch mix - match s&aacute;ng to. Trong nh, Trng Ngc &Aacute;nh din s-mi trng b&ecirc;n ngo&agrave;i set trang phc "c&acirc;y trng" lch thip.</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<table class="picture" cellspacing="0" cellpadding="0">\r\n<tbody>\r\n<tr>\r\n<td class="pic"><img src="http://img.v3.news.zdn.vn/w660/Uploaded/Yfrur/2015_05_29/TNA_2.jpg" alt="Mt s-mi trng c l&ograve;ng m nh&acirc;n Vit trong th&aacute;ng 5" /></td>\r\n</tr>\r\n<tr>\r\n<td class="pCaption caption">Hoa hu ng Thu Tho l&agrave; mt trong nhng t&iacute;n  ca gam m&agrave;u trng. u h&egrave; 2015, ngi p gc Bc Li&ecirc;u  li h&igrave;nh nh p vi nhiu c&aacute;ch mix th&uacute; v,  li h&igrave;nh nh trong tro, thanh lch.</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<table class="picture" cellspacing="0" cellpadding="0">\r\n<tbody>\r\n<tr>\r\n<td class="pic"><img src="http://img.v3.news.zdn.vn/w660/Uploaded/Yfrur/2015_05_29/TNA_3.jpg" alt="Mt s-mi trng c l&ograve;ng m nh&acirc;n Vit trong th&aacute;ng 5" /></td>\r\n</tr>\r\n<tr>\r\n<td class="pCaption caption">C&aacute;ch chn c&aacute;c items hp xu hng mix c&ugrave;ng &aacute;o s-mi trng gi&uacute;p ng Thu Tho ni bt ti d s kin v&agrave; si bc tr&ecirc;n ng ph.</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<table class="picture" cellspacing="0" cellpadding="0">\r\n<tbody>\r\n<tr>\r\n<td class="pic"><img src="http://img.v3.news.zdn.vn/w660/Uploaded/Yfrur/2015_05_29/TNA_4.jpg" alt="Mt s-mi trng c l&ograve;ng m nh&acirc;n Vit trong th&aacute;ng 5" /></td>\r\n</tr>\r\n<tr>\r\n<td class="pCaption caption">Trong bui casting Vietnam''s Next Top Model ti H&agrave; Ni, si&ecirc;u mu Thanh Hng chn s-mi trng mix ph&ugrave; hp vi t&ocirc;ng pastel ch o.</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<table class="picture" cellspacing="0" cellpadding="0">\r\n<tbody>\r\n<tr>\r\n<td class="pic"><img src="http://img.v3.news.zdn.vn/w660/Uploaded/Yfrur/2015_05_29/TNA_5.jpg" alt="Mt s-mi trng c l&ograve;ng m nh&acirc;n Vit trong th&aacute;ng 5" /></td>\r\n</tr>\r\n<tr>\r\n<td class="pCaption caption">Tham d mt s kin ti Singapore v&agrave;o trung tun th&aacute;ng 5, H&agrave; Anh chn mt &aacute;o s-mi voan trng,  l ni y gi cm.</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<table class="picture" cellspacing="0" cellpadding="0">\r\n<tbody>\r\n<tr>\r\n<td class="pic"><img src="http://img.v3.news.zdn.vn/w660/Uploaded/Yfrur/2015_05_29/TNA_6.jpg" alt="Mt s-mi trng c l&ograve;ng m nh&acirc;n Vit trong th&aacute;ng 5" /></td>\r\n</tr>\r\n<tr>\r\n<td class="pCaption caption">Xu hng thi trang n sinh c nhiu sao Vit lng x&ecirc; trong th&aacute;ng 5. Nhanh nhy vi tr&agrave;o lu ang hot, Nh&atilde; Phng chn mt jumpsuits ym mix c&ugrave;ng &aacute;o s-mi trng. Ph kin m fedora v&agrave; gi&agrave;y bata ng iu phong c&aacute;ch.</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</div>', '625201332141pm_635_sony-xperia-z-ultra-db-4660.png', '625201332141pm_635_sony-xperia-z-ultra-db6515_170x127.png', 1, 1, 1432956456, 0, '', '', '', '', '', '', 'tintuc'),
(9, 0, 0, 'Mix  h snh iu nh tn  thi trang nh', 'mix-do-he-sanh-dieu-nhu-tin-do-thoi-trang-nhi', '<p>Dasha Gold l&agrave; hot blogger h&agrave;ng u th gii. Bt c trang phc n&agrave;o fashionista n&agrave;y kho&aacute;c l&ecirc;n ngi cng to l&agrave;n s&oacute;ng &ldquo;like&rdquo; mnh m, c bit l&agrave; c&aacute;c kiu phi  en trng cht l.</p>', '<div class="summary zing">\r\n<p>Nhng nh&oacute;c t di &acirc;y g&acirc;y ch&uacute; &yacute; tr&ecirc;n mng v&igrave; phong c&aacute;ch thi trang n tng v&agrave; bin h&oacute;a a dng.</p>\r\n</div>\r\n<div class="content">\r\n<table class="picture" cellspacing="0" cellpadding="0">\r\n<tbody>\r\n<tr>\r\n<td class="pic"><img src="http://img.v3.news.zdn.vn/w660/Uploaded/OpluOAA/2015_05_27/maunhi1.jpg" alt="Mix  h&egrave; s&agrave;nh iu nh t&iacute;n  thi trang nh&iacute;" /></td>\r\n</tr>\r\n<tr>\r\n<td class="pCaption caption"><em>Fashion Kids</em>&nbsp;l&agrave; trang cp nht thng xuy&ecirc;n nh thi trang p ca c&aacute;c nh&oacute;c t tr&ecirc;n khp th gii. Hin, s ngi theo d&otilde;i trang n&agrave;y l&ecirc;n n con s hn 2 triu, trong &oacute; c&oacute; nhng nh&acirc;n vt ni ting nh Rihanna, Kim Kardashian. Wilson R. Dorigon, ngi lp ra trang web n&agrave;y, chia s anh mong mun &acirc;y l&agrave; ni truyn cm hng cho c&aacute;c &ocirc;ng b, b&agrave; m khi phi  cho con. C&ugrave;ng cp nht nhng h&igrave;nh nh mi nht ca c&aacute;c nh&oacute;c t tr&ecirc;n khp th gii.&nbsp;</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<table class="picture" cellspacing="0" cellpadding="0">\r\n<tbody>\r\n<tr>\r\n<td class="pic"><img src="http://img.v3.news.zdn.vn/w660/Uploaded/OpluOAA/2015_05_27/maunhi21.jpg" alt="Mix  h&egrave; s&agrave;nh iu nh t&iacute;n  thi trang nh&iacute;" /></td>\r\n</tr>\r\n<tr>\r\n<td class="pCaption caption">C&ocirc; nh&oacute;c &aacute;ng y&ecirc;u vi shorts jean, &aacute;o d&aacute;ng x&ograve;e v&agrave; gi&agrave;y li. Set  n&agrave;y va nng ng, li vn duy&ecirc;n d&aacute;ng.</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<table class="picture" cellspacing="0" cellpadding="0">\r\n<tbody>\r\n<tr>\r\n<td class="pic"><img src="http://img.v3.news.zdn.vn/w660/Uploaded/OpluOAA/2015_05_27/maunhi22.jpg" alt="Mix  h&egrave; s&agrave;nh iu nh t&iacute;n  thi trang nh&iacute;" /></td>\r\n</tr>\r\n<tr>\r\n<td class="pCaption caption">Khi xung ph v&agrave;o ng&agrave;y cui tun, c&ocirc; nh&oacute;c kt hp qun d&agrave;i xn gu vi &aacute;o hai d&acirc;y.</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<table class="picture" cellspacing="0" cellpadding="0">\r\n<tbody>\r\n<tr>\r\n<td class="pic"><img src="http://img.v3.news.zdn.vn/w660/Uploaded/OpluOAA/2015_05_27/maunhi23.jpg" alt="Mix  h&egrave; s&agrave;nh iu nh t&iacute;n  thi trang nh&iacute;" /></td>\r\n</tr>\r\n<tr>\r\n<td class="pCaption caption">Trang Instagram ca c&ocirc; b&eacute; xinh nh thi&ecirc;n thn n&agrave;y c&oacute; hn 10 ngh&igrave;n ngi theo d&otilde;i. Mi bc nh m b&eacute; ng ti u nhn c s quan t&acirc;m ca &ocirc;ng o c d&acirc;n mng.</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</div>', '530201353633am_635_sony_xperia_ray-4035.png', '530201353633am_635_sony_xperia_ray5875_170x127.png', 1, 1, 1432956495, 1433404489, '', '', '', '', '', '', 'tintuc'),
(10, 0, 0, 'Phi  en trng cc cht t fashionista ni ting th gii', 'phoi-do-den-trang-cuc-chat-tu-fashionista-noi-tieng-the-gioi', '<p>Dasha Gold l hot blogger hng u th gii. Bt c trang phc no fashionista ny khoc ln ngi cng to ln sng like mnh m, c bit l cc kiu phi  en trng cht l.</p>', '<div class="summary zing">\r\n<p>Dasha Gold l hot blogger hng u th gii. Bt c trang phc no fashionista ny khoc ln ngi cng to ln sng like mnh m, c bit l cc kiu phi  en trng cht l.</p>\r\n</div>\r\n\r\n<div class="content">\r\n<table cellpadding="0" cellspacing="0" class="picture">\r\n	<tbody>\r\n		<tr>\r\n			<td class="pic"><img alt="Phi  en trng cc cht t fashionista ni ting th gii" src="http://img.v3.news.zdn.vn/w660/Uploaded/cqxrcajwp/2015_05_29/1_1.jpg" /></td>\r\n		</tr>\r\n		<tr>\r\n			<td class="pCaption caption">Dasha Gold l mt trong nhng hot blogger thi trang nh m nht cng ng fashionista th gii. Thm ch nhiu trang bo cn xp c vo danh sch Top 10 fashionista hng u th gii, bn cnh nhng tn tui ni tri nh Alexa Chung, Olivia Palermo, Anna Dello Russo, Chiara Ferragni</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<table cellpadding="0" cellspacing="0" class="picture">\r\n	<tbody>\r\n		<tr>\r\n			<td class="pic"><img alt="Phi  en trng cc cht t fashionista ni ting th gii" src="http://img.v3.news.zdn.vn/w660/Uploaded/cqxrcajwp/2015_05_29/2_1.jpg" /></td>\r\n		</tr>\r\n		<tr>\r\n			<td class="pCaption caption">Trang blog c nhn ca Dasha Gold lun c khong 300 nghn lt view mi thng. Bn cnh website, 2 trang mng x hi ca c gi xinh p ny cng thu ht lng fan khng l, vi hn 54 nghn ngi theo di trn Instagram v Facebook vi hn 23,6 nghn lt like.</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<table cellpadding="0" cellspacing="0" class="picture">\r\n	<tbody>\r\n		<tr>\r\n			<td class="pic"><img alt="Phi  en trng cc cht t fashionista ni ting th gii" src="http://img.v3.news.zdn.vn/w660/Uploaded/cqxrcajwp/2015_05_29/3_1.jpg" /></td>\r\n		</tr>\r\n		<tr>\r\n			<td class="pCaption caption">Dasha Gold cn cng tc vi nhiu tp ch danh gi<em>Vogue, Harpers Bazaar, Elle, The New York Times, Marie Claire</em>, cng nh l i tc ca nhiu thng hiu hng u th gii Emporio Armani, Dolce & Gabbana, Dior, Gucci, Topshop, Charles & Keith nh gu thi trang tinh t, ng cp v mang m du n c nhn.</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<table cellpadding="0" cellspacing="0" class="picture">\r\n	<tbody>\r\n		<tr>\r\n			<td class="pic"><img alt="Phi  en trng cc cht t fashionista ni ting th gii" src="http://img.v3.news.zdn.vn/w660/Uploaded/cqxrcajwp/2015_05_29/4.jpg" /></td>\r\n		</tr>\r\n		<tr>\r\n			<td class="pCaption caption">Do qua trang web ca Dasha Gold, d nhn thy nht trong cc set  street style ca c gi ny l mt c tnh mnh m, phng khong v y cht ngh s. Trong khi , nhng thit k cng s, d tic ca fashionista hng u th gii li rt nng ng, hin i v tinh t trong tng chi tit.</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n</div>\r\n', 'samsung-galaxy-note-2-n7100-19-1014.jpg', 'samsung-galaxy-note-2-n7100-195587_170x128.jpg', 1, 1, 1432956551, 1457937240, '', '', '', '', '', '', 'tintuc'),
(11, 0, 0, 'nh gi HTC Desire 826: Dng p, mn hnh cht 1a', 'danh-gia-htc-desire-826-dang-dep-man-hinh-chat-1a', '<p>Dasha Gold l hot blogger hng u th gii. Bt c trang phc no fashionista ny khoc ln ngi cng to ln sng like mnh m, c bit l cc kiu phi  en trng cht l.a</p>\r\n', '<div class="summary zing">\r\n<p>Khng c nhiu khuyt im nhng Desire 826 vn thiu nhng t cht cn thit  tr thnh k thng lnh th trng  nhm in thoi tm trung.</p>\r\n</div>\r\n\r\n<div class="content">\r\n<table cellpadding="0" cellspacing="0" class="picture">\r\n	<tbody>\r\n		<tr>\r\n			<td><img alt="nh gi HTC Desire 826: Dng p, mn hnh cht" src="http://img.v3.news.zdn.vn/w660/Uploaded/Aohuouk/2015_05_24/Desire_826_Zing.JPG" /></td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p>Vi khong 8 triu ng, ngi dng Vit Nam c th mua v nhng chic smartphone c kiu dng p, hiu nng n tng, khng thua km cc dng my cao cp. Desire 826 l mt sn phm nh vy.</p>\r\n\r\n<p><strong>Thit k v phn cng</strong></p>\r\n\r\n<table cellpadding="0" cellspacing="0" class="picture">\r\n	<tbody>\r\n		<tr>\r\n			<td><img alt="nh gi HTC Desire 826: Dng p, mn hnh cht" src="http://img.v3.news.zdn.vn/w660/Uploaded/Aohuouk/2015_05_24/DSC02359.JPG" /></td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p>HTC Desire 826 khng thay i nhiu v thit k so vi mt s mu Desire i trc. Nu khng thng xuyn theo di lch trnh cp nht sn phm ca HTC, ngi dng kh lng phn bit c u l Desire 816, 820 hay 826.</p>\r\n\r\n<p>Desire 826 khng chy theo kiu thit k vin mng ca mt s nh sn xut hin nay. Kt qu l, ngi dng c trong tay mt chic smartphone vi mn hnh nhiu phn tha, to bn v vung vc.</p>\r\n</div>\r\n', 'z3v_wht_fr_back_1240x840-3537ca97e05e0f9897a145c4a7880e31-6452.jpg', 'z3v_wht_fr_back_1240x840-3537ca97e05e0f9897a145c4a7880e313840_170x115.jpg', 1, 0, 1432957156, 1458273960, '', '', '', '', '', '', 'tintuc');
INSERT INTO `table_vnexpress` (`id`, `id_item`, `noibat`, `ten`, `tenkhongdau`, `mota`, `noidung`, `photo`, `thumb`, `stt`, `hienthi`, `ngaytao`, `ngaysua`, `title`, `keywords`, `description`, `tenen`, `motaen`, `noidungen`, `type`) VALUES
(21, 0, 0, '4 cng ty a cp b B Cng Thng rt php', '', '<a href="http://kinhdoanh.vnexpress.net/tin-tuc/doanh-nghiep/4-cong-ty-da-cap-bi-bo-cong-thuong-rut-phep-3371677.html"><img width=130 height=100 src="http://img.f25.kinhdoanh.vnecdn.net/2016/03/17/ConduongViet-1458216315_180x108.jpg" ></a></br>Sau Lin kt Vit, Cc Qun l Cnh tranh (B Cng Thng) va quyt nh rt giy php hot ng bn hng a cp ca 4 doanh nghip ti H Ni.', '                                        <p class="Normal">\n	<span style="color:#696969;"><strong>Cng ty Sn xut thng mi Con ng Vit</strong></span></p>\n<p>\n	Cng ty Con ng Vit c cp giy chng nhn ng k hot ng bn hng a cp ngy 8/4/2015. Cng ty c tr s ti ng Cu Giy (Dch Vng, Cu Giy, H Ni).</p>\n<p class="Normal">\n	Theo li gii thiu, Con ng Vit l n v phn phi c quyn cc sn phm h tr sc kho c thnh phn chnh l nano curcumin (c trong c ngh vng) do Trung tm Ha thc vt - Vin Khoa hc cng nghip Vit Nam trc tip sn xut. Cc sn phm c phn phi ton quc, thm ch xut khu sang Trung Quc, i Loan (Trung Quc), c, Hungary...<span>Cng ty ny cng t chc hi tho  hng lot cc tnh Bc Ninh, Hi Dng, Thanh Ho, Ngh An... nhm thu ht ngi dn tham gia.</span></p>\n<table align="center" border="0" cellpadding="3" cellspacing="0" class="tplCaption"><tbody><tr><td>\n				<img alt="4-cong-ty-da-cap-bi-bo-cong-thuong-rut-phep" data-natural-width="500" src="http://img.f25.kinhdoanh.vnecdn.net/2016/03/17/Con-duong-Viet-8236-1458217750.jpg"></td>\n		</tr><tr><td>\n				<p class="Image">\n					L knim mtnm thnh lp ca Con ng Vit.</p>\n			</td>\n		</tr></tbody></table><p class="Normal">\n	<span>iu kin  tr thnh nh phn phi ca n v l mua ti thiu 2,8 triu tin hng tr ln v m ti khon ti h thng ca cng ty. Chiu thc hot ng ca cng ty ny l ghp i c nhiu ngi mua hng, m nhiu ti khon s c hng mc hoa hng 8-260 triu ng mt ngy.</span></p>\n<p class="Normal">\n	Ti l k nim mt nm thnh lp vi 5.000 ngi tham gia ngy 26/5/2015, ng Nguyn Vn Bc - Ch tch HQT cng ty chia s, c ngh vng ca Vit Nam c tc dng snh ngang vi nhn sm Hn Quc, h tr iu tr ung th, d dy, cc bnh tim mch, gan mt, Alzheimer, m mu... Cc sn phm c qung co nh "thuc tin" ca Con ng Vit thc cht cha c cp php bi B Y t.</p>\n<p class="Normal">\n	Tin vo nhng qung co "trn tri" nhiu ngi dn  mc ti tham gia vi hy vng i i t cy ngh vng. C trng hp cho bit  vay mn c 140 triu ng np vo cng ty nhng ch nhn li c 28 triu ng tin hoa hng v gi n ku cu i khp ni. Sau nhiu n o, n nay, B Cng Thng  chnh thc rt giy php ng k bn hng a cp ca Con ng Vit.</p>\n<p class="Normal">\n	<span style="color:#696969;"><strong>Cng ty TNHH Tm nhn i Hng 668</strong></span></p>\n<p>\n	Cng ty TNHH Tm nhn i Hng 668 (tin thn l Cng ty TNHH Hong Thch) c thnh lp nm 2007. Ngy 1/9/2015, Cng ty ny c cp giy chng nhn ng k hot ng bn hng a cp s 053. Tr s cng ty  ng Hong o Thy (Trung Ha, Cu Giy, H Ni).</p>\n<p>\n	Trc , cng ty ny  rm r bn hng a cp d cha c giy php v b Cc Qun l Cnh tranh x pht 80 triu ng vi li vi phm trn.</p>\n<table align="center" border="0" cellpadding="3" cellspacing="0" class="tplCaption"><tbody><tr><td>\n				<img alt="4-cong-ty-da-cap-bi-bo-cong-thuong-rut-phep-1" data-natural-width="500" src="http://img.f25.kinhdoanh.vnecdn.net/2016/03/17/Dai-Hung-8143-1458217751.jpg"></td>\n		</tr><tr><td>\n				<p class="Image">\n					Cng ty i Hng 668 chnh thc b rt giy php.</p>\n			</td>\n		</tr></tbody></table><p class="Normal">\n	Vi cc sn phm l phn bn cho cy la, cy n qu, cy cng nghip... cng ty  hot ng ti nhiu tnh thnh trn c nc.  tham gia vo cng ty, mi ngi phi np ti thiu 7,9 triu ng v mua b dng c kinh doanh gm ti liu gi 190.000 ng. Cc thnh vin cng ty "n" rng c th kim hng t ng mi thng bng cch li ko ngi khc tham gia vo h thng v hng cc loi hoa hng sn phm, hoa hng bo tr trc tip, hoa hng gin tip, hoa hng qun l...</p>\n<p class="Normal">\n	Ngy 15/12/2015, cng ty  bt ng thng bo dng cc gi i l mi sau nhiu khiu ni lin quan n vic tr hoa hng.</p>\n<p class="Normal">\n	<span style="color:#696969;"><strong>Cng ty New Power Vit Nam</strong></span></p>\n<p class="Normal">\n	c cp giy php bn hng a cp s 049 ngy 5/8/2015, cng ty ny hin  i tn thnh Cng ty c phn Tri tim Ngc Vit, c tr s ti ng Trung Yn 6 (Yn Ha, Cu Giy) vi Gim c l Phm Vn Tun. Doanh nghip ny  nh trng tm l ham lm giu nhanh ca ngi nng dn nhng li thiu hiu bit khi ch yu tip th  cc min qu.</p>\n<table align="center" border="0" cellpadding="3" cellspacing="0" class="tplCaption"><tbody><tr><td>\n				<img alt="4-cong-ty-da-cap-bi-bo-cong-thuong-rut-phep-2" data-natural-width="500" src="http://img.f25.kinhdoanh.vnecdn.net/2016/03/17/new-8810-1458217751.jpg"></td>\n		</tr><tr><td>\n				<p class="Image">\n					Cng ty New Power c hng nghn ngi nng dn tham gia h thng.</p>\n			</td>\n		</tr></tbody></table><p class="Normal">\n	 tham gia, ngi dn phi np mt khon tin  mua m s ging nh mt gian hng o v mt b ti liu 220.000 ng. Mun giu nhanh th mua tht nhiu cc m s, tip  l mn li ko ngi khc vo h thng. Khi , ngi gii thiu s c hng mc hoa hng hng trm triu ng. Cng ty ch yu bn cc sn phm gn nh thc phm chc nng nhng vi gi cao hn nhiu ln so vi gi tr thc.</p>\n<p class="Normal">\n	Nhiu ngi nng dn  "cm" s  vo cng ty nhng i mi m khng nhn c tin hoa hng nn mi tin hnh khiu kin.</p>\n<p class="Normal">\n	<span style="color:#696969;"><strong>Cng ty Xut nhp khu v Thng mi Quc t TNC</strong></span></p>\n<p class="Normal">\n	Cng ty c giy chng nhn bn hng a cp s 059 cp ngy 4/11/2015. Tr s ti phng Xun Phng (Nam T Lim, H Ni). Ch tch Hi ng qun tr l ng L Chng. Mun tham gia vo h thng, cc thnh vin phi ng 7-9 triu ng  mua dng c kinh doanh. Ngoi ra, cn c nhng gi ln n 39 triu ng.</p>\n<p class="Normal">\n	 tr thnh i l cp cao, ngi dn phi li ko cng nhiu ngi tham gia vo h thng cng tt. Theo qung co, c nhng ngi vo cng ty ch mt thng nhng  c lng c t ng, thng xe t Toyota Camry...</p>\n<p class="Normal" style="text-align:right;">\n	<strong>Bch Dng</strong></p>                                    ', '', '', 1, 1, 0, 0, '', '', '', '', '', '', ''),
(22, 0, 0, 'ng Nam  lo mt go v El Nino', '', '<a href="http://kinhdoanh.vnexpress.net/tin-tuc/quoc-te/dong-nam-a-lo-mat-gao-vi-el-nino-3371501.html"><img width=130 height=100 src="http://img.f28.kinhdoanh.vnecdn.net/2016/03/17/El-nino-0-9120-1458211379_180x108.jpg" ></a></br>Mc d hin tng El Nino ang yu i, n vn tip tc gy nh hng n trng trt v chn nui ca cc quc gia ng Nam .', '                                        <p class="Normal">\n	Theo <em>WSJ</em>, nhit  trung bnh ca Tri t c o vo hi thng 2 va qua cao hn 2,43  F so vi nhit  trung bnh ca cng k trong giai on 1951-1980, s liu ca c quan Hng khng v V tr M, NASA cho bit.</p>\n<p class="Normal">\n	Mc nhit cao s ko di trong mt vi thng sau khi hin tng El Nino ht i, v vy kh nng v hn hn l iu  c d on trc. Di tc ng ca El Nino, c mt xu hng nng ln ton cu mang tnh tim n, v vy nhit  tip tc tng ln, theo ng Agus Santoso, mt nh nghin cu cao cp ti Trung tm Nghin cu bin i kh hu ti i hc New South Wales.</p>\n<p class="Normal">\n	El Nino bt u trong na u ca nm 2015, t nh im vo thng 12 v  suy yu dn. Nhng hin tng ny s tip tc nh hng n cc loi hnh thi tit m n gy bt n. Cc chuyn gia d kin thi tit s tr li bnh thng trong na cui ca nm 2016.</p>\n<p class="Normal">\n	Kiu thi tit hn lon xy ra khi gi  vng xch o Thi Bnh Dng b lm chm hoc o ngc hng. iu  gy ra cc vng nc m trn mt khu vc rng ln, c th nh hng n thi tit trn ton th gii. Mc  nghim trng ca hin tng ny c o bng nhit  nc bin v cc hot ng i lu kh quyn.</p>\n<table align="center" border="0" cellpadding="3" cellspacing="0" class="tplCaption"><tbody><tr><td>\n				<img alt="dong-nam-a-lo-mat-gao-vi-el-nino" data-natural-width="500" src="http://img.f25.kinhdoanh.vnecdn.net/2016/03/17/El-nino-0-7818-1458211379.jpg"></td>\n		</tr><tr><td>\n				<p class="Image">\n					<span>B Nng nghip cnh bo tnh trng kh hn  ng bng sng Cu Long c th ko di cho n thng 6 hoc thm ch vo cui nm nay. nh: <em>Rappler</em></span></p>\n			</td>\n		</tr></tbody></table><p class="Normal">\n	Hin tng El Nino thng lm gim lng ma nhiu ni ti min Nam v ng Nam , trong khi ti cng mt thi gian , n li mang ma n pha Ty ca M v mt phn Nam M.</p>\n<p class="Normal">\n	<span style="color:#696969;"><strong>Vit Nam ang l mt trong nhng quc gia chu nh hng nng n nht trong khu vc.</strong></span></p>\n<p class="Normal">\n	B Nng nghip v Pht trin nng thn Vit Nam c tnh hn hn ang din ra v tnh trng xm nhp mn  nh hng n 343.476 hecta la  ng bng sng Cu Long t cui nm ngoi, lm gim nng sut la t 30% n 70%.</p>\n<p class="Normal">\n	"Hn hn v xm nhp mn tr nn nghim trng trong nm nay, gy thit hi cho nn kinh t-x hi ca 9 tnh  ng bng sng Cu Long, B trng B Nng nghip v Pht trin nng thn Cao c Pht cho bit trong bo co v cnh bo tnh trng kh hn  khu vc ny c th ko di cho n thng 6 hoc thm ch vo cui nm nay, ng Pht cnh bo.</p>\n<p class="Normal">\n	Hn hn cng ang din ra mt cch trm trng  cc nc khc trong khu vc ng Nam . Malaysia, Indonesia v Thi Lan cng  ghi nhn lng ma thp trong thng 2, iu ny lm xu i trin vng vn  bi quan i vi ngnh sn xut ng, go v du c ca h.</p>\n<p class="Normal">\n	"Nu bn nhn vo bn  lng ma trong vi thng qua s thy lng ma rt t trn ton th gii. Chng ti  nhn thy rng hin tng El Nino nh hng n thi tit nh th no, v s nh hng l ln, rt ln", Aurelia Britsch, nh phn tch kinh t nng nghip khu vc chu  - Thi Bnh Dng ti Vin nghin cu BMI cho bit.</p>\n<p class="Normal">\n	B Britsch  h d bo sn lng go, ng v c ph sn xut ra trong khu vc. B cng cho rng sn lng go xut khu ca Vit Nam s gim ln u tin k t nm 2001.</p>\n<p class="Normal">\n	B Britsch lu  rng gi go s bt u tng do ngun cung hn ch trn th trng. Du c l mt trong nhng mt hng c mc tng cao nht trong 6 thng qua, gn 40% k t thng 8 nm ngoi do lo ngi v ngun cung khan him. Vi kiu thi tit kh hn tip tc, gi du c c th s tng na, cc nh phn tch cho bit.</p>\n<p class="Normal">\n	"Chng ti cho rng gi du c s tip tc tng cao hn vo cui nm nay v sang nm 2017, nu nh sn lng tip tc gim do thi tit kh ko di", ng Barnabas Gan, nh phn tch kinh t hng ho ti Ngn hng OCBC ni, ng thi d on gi du c s t 2.650 ringgit Malaysia (623 USD) mt tn vo cui nm nay.</p>\n<p class="Normal">\n	Khng nh khu vc ng Nam , Australia ch chu mt phn tc ng ca hin tng El Nino.<span>Mc d thng 2 l ma ma  pha bc, mt s ch trang tri chn nui nhn thy lng ma t hn bnh thng, buc h phi xem xt vic git tht gia sc v khng  c  chn nui.</span></p>\n<p class="Normal">\n	John Stoate, c khong 25.000 gia sc trn mt trang tri rng khong 300.000 ha  b bin pha ty bc ca Australia, ni rng ng v hng xm ca ng ang phi i mt vi nhng thch thc mi v ma t hn rt nhiu so vi trc y.</p>\n<p class="Normal">\n	"Chng ti ang gp kh khn v vn  thc n cho gia sc v phi a ra quyt nh nhng g nn gi li, nhng g nn bn i, ng ni.</p>\n<p class="Normal" style="text-align:right;">\n	<strong>Trng Ngha</strong></p>                                    ', '', '', 1, 1, 0, 0, '', '', '', '', '', '', ''),
(23, 0, 1, 'Con t ph giu nht Trung Quc chi 385.000 USD i karaoke', 'con-ty-phu-giau-nhat-trung-quoc-chi-385000-usd-di-karaoke', '<p><a href="http://kinhdoanh.vnexpress.net/tin-tuc/quoc-te/con-ty-phu-giau-nhat-trung-quoc-chi-385-000-usd-di-karaoke-3371932.html"><img alt="" height="100" src="http://img.f26.kinhdoanh.vnecdn.net/2016/03/18/wang-sicong-2608-1458275351-2618-1458276803_180x108.jpg" width="130" /></a><br />\r\nS tin Wang Sicong chi cho mt m i chi c th mua c c cn chung c  Trung Quc.</p>\r\n', '<p class="Normal">Ph nh i - th h nh giu th hai ca Trung Quc, l nhm nhng ngi b ght nht  quc gia ny v li sng xa x. Mt trong nhng nhn vt thng xuyn xut hin trn mt bo l Wang Sicong (28 tui). Anh l con trai Wang Jianlin - Ch tch hng bt ng sn Dalian Wanda, ng thi l ngi giu nht Trung Quc vi t USD ti sn.</p>\r\n\r\n<p class="Normal"><em>Shanghaiist </em>cho bit Sicong  b bt gp vo mt qun karaoke ti Bc Kinh (Trung Quc) vi ngy trc v ch trong mt m  chi ra s tin bng nhiu ngi nc ny lm c i. </p>\r\n\r\n<table align="center" border="0" cellpadding="3" cellspacing="0" class="tplCaption">\r\n	<tbody>\r\n		<tr>\r\n			<td><img alt="con-ty-phu-giau-nhat-trung-quoc-chi-385000-usd-di-karaoke" data-natural-width="500" src="http://img.f25.kinhdoanh.vnecdn.net/2016/03/18/wang-sicong-again2-4406-1458275351.jpg" /></td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n			<p class="Image">S tin trn mi ha n karaoke u rt ln.</p>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p class="Normal">6 ha n c cho l ca Wang Sicong ti hm  ang lan truyn trn Internet. 5 t ghi gi 200.000 NDT, cn t th 6 l 1,5 triu NDT. Tc l anh  chi tng cng 2,5 triu NDT (385.000 USD).</p>\r\n\r\n<p class="Normal">Con s ny rt ln so vi ha n cho m Halloween ca Sicong trc  ti mt qun bar  Sanlitun (Bc Kinh) vi 200.000 NDT.</p>\r\n\r\n<p class="Normal">Wang Sicong ni ting  Trung Quc v cch tiu tin chng ging ai. Thng 5 nm ngoi, anh khin tt c mi ngi sng st khi ng nh eo 2 chic Apple Watch cho ch. Apple Watch phin bn vng c bn vi gi 10.000 - 17.000 USD mt chic.</p>\r\n\r\n<table align="center" border="0" cellpadding="3" cellspacing="0" class="tplCaption">\r\n	<tbody>\r\n		<tr>\r\n			<td><img alt="con-ty-phu-giau-nhat-trung-quoc-chi-385000-usd-di-karaoke-1" data-natural-width="500" src="http://img.f25.kinhdoanh.vnecdn.net/2016/03/18/wang-sicong-2608-1458275351.jpg" /></td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n			<p class="Image">Wang Sicong ni ting vi li sng xa hoa. nh: <em>Shanghaiist</em></p>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p class="Normal">Trc , anh cn thu hn mt khu ngh dng  Tam   t chc sinh nht, mi nhm nhc n Hn Quc - T-ara n biu din. Wang Sicong hin iu hnh mt qu u t tp trung vo game my tnh. Anh cng l mt trong cc ph r trong m ci ca hai din vin Trung Quc - Angelababy v Hunh Hiu Minh ti Thng Hi nm ngoi.</p>\r\n\r\n<p class="Normal">Ngi dng mng Trung Quc phn ng kh tiu cc vi ha n karaoke ca Sicong. "Vi s tin ny, ti c th mua c cn chung c y ch", mt ngi cho bit. "Cng ch l ngy bnh thng ca mt ph nh i thi m", ngi khc kt lun.</p>\r\n\r\n<p class="Normal" style="text-align:right;"><strong>H Thu</strong><em> (theo Shanghaiist)</em></p>\r\n', '', '', 1, 1, 0, 1458367772, '', '', '', '', '', '', ''),
(24, 0, 0, 'Gi vng gim mnh', '', '<a href="http://kinhdoanh.vnexpress.net/tin-tuc/hang-hoa/gia-vang-giam-manh-3379997.html"><img width=130 height=100 src="http://img.f25.kinhdoanh.vnecdn.net/2016/04/02/gold7-telegraph-500x312-3770-1459558161_180x108.jpg" ></a></br>D liu lng bng v vic lm M c cng b khi sc hn gp phn xoa du nhng lo lng v trin vng kinh t M nhng ng thi cng khin gi vng gim mnh.', '                                        <p class="Normal">\n	Phin hm qua, vng giao ngay gim 1% xung 1.221,9 USD mt ounce. Trc , tng c lc gi kim loi qu ny ri xung 1.208,45 USD. Tng t, vng giao thng 6 cng gim 12,1% xung 1.223,5 USD. Nh vy, mi lng vng quy i c gi khong 32,9 triu ng. Hm qua, gi trong nc khong 33,2-33,27 triu ng.</p>\n<table align="center" border="0" cellpadding="3" cellspacing="0" class="tplCaption"><tbody><tr><td>\n				<img alt="gia-vang-giam-manh" data-natural-width="500" src="http://img.f25.kinhdoanh.vnecdn.net/2016/04/02/gold7-telegraph-500x312-9754-1459558160.jpg"></td>\n		</tr><tr><td>\n				<p class="Image">\n					Gi vng tip tc chu nh hng mnh bi cc d liu kinh t M v thng tin ca Fed v tng li sut. nh: <em>Telegraph.</em></p>\n			</td>\n		</tr></tbody></table><p class="Normal">\n	Gi vng gim sau khi bo co v lng bng, vic lm ca M trong thng 3 c cng b. Nn kinh t ny  thm c 215.000 vic lm trong thng, cao hn con s 205.000 c d bo trc . Trc khi bo co ny c cng b, cc nh u t vn n on rng M c th tng li sut vo thng 12 nm nay nhng thi im c th  c d bo sm hn.</p>\n<p class="Normal">\n	D gim trong phin u thng 4 nhng nhn chung, gi vng vn c mt qu tng tt nht trong gn 30 nm qua. Nu tnh t u nm, gi vng  tng 16% ch trong 3 thng. "C ngi trong chng ta ngh Cc d tr lin bang M (Fed) s tng li sut vo thng 6 nhng ti th li khng cho l vy. Ti tin Fed ch lm c vic ny mt ln trong nm nay m thi", Bill O''Neill, ng sng lp Cng ty u t hng ha Logic  New Jersey ni.</p>\n<p class="Normal">\n	Trong tun ny, gi vng tng 2%, phn ln nh li bnh lun ca Ch tch Fed Janet Yellen. N quan chc ny cho rng nn thn trng nu a ra quyt nh tng li sut. Ngc li, tun trc na, gi vng li gim 3% v nhng pht biu ca mt vi quan chc khc ca Fed.</p>\n<p class="Normal">\n	Nhu cu vng vt cht  cc th trng ch cht chu  nh Trung Quc v n  bt u gim nh trong tun ny. Trong thng 3, nhu cu vng  n  gim hai phn ba so vi mt nm trc y v xung mc thp nht trong 7 nm qua.</p>                                    ', '', '', 1, 1, 0, 0, '', '', '', '', '', '', ''),
(25, 0, 0, 'Nh vn Pandora sp c bn giao', '', '<a href="http://kinhdoanh.vnexpress.net/tin-tuc/bat-dong-san/nha-vuon-pandora-sap-duoc-ban-giao-3378030.html"><img width=130 height=100 src="http://img.f27.kinhdoanh.vnecdn.net/2016/03/30/29-3-201623-4213-1459304204_180x108.png" ></a></br>D n ang c hon thin phn th v s bn giao nh cho c dn vo thng 5 ti.', '                                        <p class="Normal">\n	Pandora l qun th nh vn v nh ph c pht trin bi ch u t Cng ty TNHH Lin Doanh  t Ha Bnh (VMC) ti s 53 Triu Khc, Thanh Xun, H Ni. y cng l mt trong nhng khu vc c tc  pht trin bc nht Th .</p>\n<p class="Normal">\n	Theo ch u, Pandora lun m bo tin  d n v vt k hoch. Sau khi ct nc hi cui nm 2015, cc hng mc ang hon thin phn th, trong  c mt ngoi mi cn nh  bn giao nh cho c dn vo thng 5 ti. Do vy, khch hng s nhn nh vi ng b v cnh quan, khang trang, sch p.</p>\n<table align="center" border="0" cellpadding="3" cellspacing="0" class="tplCaption"><tbody><tr><td>\n				<img alt="polyad" data-natural-width="500" src="http://img.f25.kinhdoanh.vnecdn.net/2016/03/30/29-3-20167-259890296-3751-1459304201.jpg" style=""></td>\n		</tr><tr><td>\n				<p class="Image">\n					Hin cc hng mc hon thin phn th, trong  c mt ngoi mi cn nh  bn giao nh cho c dn vo thng 5 ti.</p>\n			</td>\n		</tr></tbody></table><p class="Normal">\n	Pandora c din tch xy dng ln ti 41.648m2 gm 104 cn nh vn v nh ph vn c b tr h thng vn hoa, sn vn ring, c tng ro bo v to mi trng sng an ninh cho cc c dn.</p>\n<p class="Normal">\n	Mi cn c din tch 147-264,2m2, thit k 5 tng p ng nhu cu v din tch  cho gia nh nhiu th h. Cc nh vn u b tr h ch thang my  vic di chuyn gia cc tng ca cn nh thun li. Mi tng mang nhng chc nng chuyn bit, p ng y  cc nhu cu sinh hot ca gia nh, gip c dn tha sc sng to v bi tr khng gian sng theo mong mun.</p>\n<p class="Normal">\n	Cc cn nh b tr vi khng gian thong ng, nh sng t nhin chiu ri qua nhng khung ca s knh ln, gip cn nh bng sng t nhin, tt cho sc khe. Phn khng gian chung trong cc cn nh kh rng v thn thin ph hp vi nhu cu gii tr ca c gia nh.</p>\n<p class="Normal">\n	D n c ch u t ch trng xy dng h thng cy xanh, ng do b, cnh quan thin nhin v c mt  xy dng ch chim 30% din tch.</p>\n<table align="center" border="0" cellpadding="3" cellspacing="0" class="tplCaption"><tbody><tr><td>\n				<img alt="polyad" data-natural-width="500" src="http://img.f25.kinhdoanh.vnecdn.net/2016/03/30/29-3-201623-8231-1459304202.png" style=""></td>\n		</tr><tr><td>\n				<p class="Image">\n					Cng ty TNHH Lin doanh  t Ha Bnh.Hotline: 0934 588 871. Website:<a href="http://www.pandorahanoi.vn">www.pandorahanoi.vn</a></p>\n			</td>\n		</tr></tbody></table><p class="Normal">\n	Ngoi cc khu vui chi, gii tr, trng hc ln ln cn, ni khu d n Pandora cn b tr cc tin ch ng b, hin i, p ng ti a nhu cu an c ca ngi dn nh h thng trng lin cp t mm non n trung hc c s, b bi 4 ma, vn tic nng</p>\n<p class="Normal">\n	T Pandora ch mt 5 pht  ti trung tm hnh chnh ca qun, hn 100m ra ti ng Nguyn Tri, hm chui nt giao Thanh Xun gip d dng di chuyn t d n ti trung tm thnh ph.</p>\n<p class="Normal">\n	D n gn nhiu bnh vin nh Tu Tnh, Xy dng v cc trng i hc gm Cng ngh Giao thng Vn ti, H Ni, Kin trc, Hc vin An ninh, cc trng ph thng. Trong tng lai, ch u t s xy dng h thng trng lin cp t mm non, tiu hc v trung hc c s ngay ti ni khu ca Pandora.</p>\n<p class="Normal" style="text-align:right;">\n	<strong>Thanh Th</strong></p>                                    ', '', '', 1, 1, 0, 0, '', '', '', '', '', '', '');
